INSERT INTO `food_detail` VALUES (1,'볶음밥','[\'야채 볶음밥 냉장고속 비우기 야채들이랑, 햄, 치즈,찬밥,을 가지고 볶음밥을 만들어 먹었습니다 야채는 집에있는 어떤 야채도 다 가능해요 햄 ,치즈,없어면 계란을 넣어도 되고요 볶음밥은 어떤 재료를 넣어도 맛나요^^ 야채를 전부 깨꿋이 손질하여 준비하고 감자,당근,표고버섯,대파,햄을 전부 다져주고 팬에 식용유를 두르고 감자 ,당근 ,양파 ,대파, 단단한 순으로 익혀주시면 됩니다 야채가 다익어면 *밥두공기를 넣고 볶다가 *소금 반숟가락 *참기름 조금 *굴소스3숟가락을 넣고 볶다가 *마지막에 치즈넣고 마무리 해주세요\', \'닭가슴살 숙주 볶음밥 결혼 1주년 주말 반찬은 없고 냉장고 재료들로 볶음밥을 해서 먹습니다. 파기름을 내준 후 백종원 만능 맛간장으로 간을 하였습니다.\\n해당 내용은 아래 블로그를 참고 하시기 바랍니다.\\n감사합니다.\\nhttps://blog.naver.com/azalea7979/221389884782 [재료] 훈제 닭가슴살 200g, 대파 0.5대, 양파 1개, 양송이버섯 3개, 양배추 1컵, 백종원 만능맛간장 2큰술, 굴 소스 1작은술, 공기밥 2개, 숙주나물 300g, 후춧가루 조금, 파슬리가루 조금 프라이팬에 대파 송송 썰어 넣고 기름 충분히 둘러 파기름부터 내줍니다. 기름에 파향이 슬슬 나올 때쯤 양파를 채 썰어 다시 한번 볶아 줍니다. 양파의 색이 변하면 닭 가슴살을 잘라 볶아주고, 양배추를 썰어 볶아 줍니다. 마지막으로 버섯을 채 썰어 넣고 만능 맛간장, 굴 소스를 넣고 볶아 줍니다. 볶음 재료에 양념이 잘 섞였으면, 밥 2공기를 넣어주고 잘 볶아 줍니다. 밥과 재료가 잘 볶아졌으면 손질한 숙주와 후춧가루를 넣고 잘 볶아 줍니다. 첫 번째 결혼기념일 주말에 만들어서 첫 번째 결혼기념일 축하 메시지를 파슬리가루로 넣어 줬습니다.\']','야채  볶음밥  햄  볶음밥  야채  야채  햄  볶음밥  재료  야채  대파  햄  당근  양파  대파  야채  볶음밥  볶음밥  재료  대파  양파  백종원  대파  양파  양파  양배추  마지막  채  만능  소스  재료  밥  재료  손질  숙주  후춧가루  주말  첫  번  결혼기념일  파슬리가루'),(2,'김치찌개','[\'김치찌개, 돼지고기 김치찌개,목살 김치찌개,초간단 김치찌개 된장찌개와 양대산맥인 김치찌개! 돼지고기넣은 김치찌개를 초간단으로 만들어봅시다!! 식당에서 먹는맛과는 차원이 다른 집밥 김치찌개 맛! 돼지고기는 후추로 잡내를 잡아줘야합니다.\\n묵은지사용하시는 분들은 설탕이나 물엿,매실액기스등으로 신맛을 꼭 잡아줘야해요\\n부족한 간은 간장이나 소금으로 맞추면 됩니다. [재료] 돼지고기 국거리용 한주먹, 양파 or 양파김치 한주먹, 묵은김치 or 익은김치 한주먹 +반주먹, 청양고추 다짐용 1개, 청양고추 2개\\n[양념] 다진마늘 1베라스푼, 청양고추작은거1개 다져서, 고춧가루 2베라스푼 재료준비!\\n돼지고기 목살도 좋고, 삼겹살도 좋고 다좋아용.\\n저는 국거리용 돼지고기가 있어서 한주먹.\\n청양고추 작은거 다져서 하나 준비하구용\\n양파가 없어서 양파김치로 대체했어요 양파사용하셔용~ 아니면 처럼 양파김치하셔도 되구용\\n묵은김치나 익은김치로 한주먹하고 반절정도 준비하세용 묵은지를 사용하신다면 저처럼 설탕을 조금만 미리 뿌려주셔용 신맛을 잡아줍니다용! 국거리용 돼지고기는 후추로 밑간 살짝 해주세용 딱히 양념이랄건 없지만, 그래도 김치찌개 맛을 더 맛있게 해주기때문에 김치찌개 양념이라고 해보죠!^^\\n다진마늘 1베라스푼 + 청양고추 작은거 다져서 + 고춧가루 2베라스푼 이렇게 준비해서 섞어주세용 아무냄비나 준비하시구용 참기름이나 들기름을 사용하시면 더 고소한맛이나고 감칠맛이나서 좋지만, 저는 그냥 올리브유 사용했습니다. \\n돼지고기 들어간 김치찌개는 기름이 많이들어갈수록 더 맛있어지니까요.\\n향을 포기하고 맛만 택한듯.ㅎㅎ 돼지고기의 붉은기가 없어지고 살짝 익어지면 이때!\\n설탕쳐둔 김치와 양파를 넣고 같이 볶아주세용\\n얘네들도 같이 볶아주면서 숨을 죽여놔야지 더 맛있어져요~ 색깔차이 보이시죠? 빨간색에서 갈색과 주황색의 사이의 색으로 변했어용~ 물을 넣고 끓여주세요~ 팔팔 끓으면, 아까 준비했던 김치찌개 양념!\\n양념을 넣고 또 팔팔 끓여줍니다.\\n양념은 지극히 개인적으로 칼칼한 맛으로 먹기위함이니까 매운맛을 싫어하시면 그냥 패스하셔용! 한번 팍 끓이고나서 간을 보면 조금 싱거울수있어요ㅠ\\n왜냐면 김치랑 물의 비율이 안맞으니까요\\n간을 맞춰야죠!\\n저는 소금간으로 맞춰줬어요 \\n한숟갈조금 못되는정도의 양으로 넣어주면 되더라구용\\n(중간중간 간보면서 조절해주세용) 물엿은 반숟갈정도 넣어줬어요\\n저는 묵은지 넣고 끓여서 김치의 신맛이 강해서 물엿은 꼭 넣어서 김치의 신맛을 잡아야겠더라구요!\\n물엿,설탕,매실액기스 등 대체도 가능해요\\n\\n다시한번 팔팔 끓여주세용 두부 썰어서 넣어줍니다.\\n마지막 단계에서 집에 대파있으신 분들은 대파도 같이 쫑쫑쫑 썰어서 넣으시면 되세용~ 냄비째 그대로 놓고 먹을수없으니 뚝배기에 담아내서 맛있게 먹으면 되용!\', \'돼지 등갈비 묵은지 김치찌개 안녕하세요. 초이맘이에요^^\\n\\n돼지 등갈비 묶은지 김치찌개 언제 먹어도 맛있어요.\\n아이들은 고기를 좋아하지만 저는 김치가 더 맛있는것 같아요.\\n묵은지 푹 익혀서 밥에 척척올려서 먹으면 꿀맛이에요.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n돼지등갈비 묵은지 김치찌개 [재료] 등갈비 10대, 묵은지 1/8쪽, 묵은파김치 조금, 물 300ml, 들기름 1스푼\\n[양념] 대파, 다진마늘 1스푼이상 지난번 등갈비찜 해먹고 남은 등갈비10대를 물에 담가놓았어요. 묶은지 1/8쪽을 꺼내 놓았어요. 묶은지를 깔고 그위에 묶은 파김치를 조금넣었어요.\\n물도 300ml를 부어주고 끓여주었어요.\\n\\n들기름 1스푼을 넣고 뚜껑을 닫고 센불로 끓여주었어요. 10분정도 끓이다가 돼지등갈비를 넣은 \\n다음 뚜껑을 열어둔채로 끓여주었어요. \\n혹시 국물이 줄어들면 물은 약간 더 부어주어도 돼요. 대파와 다진마늘을 준비해두었어요. 뚜껑을 열어둔채로 센불에 부글부글 끓여주고 \\n다진마늘을 수북이 한스푼을 넣어 계속 끓여 주었어요. 20분정도 끓여주었더니 아주 맛나게 되었어요.\\n어슷어슷 썰어준 대파를 듬뿍 넣어주고 마무리를 해주었어요. 이렇게 해서 아주 맛있게 끓여진 돼지 등갈비 김치찌게가 완성되었어요. 돼지등갈비 살은 쫀득쫀득 묵은지는 넘 맛있어 무어라 할말없어요~~ㅎㅎㅎ \\n내가 해 놓고도 감탄 했어요. 국물도 후루룩~\']','김치찌개  돼지고기  김치찌개  김치찌개  김치찌개  김치찌개  초간단  김치찌개  맛  돼지고기  신맛  돼지고기  국거리용  한주먹  한주먹  한주먹  청양고추  청양고추  다진마늘  국거리용  돼지고기  한주먹  양파김치  익은김치  한주먹  지  저  설탕  신맛  국거리용  돼지고기  후추  김치찌개  맛  김치찌개  청양고추  작은거  +  고춧가루  저  사용  \\\\돼지고  김치찌개  맛  돼지고기  김치  양파  물  김치찌개  양념  \\\\양념  맛  간  김치  물  \\\\저  지  김치  신맛  물엿  김치  신맛  대파  들  대파  등갈비  지  김치찌개  등갈비  지  김치찌개  저  김치  지  김치찌개  재료  등갈비  지  들기름  대파  다진마늘  물  지  지  뚜껑  뚜껑  물  대파  다진마늘  준비  뚜껑  채  센불  대파  돼지  등갈비  돼지등갈비  지  국물'),(3,'된장찌개','[\'새우 버섯 된장찌개 오늘따라 된장찌게가 생각나서 끓여봤습니다. \\n마침 새우도 냉동실에!!!\\n\\n1 Cup = 250 ml [재료] 고추장 0.5 스푼, 조개멸치 된장 2 스푼, 청국장가루 1 스푼, 두부 (반 모) 219.5 g, 물 3 Cup, 새우 7 개, 마늘 8 알, 팽이버섯 1 묶음, 느타리버섯 약간, 새송이버섯 1 개, 애호박 (작은것) 1 개, 고추 1 개\\n[멸치육수] 마른멸치 8-10 개, 다시마 (작은것) 2 장 재료를 준비해 주세요!!! 멸치 다시물을 먼저 만들어요.\\n물 끓기 전부터 마른멸치와 다시마를 넣어 줍니다.\\n끓고 10분뒤에 건져냅니다. 멸치 다신물에 된장 2 스푼을 풀어주세요. 된장을 풀은 후 고추장 반스푼 풀어주세요. 된장과 고추장을 풀은 물에\\n\\n두부 반모 + 팽이버섯 + 새송이버섯 + 느타리버섯 + 새우\\n\\n넣어줍니다. 마늘 + 애호박\\n\\n넣어줍니다. 대파 + 고추\\n\\n넣어줍니다. 청국장 가루를 넣어줍니다.\\n\\n스멜~~ 맛있게 그릇에 담아줍니다 :)\', \'향긋한 달래 된장찌개 \\n맛있게 끓여보세요~~^^ 향긋하고 구수한 달래된장찌개\\n오늘아침끓였는데 신랑이너무잘먹네요~~^^\\n\\n\\n 된장찌게물의양이많음싱거워요\\n뚝배기에 2/3안되게 맞춰주세요\\n\\n달래는불끄기직전넣고 바로먹어야 맛있어요\\n\\n설탕한꼬집은 된장의떫은맛을 잡아줍니다\\n\\n 달래 반줌, 두부 적당량, 양파 1/2개, 애호박 적당량, 청양고추 1개, 무우 적당량, 새송이버섯 집된장 1T, 시판된장 0.5T, 다진마늘 1t 티스푼, 액젓 1t티스푼, 설탕 한꼬집, 쌀뜨물, 멸치다시마 적당량, 고추가루 쌀뜨물을준비해주세요 쌀뜨물에 멸치다시마를넣고끓여주세요 육수내는동안 호박 무우 양파 버섯은 송송썰어서준비해주세요 멸치다시마육수가만들어지면 집된장1T 시판된장0.5T 풀어주고 야채를넣고끓여주세요 간조절은 다진마늘 1t 티스푼, 액젓1t티스푼,설탕한꼬집넣고 조절하세요\\n고추가루도 1/2T같이넣어주세요 거의다끓일때쯤 두부넣고 청양고추넣고\\n한번더끓여주신다음 불을끄기직전 달래반줌 넣어주세요 \\n(달래는 여러번 깨끗히씻어서 알뿌리겉껍질까지다듬어주세요)\']','새우  새우  고추장  스푼  된장  스푼  스푼  새우  개  새송이버섯  개  개  개  것  재료  마른멸치  멸치  된장  스푼  된장  고추장  된장  고추장  +  팽이버섯  +  새송이버섯  +  느타리버섯  +  마늘  +  +  된장찌개  향긋  두부  적당량  애호박  적당량  적당량  새송이버섯  적당량  쌀뜨물  무우  양파  버섯  다진마늘  티스푼'),(4,'닭갈비','[\'닭갈비 볶음 레시피 (닭갈비 볶음밥) 오늘 소개해 드릴 음식은 닭갈비를 만들기 위해 재래시장을 다녀 왔습니다\\n주말은 가족들이 한자리에 모이기 때문에 왠지 평소보다는\\n특별한 음식을 하고싶은 마음이 우리 엄마들의 \\n 마음 아닐까요 \\n저렴하며 푸짐하고 맛있는 밥상 닭갈비볶음을 소개 합니다 마트보다 재래시장에선 닭 한마리 6000원짜리 사면\\n뼈를 무료로 발라 줍니다\\n뼈는 따로 육수내서 닭칼국수 끊이면 요즘 추울때\\n딱이죠^^\\n 닭 1마리 뼈 손질한 순살, 고구마 1개, 양파 1/2개, 양배추 1/4개, 떡국떡 100g, 당근 1/2개, 깻잎 100g 매운고추장 2스푼, 조림간장 2스푼, 고추가루 1스푼, 다진마늘 1스푼, 설탕 1스푼, 올리고당 1스푼, 매실청 2스푼, 후추가루 약간 뼈바른 순살 닭 1마리 입니다\\n깨끗이 여러번 씻어 주시고요 씻은 닭고기는 물기를 빼 주세요 각종 야채를 보기좋게 썰어서\\n준비 하시고요\\n*좋아하거나 가족들에게 먹이고싶은\\n야채들을 준비하시면 되겠습니다 깻잎도 추가 했고요 순살 닭고기와 위에서 준비하신\\n양념으로 조물조물 무쳐서 중불로\\n볶아 주세요 닭고기가 어느정도 익으면 깻잎만\\n빼고 준비하신 야채들을 넣고 \\n닭고기와 함께 볶아 주시며 마지막에 깻잎은 넣고 휘리릭 섞어\\n주시면 닭갈비볶음 완성 됩니다\\n깻잎향이 살아있어 맛이 더욱\\n좋네요^^ 남은 양념에 밥 한공기+ 김\\n가루+깻잎약간+참기름 한방울\\n 넣고 중불에서 달달 볶아 주세요\\n누룽지를 살짝 만들면 긁어 먹는\\n재미가 솔솔솔~~ 마지막에 통깨까지 솔솔 뿌리면\\n이 맛~??\\n닭갈비 볶음 생각보다 어렵지 않죠\\n집에서 간단하게 만들어서 가족들과\\n푸짐하게 즐겨 보세요\', \'닭가슴살로 만든 닭갈비 호주에서 유학시절..\\n한국음식이 그리워서 많이 해먹었던 닭갈비.\\n집에 닭가슴살이 남아있어\\n만들어 먹었어요~^^\\n 닭가슴살은 퍽퍽하지 때문에 재울때 사과즙이나 배즙(파인애플즙)등을 같이 넣어주면 퍽퍽한 닭가슴살이 연해져요. [준비재료] 닭가슴살 2덩이, 대파 1개, 양파 반개, 고구마 작은사이즈 2, 버섯 양껏, 홍,청고추 각 1개씩, 깻잎 5장, 양배추 1/8\\n[양념] 고추장 2T, 간장 3T, 다진마늘 2T, 고춧가루 2T, 맛술 3T, 올리고당 3T, 와사비 1t, 참기름 2T, 후추 약간, 생강가루 약간 우선 닭가슴살을 씻어서 자르고 칼집을 살짝 내주고 밑간을 해요.\\n다진마늘 약간,후추,생강가루 약간 그리고 맛술1푼 넣고 10-20분간 뒀다가\\n양념을 만들께요. 위에 적힌 양념재료{고추장2스푼, 간장3스푼,다진마늘2스푼, 고춧가루2푼,맛술3스푼, 물엿이나 올리고당3스푼, 와사비1커피스푼, 후추약간,생강가루약간, 참기름 2스푼}들을 모두 넣고\\n닭가슴살을 버무려 줄께요 요렇게 하룻동안 재워두면 양념이 베어들고\\n물이 좀 생겨요.!\\n이때 사과즙이나 배즙(파인애플즙)등을\\n같이 넣어주면 퍽퍽한 닭가슴살이 연해져요. 그럼 이제 야채를 준비할께요^^ 양배추는 썰어서 물기를 빼둬요. 그럼 이제 팬에 기름을 두르고 \\n재운 고기를 볶아요! 중불에서 조금만 익히다가 여채를 넣어줄께요.\\n양배추와 양파를 먼저 넣어주세요 이제 고구마를 넣고 \\n볶다가 파를 넣어주세요.\\n거의 다 익어가고 있어요. 2-3분만 더 볶아주다가 \\n접시에 담아서 드시면되요!\\n\\n고구마를 좋아하시는\\n부모님을 위해 고구마를 듬뿍 넣었어요^^\']','닭갈비  음식  마음  소개  재래시장  닭  닭  고구마  양파  양배추  깻잎  닭  닭고기  가족들  깻잎  순살  닭고기  닭고기  깻잎  닭갈비볶음  마지막  맛  닭갈비  닭갈비  닭가슴살  닭가슴살  때문  닭가슴살  닭가슴살  양파  고구마  깻잎  양배추  다진마늘  올리고당  닭가슴살  약간  후추  생강가루  위  참기름  양념  사과즙  퍽퍽한  닭가슴살  야채  양배추  중불  양파  고구마  고구마'),(5,'닭도리탕','[\'매운 닭볶음탕, 닭도리탕 만들기 닭한마리 요리 레시피 매운 닭볶음탕(닭도리탕)\\n닭한마리 요리 레시피recipe \\n\\n모두가 좋아하는 닭한마리 요리 매콤한 닭볶음탕\\n국물은 자작하게 제철 감자 듬뿍 더해서 여름 보양식으로 미리 즐겼답니다\\n특히나 이 자작한 국물에 마지막 밥 말아 먹으면 정말 꿀맛\\n닭의 기름기를 쏘옥 뺀 담백하면서도 깔끔한 맛의 닭도리탕 만들어 볼께요 닭의 누린내 잡고 기름기를 제거하는 과정\\n\\n냄비에 닭한마리가 잠길 정도로 물을 넣고 \\n팔팔 끓으면 닭을 넣고 5분간 데쳐 주세요 \\n\\n전날 청주와 생강에 재우지 못했다면\\n데치는 과정에서 생강 또는 생강가루 청주 넣어서 데치셔도 됩니다 \\n [재료] 닭볶음탕용 1마리(1kg) 감자 중간사이즈 2개, 양파 작은것 1개 대파 10cm 1대, 당근 1/4개 올리브유1큰술, 물 2컵\\n[양념] 설탕 1큰술 굵은고춧가루 1큰술, 청양고춧가루 1큰술 고추장 4큰술, 간장 5큰술 맛술 2큰술, 매실청 1큰술 올리고당 2큰술, 다진마늘 2큰술 생강가루 약간, 후춧가루 약간 닭은 전날 깨끗이 씻은 다음 청주 3큰술 생강 썰어 넣어 조물조물 재워둡니다\\n전날 이렇게 미리 해 두면 닭고기 자체 육질도 연해지고 잡내도 싸악 잡아 준답니다 \\n\\n저는 시간이 없어서 재우지는 못하고 이날은 끓는물에 청주와 생강을 넣어서 데쳤답니다 양파는 반으로 갈라 도톰하게 썰어 주시구요 \\n당근도 비슷하게 \\n대파는 어슷 썰어 준비 합니다 감자는 껍질을 벗기고 2-3등분으로 잘라 주었답니다 \\n뭉그러지는게 싫으시다면 감자 모서리를 다듬어 주세요 핵심 닭볶음탕 양념장 만들기\\n위 레시피 모두 넣어 주세요 그리고 고루 잘 섞어 주시면 됩니다 \\n살짝 드셔 보시고 단맛은 조절해 주심 되는데요 \\n너무 달면 맛이 없으니 이 정도가 저는 적당 하네요 닭의 누린내 잡고 기름기를 제거하는 과정\\n\\n냄비에 닭한마리가 잠길 정도로 물을 넣고 \\n팔팔 끓으면 닭을 넣고 5분간 데쳐 주세요 \\n\\n전날 청주와 생강에 재우지 못했다면\\n데치는 과정에서 생강 또는 생강가루 청주 넣어서 데치셔도 됩니다 \\n저 그렇게 했어요 ㅎ 5분후 삶아서 건졌어요 \\n\\n맛을 생각하면 기름에 볶아 주어야 맛있긴 한데 \\n건강을 생각한다면 담백하게 데쳐서 넣어 주시는게 좋아요 냄비에 올리브유 1큰술 두르고 데친 닭과 감자 당근을 넣고 양념장을 \\n모두 넣어 준 다음 약불에서 타지 않게 1-2분 정도 볶아 줍니다 한번 볶은 다음 물을 넣어 주어야 양념이 겉돌지 않습니다 물 2컵을 넣어 주고 팔팔 끓으면 중불에서 뚜껑을 닫고 한 10-15분 정도 끓여 주세요 중간에 양파와 대파를 넣어 주고 10분 정도 끓여 주면\\n어느정도 닭이 다 익는 답니다 국물을 좋아하신다면 이 상태에서 바로 드심 되구요 \\n약간 국물 없이 조림 스타일로 드시고 싶으시다면 약간 더 졸이시면 됩니다\', \'닭볶음탕 황금레시피, 밖에서 사 먹는 닭도리탕 맛을 집에서 내봤어요 ~ 오늘은 닭볶음탕을 만들어보았어요. [재료] 닭볶음탕용 닭 1마리, 감자 2개, 양파 1개, 당근 1/3개, 다진 대파(또는 쪽파) 2줌, 물 600ml, 통깨 약간\\n[양념장] 고춧가루 2 큰 술, 고추장 4 큰 술, 진간장 10 큰 술, 다진 마늘 1 큰 술, 설탕 4 큰 술, 올리고당 1 큰 술, 생강가루 1 작은 술, 미림 2 큰 술, 후춧가루 약간 먼저 감자는 1개당 4등분으로 나누어줬고요. 테두리를 둥그렇게 깎아 준비했어요.\\n\\n양파와 당근은 먹기 좋은 크기로 잘라주시고요. 대파(또는 쪽파)는 송송 썰어주세요.\\n\\n\\n**\\n취향에 따라 떡국 떡이나 당면을 넣어주셔도 좋아요.\\n\\n(당면은 요리 30분 전 미리 찬물에 담가두었다가 사용하세요.)\\n** 고춧가루 2 큰 술, 고추장 4 큰 술, 다진 마늘 1 큰 술, 진간장 10 큰 술, 설탕 4 큰 술, 올리고당 1 큰 술, 미림 2 큰 술, 생강가루 1 작은 술, 후춧가루 약간 넣고 잘 섞어 양념장을 만들어주세요. 닭볶음용 닭은 불필요한 지방 덩어리 손질 후 흐르는 물에 깨끗이 씻어주시고요.\\n\\n(우유에 10-15분 정도 재워주셔도 좋아요.) 끓는 물에 살짝 데쳐준 뒤 흐르는 물에 닭을 헹궈주세요. 냄비에 닭과 양념장, 물 600ml를 넣어주시고요.\\n\\n국물이 끓어오르면 감자를 넣고 20-30분 정도 중불에서 끓여주세요. 20-30분 후 국물이 어느 정도 졸아들고 닭과 감자가 익으면 양파와 당근도 넣어주시고요.\\n\\n한소끔 더 끓여주세요.\\n\\n**\\n국물 맛을 한 번 보시고, 약간 싱겁다면 간장을 약간 추가해주시거나 국물을 좀 더 졸여주세요 ^^\\n** 저는 조금 더 졸여줬고요.\\n\\n마지막으로 송송 썬 대파(또는 쪽파)를 넣고 마무리해주었어요. 닭볶음탕 맛있게 먹는 방법 알려드릴까요? 많이들 알고 계시는 방법이겠지만, 일단 닭고기 한 점을 앞접시에 갖다 놓고 살만 싹 발라내요.\\n\\n그리고 나서 포슬포슬 잘 익은 감자도 하나 가져오고요.\\n국물을 세 숟가락 정도 담아주세요.\\n\\n마지막으로 김이 모락모락 나는 갓 지은 흰쌀밥을 한 숟가락 푹 퍼서 대충 비벼 먹는 거죠 ~\\n\\n여기에 김가루 살살 뿌려서 같이 먹어도 짱 맛있다는 거 +_+\\n\\n하긴... 뭐든 안 맛있겠어요.\\n\\n닭볶음탕인데 ㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ 식당에서 먹는 닭볶음탕 그대로 집에서 쉽게 만들어 먹을 수 있는 오늘의 뽕림이표 닭볶음탕 황금레시피 -\\n\\n이웃님들도 한 번 만들어드셔보세요 :)\']','닭도리탕  닭한마리  요리  요리  닭한마리  요리  국물  기름기  맛  닭도리탕  닭  기름기  닭한마리  정도  물  닭  청주  생강  생강  생강가루  청주  양파  당근  설탕  고추장  올리고당  생강가루  후춧가루  닭  다음  청주  생강  청주  생강  양파  닭볶음탕  양념장  레시피  맛  정도  닭  내  기름기  제거  과정\\\\\\\\냄비  닭한마리  정도  물  \\\\팔팔  닭  \\\\\\\\전날  청주  생강  못했다면\\\\데치  과정  생강  생강가루  청주  생각  담백  닭  당근  양념장  다음  정도  다음  물  정도  양파  대파  정도  닭  국물  국물  닭도리탕  맛  닭볶음탕  재료  닭볶음탕용  닭  양파  당근  대파(또  쪽파)  술  고추장  술  술  술  설탕  술  올리고당  술  생강가루  술  술  후춧가루  준비  당근  대파(또  쪽파)  요리  고춧가루  술  고추장  술  마늘  술  진간장  술  설탕  술  올리고당  술  미림  술  생강가루  술  후춧가루  양념장  닭  물  깨끗  정도  물  물  닭  냄비  닭  양념장  감자  정도  중불  후  국물  정도  닭  감자  양파  당근  맛  간장  국물  저  대파(또  쪽파)  닭볶음탕  방법  닭고기  감자  정도  \\\\\\\\마지막  숟가락  것    닭볶음탕  집  오늘  닭볶음탕  번'),(6,'불고기','[\'간단한 한우 불고기 초밥 한우 불고기를 이용한 초밥입니다! 기호에따라 레몬즙이나 쌈장에 찍어드시면 훨씬 맛있습니다! 재료를 준비해줍니다. 양파를 썰어 물에 담구어둡니다. 후추, 소금, 올리브오일로 고기 간을 맞춥니다. 데리야끼 소스를 부어 주물주물 버무려줍니다. 무순을 준비합니다. 무순은 밑부분은 자르고 흐르는 물에 씻어줍니다. 양념된 불고기를 달구어진 팬에 구워줍니다. 고기가 맛있게 익도록 살짝 구워줍니다. 밥을 동글동글하게 뭉쳐줍니다. 구운 불고기를 밥 위에 올려줍니다. 양파와 무순을 올려줍니다.\', \'주꾸미 콩나물 불고기 냉동실에 있던 주꾸미를 녹혀 불고기 해서 먹었어요~ㅎ 냉장고에 남은 콩나물이 있어서 넣어봤는데 아삭아삭 식감도 좋고 맛도 좋더라구요~ 없다면 안 넣고 하셔도 됩니다~ [재료] 주꾸미 15마리, 목전지살 1근, 콩나물 1/2봉지, 양파 1개, 표고버섯 2개, 당근 채썬거 조금, 청양고추 2개, 홍고추 1개, 대파 2대\\n[불고기양념] 고추장 2큰술, 고춧가루 3큰술, 간장 2큰술, 요리당 4큰술, 참치액 1큰술, 들기름 1큰술, 소금, 후춧가루, 참기름 1큰술, 통깨 1작은술, 미림 1큰술 우선 냉장고에 있는 야채들 꺼내 손질해줍니다.\\n저는 양파, 표고버섯, 청양고추, 홍고추, 당근, 대파 꺼내 썰어두었어요. 분량의 양념들을 넣어 양념장을 만들어 둡니다. 주꾸미는 해동해서 밀가루와 소금으로 해감한뒤 내장 제거 해주었어요. 돼지고기는 목전지살로 준비했구요. 돼지고기 위에 주꾸미 넣어주는데요.\\n가위로 머리랑 다리 잘라서 넣어주었어요. 양념장 4큰술 넣어 조물조물 무쳐주고 잠시 놔둡니다. 콩나물은 먹다 남은게 있어서 반봉지 씻어서 준비합니다. 웍을 달군 후에 바로 무쳐둔 주꾸미와 돼지고기를 올려 볶아줍니다. 고기랑 주꾸미가 살짝 익어갈때쯤 있는 야채들 모두 넣어주고요. 남아있던 양념장 모두 넣어서 같이 볶아줍니다. 이렇게 계속 요리수저로 볶아주면 됩니다. 볶아주다가 뚜껑 덮고 중불에 놔둡니다.\\n이렇게 하면 속까지 익힐 수 있어요~ 뚜껑 열고 미림 1큰술 정도 넣어줍니다. 야채에서 물도 생기고 고기랑 다 익었을때 콩나물 씻어 놓은거 올려주고요. 뒤집어서 익혀줍니다. 콩나물이 익었으면 마지막에 참기름 1큰술과 통깨 뿌려주면 주꾸미 콩나물 불고기 완성입니다~\']','불고기  한우  불고기  준비  양파  물  소금  고  무  준비  무  물  불고기  고  불고기  밥  양파  무  콩나물  불고기  주꾸미  불고기  콩나물  재료  주꾸미  콩나물  양파  소금  냉장고  양파  표고버섯  당근  대파  양념장  주꾸미  소금  돼지고기  목전지살  돼지고기  위  주꾸미  양념장  콩나물  준비  주꾸미  돼지고기  고  주꾸미  야채들  양념장  뚜껑  미림  물  고  때  콩나물  콩나물  참기름  통깨  주꾸미  콩나물  불고기'),(7,'삼겹살','[\'단짠단짠 일본풍 삼겹살 덮밥 우리 아들이 좋아하는 일본풍으로 삼겹살 덮밥을 만들었어요. 매운걸 싫어해서 간장과 물엿으로 단짠단짠 맛을 더했구요 [재료] 삼겹살 150g, 양파 1/2개, 팽이버섯 1/2개, 밥 1공기, 계란 1개\\n[양념] 진간장 4T, 물엿 4T, 후추 조금, 소금 1t 양파는 채썰어주시고 팽이버섯는 잘게 찢는다. 팬에 식용유를 두르고 양파의 숨이 죽을때까지 볶는다. 볶을때 소금을 살짝 뿌려준다. 완성되면 다른 접시에 덜어둔다. 팬에 삼겹살을 올려 노릇하게 구워준다 노릇하게 구웠으면 분량의 간장과 물엿을 넣는다. 이때 물을 4T 같이 넣는다. 고기는 먹기 좋은 크기로 잘라준다 양념이 잘 베일 수 있도록 삼겹살을 뒤집어준다. 양념이 졸아들면 불을 끈다 다른 팬에 식용유를 두르고 계란을 깨서 넣는다. 에그스크럼블 느낌이 나도록 노른자와 흰자를 휘휘 저어준다. 어느정도 느낌이 나면 불을 끈다. 이쁜 사발그릇에 밥을 담는다. 양파 버섯 볶은 것을 위에 올린다 노릇노릇 구워 단짠소스로 코팅한 삼겹살을 올리고 남은 소스를 한바퀴 둘러준다 마지막으로 에그스크럼블을 올려주면 끝.\', \'언두부를 넣은 얼큰한 삼겹살 된장찌개:D 신랑이 된장찌개를 먹고싶다고해서 저녁메뉴로 만들어봤어요:D 짜게 먹는 것을 안좋아해서 말이 찌개지 된장국처럼 좀 싱겁게 끓입니다.\\n채소랑 두부를 많이 넣어서 밥은 적게 먹고 채소건더기로 배채우면 좋더라고요.\\n끓일수록 양파는 국물에 녹아들고 구수하고 얼큰해서 좋네요:D [재료] 양파 2개, 호박 1개, 삼겹살 3줄, 청고추 홍고추 적당량, 대파 1줌, 언 두부 1모, 말린표고버섯 적당량, 무 1줌\\n[양념] 쌀뜨물 1대접, 된장 적당량, 후추 약간 양파,무,호박 먹기 좋은 크기로 썰기. 표고버섯 뜨거운물에 불려서 먹기 좋은 크기로 자르기.\\n*불린 물 버리지말고 넣기. 쌀뜨물 붓고 불켜기. 된장 풀기. 끓기 시작하면 불린 표고버섯이랑 무를 먼저 넣기. 삼겹살 세 줄을 통채로 넣어서 어느 정도 익으면 가위로 먹기 좋은 크기로 자르기. 홍고추 청고추 적당량 넣기.\\n호박 양파 넣기. 대파 한줌 넣기. 언두부 넣기.\']','삼겹살  일본풍  삼겹살  덮밥  물엿  삼겹살  양파  밥  물엿  양파  팽이버섯  팬  양파  때  소금  팬  삼겹살  노릇하  간장  물엿  삼겹살  양념  팬  식용유  계란  불  밥  양파  삼겹살  에그스크럼블  삼겹살  된장찌개  것  밥  양파  재료  양파  삼겹살  적당량  두부  적당량  적당량  후추  양파  무  호박  물  쌀뜨물  된장  표고버섯  삼겹살  홍고추  청고추  적당량  양파  대파'),(8,'수육','[\'김장철! 김장김치 자투리 채소로 저수분 수육 삶기! (압력솥 수육 맛있게 만드는 법) 한창 쌀쌀한 요즘, 다들 감기엔 안 걸리셨나요?\\n주말동안 할 일이 참 많아요.\\n겨울 옷도 꺼내야 하고, 겨우내 수고해줄 전기장판도 꺼내야 하고, 그 김에 대청소도 하고…\\n\\n그 중에서도 가장 신경이 쓰이는 건 겨울맞이 김장김치 담그는 일인 것 같아요.ㅠㅠ\\n\\n보통 입동 전후로 다가오는 김장철!\\n김장김치에서 빠질 수 없는 게 있죠? \\n바로 돼지고기 보쌈, 수육인데요.\\n김장이 끝나고 새로 한 김치와 따끈한 수육을 한 입에 넣으면, 크으~\\n이 맛에 김장한다고 해도 과언이 아니에요 \\n\\n특히 압력솥을 이용하면 기름기와 느끼함을 쏙 뺀!\\n부드러운 육질의 수육을 빠르고 간단하게 만들 수 있어 많이 사용하시죠. \\n\\n그래서 오늘은 특별히 김장하고 남은 자투리 야채를 활용한 저수분 수육 만드는 법을 준비해봤어요.\\n\\n손질하고 애매하게 남은 자투리 채소를 수육 만들기에 활용해 주시면, 남은 야채도 사용할 수 있고 잡내없이 맛있는 저수분 수육도 만들 수 있어서 일석이조, 꿩먹고 알먹기랍니다. :) 부드러운 육질의 저수분 수육을 집에서 손쉽게 만드실 수 있는 PN풍년 압력솥! 사용하고 난 뒤에는 패킹의 기름기도 깨끗이 닦아주세요~! [재료] 삼겹살, 된장, 맛술, 생강, 무, 양파, 대파, 마늘, 통후추\\n[조리도구] 네이쳐스톤압력솥, 블랙로카IH3in1 된장 한 큰술과 맛술, 그리고 다진마늘과 생강을 넣어 섞어주세요.\\n\\n(저는 생강이 없어 생강분말을 사용했답니다. 김장김치 담글 때 마늘과 생강 다져둔 것이 남았다면 넣어주세요!) 된장양념에 삼겹살을 넣고 양념을 골고루 묻혀주세요. 김장하고 남은 자투리 채소(무, 양파)를 네이쳐스톤 압력솥에 바닥이 보이지 않을 정도로 깔아주세요. 양념한 삼겹살과 대파, 마늘, 월계수잎 등 추가 향신채를 넣어주세요. 압력솥 뚜껑을 닫고 중강불에서 가열하다가 신호추가 울리면 중약불로 줄여 15~25분간 추가로 익혀주세요. 압력이 다 빠질 때 까지 15분가량 뜸들인 뒤 신호추와 안전밸브를 젖혀 잔압을 확인한 뒤 뚜껑을 열어주세요. 수분이 많은 가을무를 넣어 촉촉함이 살아있는 초간단 수육 완성! 먹기 좋은 크기로 자른 수육은 김장김치, 채소 등과 곁들여 주세요.\', \'돼지고기 수육 맛있게 삶는법 오늘은 불금 이네요\\n오랜만에 통삼겹살 수육으로 저녁준비를 합니다\\n초보자도 쉽고 맛있게 할수있도록 준비를 \\n하겠습니다^^ 통삼겹살 수육 삶을때 압력솥보다는 시간이 걸리더라도\\n일반냄비로 삶는방법이 맛은 더 좋습니다\\n다른소스 보다 새우젖양념 정말로 환상의 콤비네요 돼지삼겹살 2kg, 집된장 2스푼(밥숟가락), 양파 1개, 대파 2대, 통마늘 7개, 월계수잎 5장, 생강 2개 새우젖 1컵, 청양고추 2개, 깨소금 약간, 참기름 약간, 마늘 3개 통삼겹살 2kg 준비 했고요 냄비에 준비하신 재료들을 넣고 된장도 함께요. 잡내 제거 됩니다 센불로 끓으면 중불로 주려서\\n10분정도 끓이면 맛이 우려납니다 이때 삼겹살 넣고 중불로\\n40분~1시간정도 끓으면 먹기좋은\\n정도로 삶아 집니다 육즙이 가득하며 야들야들 보들보들 잘 익었네요\\n최대한 얇게 썰어 주세요 새우젖1컵,청양고추2개 (청고추,홍고추)송송썰고\\n고추가루 약간 넣고 통마늘도 먹기좋게 썰어서 통깨 솔솔솔 \\n무쳐 주세요 먹음직스런 돼지고기와 새우젖양념\\n환상의콤비 입니다\\n맛은 연하고 부드러우며 잡내가 전혀\\n나지 않고 정말 맛 있답니다\']','김장김치  자투리  채소  저수분  수육  압력솥  수육  법  것  수  김장김치  일  것  김장철  수  것  돼지고기  수육  맛  김장  압력솥  수육  수  김장  자투리  저수분  수육  법  준비  자투리  채소  수육  활용  야채  사용  수  잡  저수분  수육  수  육질  저수분  수육  수  압력솥  사용  뒤  기름기  삼겹살  된장  생강  양파  대파  마늘  된장  맛술   생강  생강  사용  김장김치  때  마늘  생강  것  삼겹살  김장  자투리  양파  압력솥  삼겹살  대파  마늘  압력솥  때  뒤  신호추  한  뒤  뚜껑  수육  수육  김장김치  채소  등  돼지고기  수육  법  오늘  통삼겹살  수육  수  준비  통삼겹살  수육  때  압력솥  맛  양파  대파  월계수잎  생강  약간  마늘  통삼겹살  준비  준비  된장  잡  맛  삼겹살  통마늘  돼지고기  잡  맛'),(9,'제육볶음','[\'두루치기 제육볶음 다이어트하다보니 매콤한게 땡기고 자극적인것이 땡길때가 있어요. 그럴때는 매콤한 맛으로 군침도는 두루치지 제육복음이 딱인데 말이죠~ 그래서 집에 목살도 있겠다~ 저는 먹기 힘들지만 남편을 위하여!!!!만들어보았답니다. 매콤한 밥도둑 두루치기 제육볶음 만드는 방법이예요! [재료] 목살 600g, 양파 2개, 대파 1대, 청양고추 2개\\n\\n[양념] 다진마늘 1밥술, 고춧가루 1밥술, 간장 1밥술, 설탕 1밥술, 올리고당 2밥술, 고추장 4밥술 우선 목살의 핏물을 조금 제거해낼꺼예요. 목살이 없으면 다른 부분으로 사용하셔도 된답니다. 앞다리나 뒷다리도 좋아요~키친타올과 두루치기 제육복음에 들어갈 목살과 켜켜이 쌓아서 깔아주시구요. 핏물을 제거할 동안 양념장을 만들어 줄께요. 저의 경우 다진마늘을 다져서 얼린다음 썰어놓거든요. 큐브형태로 만들어놓는거죠. 그것을 사용하였답니다. 올리고당에 설탕도 넣고 고추장도 듬~뿍! 이제 비벼주세요. 두루치기 제육볶음 만드는방법의 제일 중요한것은 역시 양념장! 양념장 중요합니다. 양념장을 만들었다가 1~2시간 숙성하셨다가 사용하시는것도 좋아요. 어느정도 핏물이 제거된 두루치기 제육볶음을 만들 고기에 위에서 만들어 두었던 양념장의 2/3정도를 부어서 조물조물 주물럭거려주세요! 이렇게 주물주물 양념을 골고루 묻혀준 다음에 잠시 10~20분 정도 두세요. 그 사이 준비할 것은 두루치기 제육볶음 만드는방법에 곁들어질 채소들 저의 경우 청양고추를 준비했어요 좀 더 매운맛을 원해서 말이죠~ 자~ 볶음용팬을 준비해주시고 양파를 넣고 잠시 재워둔 고기를 넣고 볶아주세요. 그다음 청양고추도 투하! 아주 맵고 맛있는 맛이 될 것같지요? 비주얼도 색상도 짱인듯! 이제 어느정도 다 익어갈때쯤! 먹기 좋게 잘라주시고 나머지 남아있는 두루치기 제육볶음 만드는방법 설명하면서 위에서 만들어 둔 양념장의 1/3을 넣어주시고 파를 넣어서 볶아주세요!\', \'제육볶음 만들기 뜨끈한 밥에 제육볶음 한점~!!!\\n고추장 양념으로 매콤 달콤 제육볶음 하나면 밥한공기 뚝딱이에요! 시중에 판매하고있는 돼지갈비양념장을 넣으면 제육복음의 풍미가 한껏 살아납니다^^\\n너무 오래볶으면 돼지고기의 육즙이 모두 빠져나와 고기질감이 뻣뻣해 질수 있으니 주의하셔아 해요^^ 돼지고기 600g, 양파 3개, 청량고추 5개, 대파 한뿌리 고추장 한큰술, 고추가루 3큰술, 다진마늘 2큰술, 간장 1큰술, 매실액기스 2큰술, 돼지갈비양념 2큰술 고추장 한큰술,고추가루 3큰술,다진마늘 2큰술, 간장 1큰술,매실액기스 2큰술,돼지갈비양념 2큰술을 모두넣고 골고루 섞어서 제육볶음 양념장을 만들어 줍니다. 청량고추와 양파,대파는 잘게 썰어줍니다. 손질한 야채에 돼지고기와 만들어둔 양념장을 넣고 골고루 버무려 줍니다. 야채와 고기에 양념이 골고루 베이면 냉장고에서 30분에서 1시간 정도 숙성시켜 줍니다. 30분 후 숙성된 고기는 중간불에서 볶아 줍니다. 10분정도 볶아주면 완성됩니다.\']','두루치기  제육볶음  것  제육복음  목살  저  매콤한  두루치기  제육볶음  목살  양파  대파  청양고추  다진마늘  간장  고추장  목살  핏물  목살  사용  두루치기  제육복음  목살  핏물  양념장  저  다진마늘  사용  올리고당  설탕  고추장  두루치기  제육볶음  만드는방법  것  양념장  양념장  중요  양념장  숙성  사용  것  핏물  제거  두루치기  제육볶음  고  양념장  양념  준비  것  두루치기  제육볶음  만드는방법  저  경우  청양고추  준비  말  준비  양파  고  청양고추  맛  것  어느정도  때  두루치기  제육볶음  만드는방법  위  양념장  제육볶음  양념  제육볶음  제육복음  돼지고기  돼지고기  양파  대파  고추장  다진마늘  간장  고추장  간장  제육볶음  양념장  청량고추  양파  대파  돼지고기  양념장  야채  고  양념  정도  숙성  숙성'),(10,'족발','[\'족발 양념 무침, 족발 요리, 반찬 [재료] 족발, 파프리카, 깻잎, 양배추, 사과, 진간장 1T, 간 마늘 0.5T, 꿀 1T, 고춧가루 1T, 물 2T\\n\\n\\n\\n\', \'남은 족발 꽈리고추 넣고 밥 반찬으로 먹다 남은 족발 나중에 먹기가 좀 그렇죠~\\n오늘은 꽈리 고추를 넣고 볶아서 반찬으로 만들었습니다. 꽈리고추를 좋아하시면 더 넣고 볶으셔도 됩니다.개인적으로 꽈리고추가 더 맛있습니다 ㅎ\\n매운 꽈리고추라면 청양고추는 안넣으셔도 되겠네요. 족발 400g, 꽈리고추 1줌, 홍고추 1개, 청양고추 2개, 전분 1큰술, 물 6큰술, 참기름 2큰술 진간장 3큰술, 매실청 1큰술, 맛술 2큰술, 생강술 1작은술, 다진마늘 1큰술, 후추 약간, 올리고당 1큰술 족발은 뼈를 발라 내고 살만 먹기 좋은 크기로 썰어 주세요 꽈리 고추는 깨끗히 씻고 꼭지를 제거해 주세요 홍고추와 청양고추는 씨를 제거하고 송송 다져주세요 위의 분량의 양념을 섞어주세요 팬에 양념을 붓고 한소큼 끓어 오르면 족발을 넣고 볶다가 꽈리고추와 홍고추 청양고추를 넣고 볶아주세요 여기서 오래 볶으면 꽈리고추가 물려집니다.아삭한 꽈리 고추맛을 원하시면 살짝만 볶아준후 전분1큰술에 물6큰술을 섞어서 부으면서 볶아주세요 접시에 담아냅니다.\']','양념  족발  반찬  족발  꽈리고추  반찬  족발  꽈리  반찬  꽈리고추  꽈리고추  꽈리고추  청양고추  족발  꽈리고추  홍고추  청양고추  진간장  족발  꽈리  고추  홍고추  청양고추  제거  양념  양념  족발  꽈리고추  홍고추  청양고추  꽈리고추  꽈리'),(11,'잔치국수','[\'잔치국수 고명올려서 맛있게~ 밤 11시에 먹은 잔치국수!!ㅋㅋㅋ\\n\\n라면보다 부담이 없다면서 먹은 야식메뉴 잔치국수\\n 육수에 자신이없다면 마트에서 파는 국시장국으로 하세요 [재료] 애호박 1/2개, 표고버섯 2개, 김치, 달걀 2개, 소면, 김가루\\n[양념] 다진마늘, 다진파, 간장, 설탕, 후추, 깨, 참기름, 들기름, 멸치, 다시마 \\u200b표고버섯은 따뜻한물에 불려주세요\\n\\n\\n\\n\\n설탕을 넣으면 불리는 시간을 단축할수있어요\\n\\n\\n\\n\\n없으면 패스!!! 김치를 송송 썰어서 설탕과 들기름과 깨를 넣고 \\n버무려주세요~ \\u200b달걀도 2개 풀어서 준비해주세요\\n\\n\\n\\n\\n고명은 3인분 분량이에요\\n\\n\\n\\n\\n참고하세요\\n\\n황백지단으로 하려했지만 귀차니즘~~~ 애호박도 먹기좋게 채썰어서 준비해줍니당\\n\\n\\n\\n\\n3인분 기준입니당!!!\\n\\n\\n\\n\\n남겨서 비빔밥해먹으려고 3인분으로 했어요~~ 호박을 볶습니당\\n\\n\\n\\n\\n팬에 기름을 두르고 빠르게 볶아요 \\n\\n쪼하는 양파가루 살짝 넣었어요\\n\\n\\n\\n\\n없으면 패스~~\\n\\n\\n\\n\\n고명으로 올릴거기에 완전히 익혀주세요 계란지단을 부칩니당\\n\\n컨디션이 안좋아서 대충했더니.....모양이 안예쁨...\\n\\n\\n\\n\\n지단은 키친타올로 기름기를 제거하고 식힌후에 썰어야 부서지지않고 잘 썰립니다 \\u200b불린 표고버섯은 물기를 제거하고 양념장을 만들어서 \\n\\n양념에 재운후 볶을건데요\\n\\n\\n\\n\\n이마저도 귀찮다면 그냥 소금으로 볶아도 상관없습니다 양념 : 간장 1큰술, 설탕 1/2큰술, 다진마늘 1개, 다진파 손가락 한마디정도 크기\\n\\n후추약간, 참기름 1/3큰술, 깨 요렇게 양념을 버물버물~~\\n\\n\\n\\n\\n해주세요\\n\\n\\n\\n\\n양념이 모자란듯 하셔야해요\\n\\n\\n\\n\\n볶을때 물이 나와서 짭니당!!! \\u200b표고버섯도 볶아주세요\\n\\n\\n\\n\\n마지막엔 센불로 물기를 다 날려주셔야합니다\\n\\n\\n\\n\\n\\n\\n\\n계란지단-호박-표고버섯 순으로 볶아주세요\\n\\n\\u200b 잔치국수 고명 완성\\n\\n\\n\\n\\n집에 조미김이 있어서 합세~\\n\\n\\n\\n\\n남으면 비빔밥해먹어도 꿀맛!!!!!!!!!!!!! 국수 2인분\\n\\n\\n\\n\\n사실...우린 더했어야했는데.....밤 11시라 조금만 먹자했는데\\n\\n\\n\\n\\n결국 모자랐음\\n\\nㅋㅋㅋㅋ\\n\\n\\n\\n\\n이건 우리 기준!!\\n\\n\\n\\n\\n일반인(?)들은 이정도면 충분!!!!! 국수를 삶습니당\\n\\n국수삶는시간\\n\\n끓어오르면 찬물 200ml를 부어주는걸 \\n\\n3번 반복하면 면이 다 익습니다!! 육수도 그사이 끓입니당\\n\\n\\n\\n\\n멸치를 볶다가 물넣고 끓이다가 끓으면 다시마 넣고 5분간 끓인후 \\n\\n다시마는 건져내세요\\n\\n\\n\\n\\n그리고 국간장으로 색을내고 소금으로 간을 합니다\\n\\n\\n\\n\\n쪼하는 결혼초에 이걸몰라 간을 안했다는........................ㅋㅋㅋ\\n\\n\\n\\n\\n다 그러면서 배우는거 아니겠습니까?ㅋㅋ 찬물로 여러번 헹군 소면을 그릇에 담아요\\n\\n\\n\\n\\n소면은 충분히 헹궈줘야 밀가루냄새가 안나요\\n\\n\\n\\n\\n예쁘게 똬리를 틀어서 만들었는데... \\u200b다 소용없음\\n\\n\\n\\n\\n찬물로 헹군 소면은 차가워서 뜨거운육수를 계속 끓이면서 \\n\\n소면그릇에 부었다가 다시 육수그릇에 쏟았다가~ 그리고 고명을 하나하나 예쁘게 올려줍니당\\n\\n\\n\\n\\n하나씩 올리고 사진찍고 움짤로 만들라했는데.... \\u200b요렇게 잔치국수고명을 올려주세요\\n\\n\\n\\n\\n잔치국수고명 - 표고버섯볶음\\n\\n애호박볶음\\n\\n계란지단\\n\\n양념김치 그리고 김가루까지 올리면 완성\\n\\n\\n\\n\\n달달이한테 김가루 잘라서 올리랬더니\\n\\n\\n\\n\\n달달이 그릇에 김가루 가득!!ㅋㅋㅋ\\n\\n\\n\\n\\n내꺼 찍는데 이미 폭풍식사중~ㅋㅋㅋㅋㅋㅋㅋㅋㅋ 국물도 맛있고\\n\\n고명도 제각각 간이 되어있어서 \\n\\n매력있었어요~~\\n\\n\\n\\n\\n야식메뉴 잔치국수 황금레시피였습니다~~\', \'잔치국수 양념장과 육수국물만들기 냉면의 계절이가고 뜨근한 잔치국수의\\n계절이 왔네요 ~\\n다시육수만 내면 맛난 잔치국수가 되요. 시간활용을 잘해서 시간을 단축하세요.\\n다시육수내는동안 채소썰고 면삶을동안 지단만들고 채소 다시육수에 익히는동안\\n양념장을 만드세요. 중면 2인분, 다시육수 4~5컵, 달걀 2개, 양파 반개, 쪽파 한줄기, 호박 3분의1, 어묵(생략가능) 두장, 당근 4분의1 간장 2t, 올리고당 1t, 쪽파 1줄기, 청양고추 반개, 홍고추 반개, 매실액 1t 다시육수를 내는데 파뿌리 .밴댕이를 쓰면 좋아요 밴댕이5.멸치5.다시마두장.\\n양파반개. 파뿌리두개. 청양고추두개 넣고 아주 큰냄비에 끓입니다 . 소면은 재료준비가 많아 퍼질수 있어서 중면을\\n사용했어요. 작은냄비에 소금한수저넣고 중면2인분을 삶아줍니다.\\n엄지와 검지말아 들어가는게 1인분. 면을 삶을때 넘치지않도록\\n물을 부어가며 삶아 줍니다. 4분정도 삶은 중면을\\n찬물에 헹궈 체에 받쳐줍니다. 당근도 채썰고 호박.양파.쪽파(대파를 채썰어도 되요) 를 가늘게 채썰어 줍니다. 어묵이나.유부.감자등\\n냉장고 잔반 채소를 활용\\n하세요. 달걀2개를 흰자.노른자 분리해서 따로 후라이팬에 부치고 채썰기를 해줍니다. 조미김도 가위로 잘라\\n고명으로 올리는데 김이 눅눅해지지 않게\\n마지막에 준비하세요. 냄비에 다시육수 4~5컵넣고 채소넣고2분정도 끓이시고\\n면은 다시육수에 담궜다빼세요 그사이 양념장을 준비합니다. 그릇에 국수를 덜어넣고 채소와 육수붓고 \\n지단.김.청양고추를 올립니다.\']','잔치국수  잔치국수  소  간장  설탕  김치  설탕  들기름  분  애호박  분  호박  표고버섯  제거  양념장  간장  설탕  참기름     양념  잔치국수  국수  밤  국수  육수  소금  간  간  찬물  그릇  소  고명  리  그릇  김가루  간  잔치국수  잔치국수  양념장  잔치국수  시간  채소  다시육수  분  다시육수  달걀  반개   호박  간장  쪽파  반개   반개   다시육수  소  분  면  당근  호박  양파  채썰어  채소  조미김  다시육수  다시육수  양념장  준비  그릇  국수  채소  청양고추'),(12,'칼국수','[\'영양가득 들깨 칼국수 벌써부터 깜박깜박 하는 바람에 기억력에 좋은 들깨로 들깨 칼국수를 만들었어요.\\n표고 버섯과 새우,애호박을 잘라 넣어 더욱 영양가 있게 \\n만들었답니다.\\n 들깨 칼국수는 들깨의 고소한 맛으로 먹기 때문에 육수를 다시마만 넣어 깔끔하게 끓였어요.\\n칼국수를 끓여 찬물에 헹궈 넣으면 쫄깃거리고 더 맛있어요. [재료] 거피 들깨가루 3T, 애호박 1/3, 표고버섯 1개(큰것), 칵테일 새우 7~8마리, 액젓 2T, 소금 1t, 김가루,다시마 애호박은 반으로 갈라 반달모양으로 얇게 잘라 주세요. 표고 버섯은 먼지를 털고 얇게 슬라이스 합니다. 칵테일 새우는 따뜻한 물에 샤워를 시켜 놓습니다. 칼국수는 끓는 물에 삷아 찬물에 헹궈 주세요. 쫄깃거려 더 맛있어요. 다시마 육수가 끓으면 다시마 건져내고 애호박과 표고버섯,새우, 들깨가루를 넣고 끓여 줍니다. 채소가 어느정도 익으면 삶아 놓은 칼국수를 넣어 좀더 끓이다가 불을 끕니다.\', \'매콤 칼칼한 아욱 된장 칼국수 매콤하고 칼칼한 아욱 된장 칼국수 구수하니 맛나요~ [아욱 칼국수 재료] 칼국수 생면 1( 156g), 손질 아욱 100g 약 1줌, 감자 1, 양파 1/4개, 매운 고추 2, 대파 1/2대, 다진 마늘 1/2큰 술, 멸치 다시 육수 4컵\\n[양념 재료] 된장 2/3큰 술, 고춧가루 1큰 술, 국간장 2큰 술 아욱은 바락바락 주무른 후 맑은물에 헹궈 먹기 좋은 크기로 자르고,감자 도툼 양파 파 매운 고추 썰어준비합니다 칼국수 생면은 덧 가루를 털어내고 냄비에 진한 멸치 다시 육수 4컵을 붓고 감자 넣고 약 2분 정도 끓이고요 2분 정도 끓인 육수에 된장2/3와 고춧가루1을 체에 밭쳐 내려주어요 여기에 양파 마늘 아욱을 넣고 끓이고요 아욱 넣고 끓어 오르면 덧 가루를 털어냄 생면을 넣고 끓입니다 생면이 투명해 질쯤 파 매운 고추 넣고 한소끔 끓여냅니다 매콤 칼칼 구수한 아욱 된장 칼국수 감칠맛이 풍부한 맛있는 한그릇 면요리 완성입니다\']','들깨  칼국수  들깨  들깨  칼국수  새우  애호박  들깨  칼국수  들깨  육수  재료  애호박  새우  애호박  버섯  칵테일  칼국수  물  찬물  다시마  육수  애호박  표고버섯  새우  들깨가루  칼국수  아욱  된장  칼국수  아욱  된장  칼국수  아욱  칼국수  재료  칼국수  생  아욱  양파  고추  술  육수  재료  된장  술  술  술  아욱  양파  고추  칼국수  생  멸치  육수  약  정도  육수  양파  마늘  아욱  아욱  덧  가루  생  생  고추  아욱  된장  칼국수'),(13,'콩국수','[\'초간단 콩국수 (노밀가루) 오전에 다 팔리는 손두부 한모,\\n\\n두부집에가서 마지막 하나 남은 우뭇가사리,\\n\\n그리고 콩가루를 사왔어요!\\n\\n바로 콩국수를 해 먹으려고 말이죠!\\n\\n그럼 시작해 볼께요!\\n [재료] 우선 두부집에서 겟한 콩국수가루 200g, 손두부 1/2모, 아몬드가 없어서 아몬드 밀크 한팩과 우유 250ml, 소금 약간, 우뭇가사리 한모 우선 두부집에서 겟한 콩국수가루 200g,\\n\\n \\n\\n\\n\\n손두부 한모는 반만 써요! 아몬드가 없어서 아몬드 밀크 한팩과\\n\\n우유250ml, 소금약간!\\n이렇게만 넣으면 \\n정말 걸쭉하니 보면서 농도를 얼음이나 물로 각자 맞추셔야해요^^ 믹서기에 이렇게 모두넣고 곱게\\n\\n갈아줍니다~^^ 그리고 시장에서 사 온 우뭇가사리는\\n\\n얼음에 담아 채에 물기를 빼주었어요. 이제 그릇에 담아주고\\n만든 콩물을 붓고\\n채 썬 오이와 토마토를 올리면 끝!\\n수박은 따로 담았어요 ㅎ\\n데코는 각자 원하는대료^^\', \'건강한 한끼 무더운 더위를 이길 시원한 콩국수 더위에 지쳐 입맛이 없을때 시원하면서도 영양가 많은 메주콩을 이용해 콩국수를 만들어보세요. 남은 콩국물은 냉장고에 보관했어요.\\n바로 먹는 콩국수가 아닌 경우는 소금은 넣지말고 먹을때 넣어주세요. [재료] 메주콩 4컵, 물 6컵정도, 통깨 1스푼, 소금 1스푼, 국수면 3인분, 얼음 적당량\\n[토핑재료] 오이 1개, 방울토마토 5알, 삶은계란 2개 메주콩은 깨끗이 씻은 후 충분한 물에 8시간정도 불려주세요. 불린콩은 껍질을 벗겨주세요. 껍질을 벗긴 콩은 냄비에 콩이 잠길만큼의 물을 붓고 삶아주세요. 물이 끓으면 뚜껑을 열고 한번 섞어준 후 1분 정도 더 삶다가 불을 꺼주세요. 믹서기에 삶아서 식은 콩, 소금 1스푼, 통깨 1스푼 그리고 물 4컵정도를 넣고 갈아주세요. 중간에 물을 더 넣어가며 농도를 조절해주세요. 적당한 농도와 함께 콩이 곱게 갈리면 콩국물은 완성이 되요. 콩국물은 냉장고에 보관해주세요. 끓는물에 국수면을 넣고 삶아주세요. 다시 물이 끓으면 찬물 반컵을 넣고 잠시 후 또 끓으면 한번 더 물 반컵을 넣고 끓여주세요.\\n다시 물이 끓으면 불을 꺼주세요. 흐르는 찬물에 국수면을 헹궈주세요. 토핑 재료로 오이를 채썰어주고 방울토마토와 삶은계란을 반으로 잘라주세요. 국수면을 담고 토핑 재료들을 올리고 콩국물을 넣으면 완성이 되요. 마지막으로 얼음을 동동 띄워주세요!!\']','콩국수  콩국수  재료  손두부  아몬드  아몬드  소금  두부집  겟한  콩국수가루  한모  아몬드  아몬드  밀크  농도  얼음  물  각자  콩국수  더위  메주콩  콩국수  콩국물  콩국수  소금  때  재료  메주콩  소금  얼음  메주콩  후  물  껍질  콩  콩  물  물  후  믹서  콩  소금  통깨  물  농도  농도  콩  리  콩국물  콩국물  냉장고  보관  국수면  물  후  한번  반컵  물  불  찬물  국수면  재료  오이  방울토마토  삶은계란  반  국수면  토핑  콩국물  완성  되요  마지막  얼음'),(14,'비빔밥','[\'맛있고 간단한 중화 비빔밥 만들기 오늘은 만들기 간단하고 맛있는 중화 비빔밥을 만들어봤어요. 쉽고 간단해서 자취하시는 분들 간단하게 남는 재료로 만들어 먹어도 좋을 것 같아요. 저는 밥숟가락으로 계량했어요. 그럼 맛있는 중화 비빔밥 시작해보겠습니다! [재료] 소고기 100g, 양파 1/2개, 표고버섯 3개, 청양고추 2개, 마늘 1개, 파 1/4대, 호박 1/4개\\n[양념장] 고추장 2t, 국간장 2t, 물 5t, 설탕 2t, 굵은 고춧가루 1t 표고, 양파, 호박은 1*1cm로 깍둑썰기를 해주세요. 파, 고추, 마늘은 송송 썰어주세요 마늘은 다지셔두되고 편 썰어주셔도 돼요. 짠 야채 손질이 다 끝났어요 이제 양념장을 만들어볼게요. 고추장 2t 간장 2t 물 5t를 넣어주세요. 그리고 설탕 2t 굵은 고춧가루 1t를 넣어주세요. 마무리로 아까 썰어두셨던 파 마늘 고추를 넣고 양념장을 잘 섞어서 마무리해주세요. 예열된 팬에 기름 5t 후추 조금 넣고 양파를 넣어 기름에 향을 입혀주세요. 기름에 양파 향이 올라오면 소고기 호박 표고버섯 순으로 넣고 높은 온도에서 빠르게 볶아주세요. 고기가 반쯤 익으면 양념장을 다 넣어주시고 볶아주시면 끝! 양념을 밥 위에 올려서 드시면 아주 맛있어요 ㅎㅎ 야채들 볶으실 때 불을 내주시면 불향 가득 맛있는 중화 비빔밥을 맛보실 수 있어요.\', \'꼬막 비빔밥 꼬막이 맛있는 계절이 됐나봅니다 아파트 야시장에서 싱싱한 꼬막을 사다 비빔밥을 만들어 봤습니다.육즙이 톡 터지는게 맛있네요. 참고로 제가 \\n꼬막 삶은 방법(@6889668) 입니다. 상추.알배추 속잎.깻잎,양파는 채 썰어주세요.\\n삶은 꼬막도 준비해 주세요. 꼬막은 키친타올에 놓고 물기를 닦아주세요.\\n위의 분량의 양념을 넣고 섞어 양념장을 만들어 주세요 배추.양파.꼬막을 볼에 담고 양념장을 넣고 버무려 주세요 비빔그릇에 밥을 담고 그위에 채썬 상추.깨잎을 담고 양념에 버무린 꼬막을 올려 주세요.참기름을 뿌려 주세요.\']','중화  비빔밥  간단  중화  비빔밥  간단  간단  중화  비빔밥  재료  양파  마늘  파  호박  양파  호박  파  마늘  마늘  양념장  고추장  설탕  고춧가루  파  마늘  고추  양념장  마무리  양파  양파  향  소고  호박  표고버섯  양념장  양념  중화  비빔밥  비빔밥  꼬막  꼬막  비빔밥  저  꼬막  꼬막  양념  양념장  양파  꼬막  양념장  밥  상추  양념  꼬막'),(15,'삼계탕','[\'영양만점 야채 닭죽, 카레 닭죽, 삼계탕 레시피 안녕하세요 아이엠이에요 :) 오늘은 예비군을 다녀와서 지친 남자친구를 위해 영양만점 야채 닭죽을 준비했습니다. 냉동닭은 전자렌지에 500g해동으로 돌려 손질후 월계수와 통마늘,후추,황기,대추를 넣고 삶아줍니다. 닭이 삶아지는동안 재료를 손질해주세요. 닭이 다 삶아지면 건져내서 한김 식혀주세요. 육수에 재료를 넣고 익혀주세요. 재료가 익는동안 닭을 손질해주세요. 공기밥 두그릇을 넣고 잘 끓여주세요. 어느정도 밥알이 풀어졌다싶으면 손질한 닭고기를 넣고 끓여주세요. 완성된 닭죽을 반정도 덜어내주고 카레가루를 넣어주면 두가지 닭죽 완성. 큰 닭이나 작은 닭 두마리를 사용하면 한마리는 삼계탕으로 한마리는 두가지 닭죽으로 세가지 요리를 한번에 즐기실수있답니다.\', \'따끈한 국물이 먹고플땐~~백봉오골계 삼계탕 ! 따끈한 국물이 좋은 날씨가 돌아왔어요\\n몸에 좋다는 백봉오골계로 삼계탕 끓여봅니다 [재료] 백봉오골계 1마리, 찹쌀 2컵, 녹두 1컵, 단풍마 반주먹, 대추 4알, 마늘 한주먹, 밤 각각한줌씩 먼저 손질된 오골계를 깨끗히 씻어줬어요 그리고 물에 5시간 이상 불려놓은 녹두와 \\n\\n그외 단풍마,대추 밤,마늘을 깨끗히 씻어 \\n\\n물기를 제거해줍니다 불려놓은 찹쌀은 \\n\\n삼베주머니에 넣어 입구를 묶어줍니다 \\n\\n집집마다 다 삼계탕 끓이는 방법이 다르기 때문에 \\n\\n닭속에 찹쌀과 그외 재료를 넣어주어도 되요 압력밥솥에 \\n\\n오골계와 모든 재료를 넣은 다음 \\n\\n재료가 잠길 만큼의 물을 부어줍니다 그리고 \\n\\n강불에서 끓이다가 추가 흔들리면\\n\\n 중불로 맞추어 20분정도 끓여\\n\\n뜸을 들여주면 \\n\\n요로콤 맛있는 오골계 삼계탕 완성이에요 ㅎ 얼릉\\n\\n뜨끈뜨끈한 삼계탕 한그릇 담아 \\n\\n카메라에 한컷 남기고는 시식 들어갑니다 ㅋ 쫀득한 살고기는 소금에 찍어 먹고 \\n\\n뜨끈한 국물은 단풍마에서 우러나온 색과 맛으로 인해 \\n\\n꼭 한약 한그릇 마시는 기분이네요 ㅋ \\u200b맛있게 한그릇 뚝딱 ~ 비우고\\n\\n한그릇 더 추가로 먹었어요 ㅋ \\n\\n이제 힘이 불끈불끈 ~~~\\n\\n내일도 부지런히 \\n\\n텃밭과 집으로 왔다갔다 하며 열심히 일해야죠 ㅎㅎ\']','닭죽   삼계탕  영양만점  야채  닭죽  닭  재료  손질  닭  재료  재료  닭  손질  손질  완성  닭죽  닭죽  완성  닭  닭  삼계탕  한마리  두가지  닭죽  국물  삼계탕  따끈  국물  삼계탕  재료  백봉오골계  찹쌀  단풍마  손질  녹두  단풍마  대추  밤  마늘  깨끗  찹쌀  삼계탕  찹쌀  재료  재료  물  오골계  삼계탕  완성  삼계탕  한그릇    국물  단풍마  한그릇    한그릇  '),(16,'게장','[\'매콤 짭조름한 게장 무침 간장게장 먹고 싶어서 주문했는데 \\n막상 먹어보니 너무 비리다거나 입맛에 안 맞아서 못 드시는 분들 계실 텐데요\\n그런 분들을 위한 게장무침 가져왔어요 :) \\n\\n [주재료] 간장게장\\n[양념] 고춧가루 0.5큰 술, 다진 마늘 0.5큰 술, 참기름 1큰 술, 통깨 1큰 술\\n[선택 재료] 청양고추 2개 간장게장의 통통한 몸통부분 게살을 발라줍니다 양념 : 고춧가루 0.5 큰 술, 다진 마늘 0.5 큰 술, 참기름 1 큰 술, 통깨 1 큰 술 + 청양고추 2개 (선택) 양념 넣고 무쳐서 먹으면 비린 맛이 훨씬 덜 합니다 :D 게장 비린내 없이 맛있게 먹는 방법\\n게장무침\', \'게장 무침 - 간장게장 비려서 못 먹을때 양념 넣고 무치기 간장게장 먹고 싶어서 주문했는데 \\n막상 먹어보니 너무 비리다거나 입맛에 안 맞아서 못 드시는 분들 계실 텐데요\\n그런 분들을 위한 게장무침 가져왔어요 :) \\n\\n 술안주로도 아주 좋아요 > <ㅎㅎㅎ [재료] 게장 4 큰 술\\n[양념] 고춧가루 0.5큰 술, 다진 마늘 0.5큰 술, 참기름 1큰 술, 통깨 1큰 술, 청양고추 2개 (선택)\\n[계량] 큰 술 - 밥숟가락 계량 사실 저는 간장게장을 좋아하는데 신랑이 너무 비리다고 못 먹더라구요ㅠㅠㅠ\\n그래서 게살 발라 무쳐서 무침은 신랑 술안주로 먹고 \\n게 다리와 게딱지는 제가 다 먹었습니당 ㅎㅎ 게살 쭈욱 짜서 발라낸 게살에 양념을 넣고 무쳐줍니다 양념 : 고춧가루 0.5 큰 술, 다진 마늘 0.5 큰 술, 참기름 1 큰 술, 통깨 1 큰 술 + 청양고추 2개 (선택) 게장 비린내 없이 맛있게 먹는 방법\\n게장무침\']','게장  간장게장  비리  고춧가루  술  마늘  술  참기름  술  통깨  청양고추  간장게장  게살  양념  고춧가루  술  마늘  술  참기름  술  통깨  술  청양고추  양념  게장  게장  간장게장  양념  간장게장  주문  \\\\막상  비리  입맛  텐데요\\\\그런  들  게장무침  \\\\\\\\  재료  게장  고춧가루  술  마늘  술  참기름  술  통깨  술  청양고추  술  간장게장  비리  게살  신랑  술안주  저  게살  게살  양념  양념  고춧가루  술  마늘  술  참기름  술  통깨  술  +  청양고추  선택  게장  비린내'),(17,'수제비','[\'매콤.얼큰 보리새우 수제비 지난주 보리새우 무우국은 드셔보셨을꺼에요.\\n수제비넣고 끓여보세요. 국물이 시원하고\\n식감도 좋아요.\\n\\n 보리새우는 굴소스한수저 넣고 볶으면\\n맛있는 밑반찬이 되요.~ 수제비반죽을 만듭니다. 밀가루2컵.물반컵.계란하나 넣고 치대다가 비닐봉지에 넣고 더 치대다\\n냉장고에 30분이상 보관해서 팽창되게 합니다. 보리새우 두주먹준비.\\n민물새우 쓰셔도 되요. 다시육수를 만듭니다.\\n다시마.밴댕이.파뿌리.보리새우 넣었어요. 멸치.다시마만 넣으셔도 되요. 무우는 나박썰고 쪽파는4cm정도로 썰어\\n줍니다. 양념장ㅡ고추장1.고추가루2.마늘다짐1.다진생강0.5 .매실액1.맛술1.김칫국물2 다시육수 4컵 붓고 무우.쪽파넣고 끓이다 양념장 반을 넣어줍니다. 무우가 익어가면 무우를 조금 더 \\n썰어 넣어주고 수제비반죽넣고 끓이다가\\n다시육수 한국자 더 넣고\\n끓입니다. 국간장한수저넣어 \\n간을 맞춥니다.\\n싱거우면 국간장 한수저 더\\n넣으셔도 되요. 수제비가 익었으면 쪽파 더넣고 불을 끕니다.\', \'얼큰 만두피 수제비 국물요리 간단하게 만드는 만두피 얼큰 수제비 만들기~ [만두피 수제비 재료] 만두피 5장, 감자 2개, 호박 1컵(종이컵), 당근 약간, 양파 1/4개, 파 약간, 매운고추 1개, 다진 마늘 1큰 술, 멸치 다시육수 3컵 반(종이컵)\\n[양념 재료] 고춧가루 반 큰 술, 고추장 반 큰 술, 참치 액젓 1큰 술, 국간장 1.5큰 술 감자 호박은 약간 도툼하게 썰고,당근 양파 파 고추 썰어준비합니다 냉동 만두피는 해동해 먹기 좋은 크기로 썰고요 냄비에 육수 3컵 반을 넣고 감자와 고춧가루 넣고 약 2분 정도 끓이고 건새우 호박 양파 마늘 고추장 반 큰 술 넣고 끓이다가 국간장1.5 큰 술과 참치 액젓 1 큰 술 넣고 끓이고요 감자가 거의 익을 무렵 만두피 당근 넣고 끓여요 만두피 넣고 오래 끓이지 않아도 돼요 만두피 넣고 한소끔 끓어 오르면 파 고추 넣고 살짝 끓여냅니다 얼큰하게 끓인 만두피 수제비 완성~\']','보리새우  수제비  보리새우  보리새우  되요  보리새우  되요  다시육수  보리새우  되요  무우  다시육수  무우  반  무우  무우  되요  수제비  만두피  수제비  만두피  얼큰  수제비  만두피  수제비  만두피  호박  당근  양파  약간  술  멸치  다시육수  재료  반  술  반  술  술  국간장  술  호박  당근  양파  파  만두피  반  고춧가루  호박  양파  마늘  고추장  반  술  술  참치  액젓  술  감자  만두피  당근  만두피  만두피  고추  만두피  수제비'),(18,'초밥','[\'간단한 한우 불고기 초밥 한우 불고기를 이용한 초밥입니다! 기호에따라 레몬즙이나 쌈장에 찍어드시면 훨씬 맛있습니다! 재료를 준비해줍니다. 양파를 썰어 물에 담구어둡니다. 후추, 소금, 올리브오일로 고기 간을 맞춥니다. 데리야끼 소스를 부어 주물주물 버무려줍니다. 무순을 준비합니다. 무순은 밑부분은 자르고 흐르는 물에 씻어줍니다. 양념된 불고기를 달구어진 팬에 구워줍니다. 고기가 맛있게 익도록 살짝 구워줍니다. 밥을 동글동글하게 뭉쳐줍니다. 구운 불고기를 밥 위에 올려줍니다. 양파와 무순을 올려줍니다.\', \'통베이컨 초밥 베이컨 초밥입니다! 통베이컨을 슬라이스합니다. 후라이팬에서 중불 정도로 하여 구워줍니다. 뒤집어서 반대쪽도 구워줍니다. 밥에 참기름과 깨소금을 넣어줍니다. 밥을 동그랗게 만들어줍니다. 구운 베이컨을 올려주면 베이컨 초밥 완성!\']','불고기  초밥  한우  불고기  무  준비  무  물  불고기  고  밥  불고기  밥  양파  무  초밥  베이컨  초밥입니  밥  밥  베이컨  베이컨  초밥'),(19,'돈부리','[\'명절 남은 모듬전 활용 일본식덮밥 돈부리 변형 전덮밥 명절이면 꼭 해야하는 의무감으로 만들게\\n되는게 전이죠\\n제사가 없는 저도 물론 많이 했고요 ㅋㅋ\\n\\n전은 부치면서 먹어야 제맛있는데 시간이\\n지날수록 그맛이 떨어지고 금방 질려\\n잘안먹게 되는게 전이더라고요\\n전을 먹을양만 정확하게 만들면 좋은데\\n늘 조금은 남게 되고요\\n\\n그럴때마다 주로 전찌개를 끓여 먹었는데\\n얘들은 전찌개는 썩 좋아하진 않더라고요\\n그래서 생각해낸게 전부리였어요\\n일본식덮밥 돈부리를 전으로 만들어준거죠\\n그랬더니 얘들반응이 넘 좋네요\\n\\n맛있다고 금방 바닥을 보여\\n얼마나 맛있나 저도 해먹어봤는데요\\n진짜 맛있더라고요\\n전갖고 한요리중 제 입맛에도 탑안에\\n들어가는 맛이였어요\\n특히 아이들은 무조건 좋아할 맛인거 같아요\\n\\n잔반처리로 남은 전들이 있다면\\n한그릇요리로 훌륭한 전부리\\n어떠세요^^\\n\\n남은연휴 마무리 잘되는 하루되세요~♡\\n [재료] 모듬전1인분, 밥, 양파반개, 계란1개, 청양고추2개\\n[양념] 물1컵, 데리야끼소스(기호에 맞게 가감) 2T, 간장(기호에 맞게 가감) 2T, 통깨 양파반개를 채 썰어놓습니다 고추를 송송썰어 물에 헹궈 씨는 제거하고 꼭 짭니다 팬에 전을 데웁니다 웍에 물을 넣고 끓입니다 물이 끓으면 양파를 넣고 양념을 하고 잠시 불을 끕니다 그릇에 밥을 담고 전을 올립니다 계란을 풀어놓습니다 웍에 불을 다시 켜고 소스가 끓으면 고추 계란을 넣습니다 한소끔 끓인후 뚜껑을 닫고 불을 끄고 예열로 계란을 익힙니다 전위에 소스를 올리고 통깨를 뿌립니다 식탁에 냅니다\', \'스팸 양파덮밥/스팸 돈부리 집에 마땅한 반찬이 없을때 스팸과 양파를 이용해 초간단 덮밥을 만들어 한끼 식사를 해결해보세요. 담백한 스팸과 양파의 아삭한식감, 부드러운 계란이 잘 어울어져 초간단 한끼 식사로 제격이랍니다. [재료] 양파 1개, 스팸 2슬라이스, 계란 1개, 다진마늘 1스푼, 파 적당량, 참깨 적당량\\n[양념재료] 간장 2스푼, 설탕 1스푼, 맛술 2스푼, 물 6스푼 슬라이스한 스팸 2조각을 끓는물에 살짝 데쳐주세요. 먹기 적당한 크기로 썰어 후라이팬에 구워주세요. 양파 1개를 채썬 후 다진마늘 1스푼을 넣고 살짝 볶아주세요. 양념재료인 간장 2스푼, 설탕 1스푼, 맛술 2스푼, 물 6스푼을 넣고 약한 불에서 끓여주세요. 양파가 흐물해지기 시작하면 구운 스팸을 넣고 살짝만 더 끓여주세요 계란 1개를 풀어 파를 적당량 썰어 넣고 그위에 부어 주세요.\\n살짝 덜 익은 반숙인 상태에서 불을 꺼주세요. 밥 위에 스팸 양파덮밥을 올리고 참깨를 솔솔 뿌려주면 완성!!\']','돈부리  명절  저  찌개  돈부리  전  저  저  밥  물  전  물  물  양파  불  밥  전  계란  웍  불  고추  계란  불  계란  소스  통깨  돈부리  스팸  양파  덮밥  스팸  양파  계란  초간단  한끼  식사  재료  양파  스팸  계란  스팸  양파  다진마늘  간장  설탕  맛술  불  양파  스팸  계란  파  적당량  불  밥  스팸  참깨'),(20,'돈까스','[\'홈 메이드 도톰한 돈까스 만들기~ 돈까스 싫어 하는 아이, 어른은 없겠지요?^^\\n손은 좀 가더라도 도톰한 돈까스를 직접 만들어 보았어요.\\n돼지고기 부위는 등심으로 준비했구요,\\n기름기가 적어도 부드럽고 빨리 익는 장점이 있어 돈까스 만들기에 아주 좋은 부위랍니다^^\\n자, 지금부터 도톰하면서 보드랍고 육즙이 살아있는 \', \'#에어프라이어로 튀긴 돈까스 #손쉽게 만드는 돈까스소스 분말스프~~ 크림스프도 가능하고 야채스프도 가능하고요. 옥수수스프도 당연히 가능하겠지요. 분말스프를 이용해서 초간단하게 만들 수 있는 돈까스소스입니다. \\n\\n보통 밀가루에 버터 넣고 루를 만들어 주다가는 케찹이나 토마토소스 또는 우스타소스를 넣어서 만드는 것이 돈까스소스인데 이런 양념이나 간도 할 필요 없고 밀가루에 루를 만들 필요도 없는 분말스프가 그 모든 것을 담당해 주어서 간단하게 케찹만 넣어서 만들면 끝이죠. \\n\\n에어프라이어의 도전은 계속되고 있습니다.\\n돈까스도 튀겨보고 피쉬볼도 튀겨보고요.\\n이번엔 냉동감자도 튀겨 보았지요. [돈까스소스재료] 분말스프 80g, 케찹 4큰술, 후추 1t\\n[돈까스재료] 냉동돈까스 3개, 피쉬볼 6개, 감자 2개, 돈까스소스 4큰술 분말스프입니다. 흔하게 구할 수 있는 분말스프이지요. 분말스프부터 물을 넣고 중약불에서 계속 저어가면서 끓여 줍니다. 그리고 그냥 돈까스와 함께 먹기 위해서 일부는 따로 담아 주고는 남은 분말스프를 이용해서 돈까스소스를 간단하게 만들어 보지요. 정말 간단합니다. 분말스프에 물 넣고 끓이다가 걸쭉한 상태가 되면 케찹과 후추를 넣고 잘 섞으면 초간단 돈까스소스가 만들어지게 되지요. 농도를 따로 맞출 필요도 없고요. 간을 할 필요도 없지요. 케찹보다 좀더 고급스러운 소스맛을 원하시면 토마토소스를 넣으셔도 좋겠지요. 따로 루를 만들 필요도 없이 스프에는 모든재료가 다 들어가져 있어서 간편합니다. 초간단으로 쉽게 만드는 돈까스소스 완성이지요. 피쉬볼이지요. 지난번에 만들어 놓고 냉동실에 넣어 둔 피쉬볼이지요. 삶아낸 것을 냉동실에 넣어 얼려 두었기 때문에 다 익은 상태이므로 냉장고에서 해동시킨 후에 기름없이 이번에는 한번 기름없이 넣어서 튀겨보려고요. 이 기름없이 튀겨질 수 있을지도 궁금해서 시험해 보는 것이지요. 냉동감자가 아닌 생감장을 껍질채 큼지막하게 썰어서 준비합니다. 위생비닐에 넣고는 올리브오일, 소금, 후추, 바질가루를 넣고는 쉐키 쉐키 흔들어 주세요. 피쉬볼은 그냥 기름없이 튀겨보고 이번 감자는 기름을 넣고 튀겨보려고요. 기름없이 에어프라이어로 튀겨낸 피쉬볼입니다. 튀겼다기보다는 구워진 형태가 되었네요. 약간의 기름이 필요한 것 같아요. 이번에는 올리브오일을 두른 생감자를 튀겨 봅니다. 온도는 180도에 10분씩 돌려 보았어요. 중간 중간에 열어서 뒤집어 주시고요. 완성접시에 감자튀김, 피쉬볼튀김을 한쪽 구석탱이에 놓아 두고요. 냉동돈까스는 해동시킨 후에 기름을 충분히 둘러 주고는 튀겨 줍니다. 200도에서 일단 10분간 돌려 줍니다. 그리고 다시 꺼내어서 골고루 익히기 위해서 뒤집어 주시고 다시 10분동안 돌려 주었어요. 분말스프를 이용해서 간단하게 만든 돈까스소스를 감자튀김과 피쉬볼튀김, 그리고 돈까스에 뿌려 주시면 에어프라이어로 튀겨낸 돈까스 완성입니다.\']','도톰  돈까스  돈까스  도톰  돈까스  돈까스  도톰  돈까스  돈까스소스  분말스프  가능  가능  가능  분말스프  이용  수  루  케찹  것  돈까스소스  필요  밀가루  루  필요도  분말스프  것  간단  케찹  피쉬볼  분말스프  케찹  후추  피쉬볼  돈까스소스  분말스프  수  분말스프  분말스프  돈까스  분말스프  이용  돈까스소스  간단  간단  분말스프  케찹  후추  돈까스소스  필요도  간  필요도  케찹  토마토소스  루  필요  초간단  돈까스소스  피쉬볼  피쉬볼  것  냉동실  상태  이번  수  것  냉동감자  후추  쉐키  피쉬볼  이번  피쉬볼  필요  것  이번  중간  냉동돈까스  해동  후  분말스프  이용  간단  돈까스소스  감자튀김  돈까스  에어프라이어로  돈까스  완성'),(21,'회','[\'남은 회 요리, 집에서 생선까스 만들기 코스트코에서 회 한접시 사가지고 왔는데 회가 남은거예요 글쎄..\\n다음날 아침에 회덮밥이나 해먹어야겠다~ 하고 냉장고에 넣어뒀는데\\n막상 아침되니 회덮밥 할 야채가 1도 없어서 바로 메뉴변경!!\\n남은 회로 튀겨서 생선까스 만들어봤어요.\\n아침부터 반응 진짜 최고였던 집에서 남은 회로 생선까스 만들기~\\n레시피 알려드릴게요!! 초.간.단 [재료] 남은광어회 있는만큼, 계란 2개, 튀김가루 200ml, 빵가루 200ml, 식용유 250ml, 후추 톡톡, 소금 톡톡\\n[소스] 마요네즈 2스푼, 꿀 1스푼, 식초 2방울 이만큼이나 남은 광어회 ㅠㅠ 회는 후추랑 소금 적당히 뿌려서 밑간을 해주세요. 튀김가루 먼저 양면에 골고루 묻히고 계란 2알 깨서 만든 계란물을 그다음에 입히고 마지막에 빵가루 톡톡 !! 적당이 온도가 오른 식용유 불은 약불로 줄이고 회 투하해서 \\n바삭하게 튀겨주세요 ! \\n회는 너무 많이 익히지 않아도 괜찮아서 \\n그냥 튀김 색 예뻐질때까지 튀기면 돼요 ㅋㅋㅋ 노릇노릇 맛있게 튀겨진 광어회\\n이게 어제 먹은 그 광어회라는거.. 믿겨지시나요..?ㅋㅋㅋㅋ 마요네즈 2스푼, 꿀 1스푼, 식초 2방울 재료 한꺼번에 섞어서\\n소스도 만들어주었어요 ;) \\n\\n광어회가 정말 그럴싸한 생선까스로 변신했지요 ! 소스도 너무 맛있게 만들어져서\\n생선까스랑 굉장히 잘 어울렸어요. 겉은 바삭하고 속은 촉촉하니 부드러운 광어회 생선까스!\\n남은 회 요리로 정말 딱이지요 ;) 작은 회들은 뭉쳐서 한번에 튀겼더니 큼지막 ㅋㅋ\\n남편이 회가 이렇게 컸냐고\\n어제 먹은 회를 튀겼을 줄은 상상도 못했대요 ㅋㅋ\\n딸래미도 생선까스 너무 맛있다고 엄지척 해줬어요 ;)\\n\\n집에서 남은 회로 꼭 생선까스 만들어보세요 정말 맛있어요!\', \'비빔칼국수만들기 회 듬뿍 올린 회비빔칼국수 홈메이드로 즐겨요 주말이면 꼭 한 번은 만들어 먹는 생면요리. 이번 주말은 홈메이드 생면을 뽑아 비빔칼국수를 만들었어요. 이제까지 집에서 만든 생면요리 중 가장 인기 있었던 회비빔칼국수 만들어 보아요. [재료] 우리밀 100g, 계란 45g, 물 15g, 소금 약간, 오이 1/2개, 사과 1/4개, 깻잎 10장, 상추 10장, 당근 1/3개, 양파 1/4개\\n[양념장] 고추장 2큰술, 매실액 1큰술, 설탕 1/2큰술, 다진 마늘 1작은술, 식초 1큰술, 고춧가루 1/2큰술, 통깨 약간 볼에 우리밀, 달걀, 소금, 물을 넣고 반죽해 30분 정도 휴지시킵니다.\\n( 시판되는 칼국수 면을 사용하셔도 됩니다.) 양파, 당근, 오이, 깻잎, 사과, 상추는 채 썰어 놓아요.\\n(야채는 원하는 것이나 냉장고에 있는 것들을 사용하시면 됩니다.) 광어도 준비해요. 분량의 양념장 재료를 섞어 양념장을 만들어요. 면을 뽑습니다.\\n 마카토를 이용해 생면을 뽑았어요. 끓는 물에 생면을 4분 정도 삶아요.\\n찬물에 면을 헹궈요. 볼에 채소를 담고 삶은 면을 올려요.\\n양념장을 담고, 회를 올린 후 통깨를 뿌려 완성합니다. 회비빔칼국수 완성이에요.회를 사서 오면 비빔장은 따로 만들지 않아도 \\n회 포장에 들어 있는 걸 사용하시면 간편하게 시간을 줄일 수 있어요.\']','집  생선까스  회  아침  회덮밥  회  생선까스  집  회  생선까스  재료  계란  소금  식초  회  후추  소금  튀김가루  계란  빵가루  식용유  줄  마요네즈  식초  재료  생선까스  광어회  생선까스  \\\\남  요리  회  회  회  줄  생선까스  회  생선까스  회비빔칼국수  주말  홈메이드  생  집  생면요리  회비빔칼국수  재료  계란  소금  식초     우리밀  소금  면  양파  당근  오  사과  상추  냉장고  재료  양념장  면  생  물  생  정도  면  볼  면  회  통깨  회비빔칼국수  완성  회  \\\\회  사용하시  줄'),(22,'라멘','[\'[편의점을털어라]차슈딘나멘 # 사리곰탕으로 끓여본 이색 라면 냉동실에 물만두, 돼지고기가 잠자고 있다면 사리곰탕 이색 라면으로 변신해 보아요.~ 구수한 사리곰탕국물에 만두 조화가 좋았어요.~ 삼겹살이 곁들여져 일본라멘 돈코츠 느낌입니다.ㅎ [재료] 사리곰탕라면 1개, 간 마늘 1T, 통삼겹살(또는 편육) 3~4점, 물만두 5~6개, 계란(옵션) 1개, 부추 또는 쪽파 한 줌 진국의 맛! 농심 사리곰탕 면ㅎㅎ(홍보아님) 라면 1개 물 양 = 550ml 인데 + 1/2종이컵 더 넣어줬어요.\\n끓는물에 자른 통삼겹과 물만두를 넣고 끓여줍니다. \\n돼지고기 잡내 잡기 위해 간 마늘 1/2T 넣어주세요.(사진보다 더 넣었음) 라면 건더기, 스프, 면을 넣고 3분간 끓여줍니다. 익은 통삼겹살은 건져서 김 굽는 석쇠위에 올려 가스불에 구워줍니다.\\n(토치 사용가능) 라면위에 삼겹살, 삶은계란을 올려주고 부추 또는 쪽파를 뿌려주세요.~\\n그냥 라면 끓이는것 만큼 쉽지요.~\', \'돈까스 라멘 돈까스 라멘 \\n한 입먹고 반해서 두번 세번~\\n\\nby. 편한식사 [재료] 신라면, 돈까스, 대파, 뜨거운물 봉지를 뜯어 라면스프를 부어주세요. 라면스프 위에 돈까스를 올려주세요. 대파를 썰어 올려주고 뜨거운 물을 부어주세요. 뚜껑을 덮고 전자레인지에 2분 돌려주세요. 전자레인지에 2분 돌린후 잘 섞어주세요.\']','사리곰탕  라  물만두  사리곰탕  이색  사리곰탕  물만두  사리곰탕  라  물만두  마늘  라  삼겹살  부추  쪽파  라  라멘  재료  라면스프  돈까스  대파  전자레인지'),(23,'냉모밀','[\'초간단 쯔유만들기- 더위를 잠재우는 냉모밀 시원하게 간장 1C, 설탕 4 T,맛술1/2 C,물1 C,\\n가쓰오부시 30g,아니면 혼다시 1/2T\', \'입맛없을때 후다닥 해먹는 냉모밀 국수장국 모밀용 사면 요긴하게 해먹을수 있는 냉모밀!\\n입맛없을땐 짭쪼롬한 모밀이 딱이에요 칼로리도 낮고 시원하게 뚝딱 해먹을수 있는 냉모밀~\\n유부초밥과 같이 드시면 식사로도 거뜬해요 [재료] 모밀면 1인분(한묶음), 국시장국 8T, 물 200ml, 무 5cm두깨 덩어리 반정도, 오이 1/3개, 대파 반줌, 얼음, 김 잘라 넣을만큼, 와사비 1t 국수장국을 미리 만들어두면 좋지만..\\n저는 맛간장이나 국수장국이나.. 만들어두는게 너무나 귀찮더라구요 그래서 마트에서 싸게 파는 국시장국을 사용해요\\n메밀소바용으로 사면되구요\\n\\n물 200ml에 국시장국을 8스푼정도 넣어서 미리 섞어 냉장고에 넣어두어요(간은 입맛에 맞게 맛보면서 맞추세요) 파는 송송송 썰어두고 오이는 채썰어둔뒤 무는 강판에 갈아서 즙을 내주는데요\\n5cm 반덩이 하면 요정도 나오더라구요 무 좋아하시면 좀더 갈아두시구요 물기는 빠지게 해주세요~\\n손으로 살짝 짜서 덩어리 만들어두셔도 되구요 그리고 메밀소바면도 마트에서 3500원정도면 사더라구요\\n제일제면소거로 사봤어요~ 생각보다 면 색깔이 옅더라구요\\n1인분은 요거 한묶음이랍니다 총 5묶음 들어있어요 물을 끓이고 면을 넣은뒤 끓으면 찬물 한컵넣어 다시 끓이다가 또한번 찬물 부어주고 하면 좀더 쫄깃해져요\\n6분정도 데쳐주면 되구요 잘 데쳐진 면은 찬물에서 박박 빨듯이 세척해주세요\\n그래야 좀 더 쫄깃해져요~ 전분이 빠지구요 자 그럼 차갑게 된 육수에 면을 넣어요\\n손가락으로 걸어서 둥글게 만들려고 했는데..기술이 없어서 그냥 넣었어요 ㅎㅎㅎ 이제 데코만 하면되는데요 면 위에 무를 올리고 한켠에 오이 올리고 또한켠엔 파 올리고 (파는 얇게 써는게 좋아요 전 좀 두꺼우니 막 파가 매웠어요 ㅠ) 마지막으로 얼음 동동 띄우구요 김잘라서 올려주면돼요\\n아! 와사비 입맛에 맞게 짜주시면 되구요~\']','냉모밀  입맛  냉모밀  국수장국  냉모밀  시원  해먹을수  국시장국  오  국수장국  국수장국  국시장국  국시장국  입맛  오  무  덩어리  되구요  마트  면  면  찬물  찬물  되구요  면  찬물  면  면  오  켠  리  얼음  와사비  입맛  되구요'),(24,'우동','[\'엄마표 쯔유로 끓이는 우동 저희집 아이들은 우동을 참 좋아해요.\\n우동도 시판에 나와있는게 맛있는게 많지만...아무래도 좀 짜고 자극적인건 사실~\\n그리고 아이들도 알아요.\\n시판우동 끓여주면 엄마 이건 나중에 물을 많이 마시게되더라..라고 얘기합니다.\\n그래서 쯔유를 만들어서 우동사리만 사다가 우동을 끓여주기로!!\\n이 봉발엄마는 쯔유를 만들었답니다.ㅎㅎ\\n 어느날은 이렇게 어묵꼬치 끼워서 어묵우동으로 즐겼어요.\\n우동은 어떤 버젼이든 인기가 좋아요~\\n\\n [쯔유재료] 멸치 30g, 다시마 10g, 건표고버섯 2개, 가쓰오부시 30g, 물 1/5컵, 청주 1/2컵, 맛술 2컵, 설탕 2큰술, 참치액 2컵\\n[우동2인분재료] 물 5컵, 쯔유, 우동사리 2개, 새우튀김 2개, 쪽파 듬뿍 쯔유를 만들 건어물을 준비해줍니다.\\n멸치와 다시마...그리고 건표고버섯! 멸치 30g을 마른팬에 딸딸딸 볶아줍니다.\\n멸치가 노릇노릇 볶아 지면 그때 다시마와 표고버섯 그리고 얼려놓은 야채짜투리가 있음 넣어주세요.\\n역시 한번 슬쩍 볶아주고 1.5컵\\n맛술2컵\\n청주0.5컵\\n넣고 끓여줍니다. 이렇게 팔팔팔 끓으면 불을 끄고~~\\n\\n다시마를 이때 건져내셔도 되고..전 그냥 건지지않고 사용했어요.\\n이 육수를 하루 가만~히 두셔도 되어요.\\n그치만 전!!바로 사용 불을 끈후 가쓰오부시 30g을 넣어 줍니다. 약 20~30분 가량 가만히 둔 후\\n체에 받혀 걸러줍니다. 참치액2컵, 설탕2큰술을 넣고 한번더 후루룩~~끓여주면 됩니다. 참치액이 없으시면 간장에 혼다시를 넣으셔도 되어요.\\n\\n동일양 간장 2컵에 혼다시로 간 맞춰 주심 됩니다. 저 정도 양이면 이 병으로 2병의 쯔유가 나옵니다.\\n\\n쯔유 담을 병은 열탕소독해서 쯔유 담아주세요~\\n그럼 6개월도 보관 가능합니다.\\n\\n쯔유 이렇게 만들어 놓음 여러모로 활용이 가능합니다.\\n엄마표 쯔유 만들어보세요~어렵지 않죠?^^ 자자 그럼 우동을 만들어 볼까요~~~\\n\\n이마트 트레이더스에서 사다먹고 남은 새우튀김이 있었어요.\\n새우튀김 넣고 우동을 만들어 줄랍니다~~^^ 우동 2인분의양.\\n\\n생수5컵에 쯔유를 넣어주세요.\\n쯔유는 맛 보면서 적당히 넣어주심 됩니다.\\n내맘대로 간맞출수 있으니 넘 좋아요~~ㅎㅎㅎ 우동 간이 딱 되었음~~\\n우동사리 넣어주기요.\\n\\n우동사리는 이것도 이마트 트레이더스에서 산 우동사리예요.\\n이거 참 맛있어요..쫄깃쫄깃한 우동면.\\n제가 만나본 우동사리중에 제일 맛난거 같아요.\\n사누끼 우동사리 입니다.참고~^^ 보골보골 우동사리가 금새 익어요~\', \'떡볶이 양념으로 만든 국물 우동 떡볶이 양념으로 만드는 국물우동 만들기~ [국물 우동 재료] 우동 1, 어묵 1, 파 반 대, 청양고추 1, 다진 마늘 1큰 술, 깻잎 2장, 후춧가루 약간\\n[육수 재료] 건 새우 10g, 건고추 2개, 다시마 1장, 양파 파 약간씩 물 4컵\\n[양념 재료] 고추장 1큰 술, 설탕 1큰 술, 간장 2큰 술, 참치 액 젓 1큰 술 우동 파 고추 어묵 준비하고요 냄비에 물 4컵 붓고 육수 재료 넣어 끓이고 5분정도 끓이다가 다시마 건져내고 중불에서 약 10분 더 끓여요 육수에 건더기는 건져 내고 마늘,고춧가루, 간장, 설탕, 참치액젓 넣고 끓으면 우동 어묵 넣고 끓입니다 우동이 투명하게 익으면 파 고추 넣고 끓이고 마지막에 깻잎 넣고 후춧가루 넣고 마무리합니다 떡볶이 소스로 끓인 국물우동 완성~ 여기에 떡볶이떡을 넣어도 좋아요~\']','쯔유  우동  우동  아이들  쯔유  우동사리  우동  쯔유  다시마     설탕  우동사리  쯔유  건표고버섯  멸치  \\\\멸치  다시마  \\\\  육수  전  사용  가쓰오부시  참치액  간장  간장  혼다시  쯔유  병  쯔유  \\\\\\\\쯔유  가능  쯔유  우동  새우튀김  우동  우동  쯔유  우동  트레이더스  우동사리  우동사리  우동사리  떡볶이  우동  떡볶이  양념  국물  우동  재료  우동  어묵  파  술  재료  다시마  파  재료  술  설탕  술  간장  술  술  우동  파  어묵  준비  육수  재료  약  육수  마늘  간장  설탕  우동  어묵  우동  고추  깻잎  후춧가루  떡볶이  국물우동'),(25,'스테이크','[\'토마토카레 소스 목살 스테이크 만들기 한우스테이크는 질리고.ㅋㅋ 돼지목살로 스테이크를 요리하는 카레로 목살 냄새를 잡고 토마토로 느끼함을 잡을려고 토마토카레 소스를 만들었다 목살에 튀김가루를 입혀 구우면 튀김옷 맛이 있어 더 맛있어요. 카레와 토마토 비율은 취향에 따라 조절하세요. 그냥 토마토카레 덮밥으로 먹어도 맛있어요~ [재료] 돼지목살 300g, 양파 1/2개, 당근 1/3개, 새송이버섯 1개, 단호박 1/6개, 감자 1개\\n[양념] 토마토소스 5T, 카레 2T, 우유 2컵, 후추 조금, 소금 조금, 물 5컵 야채를 깍뚝 썰기한다. 단맛을 내기 위해 단호박을 넣는다. 없음 생략 가능 궁중팬에 물을 붓고 야채를 모두 넣고 끓인다. 한소금 끓어 오르면 분량의 토마토 소스와 카레 양념을 넣고 잘 저어준다. 카레가루가 잘 녹도록 계속 저어준다 한소금 끓어오르면 중불로 졸여서 토마토카레 소스 완성. 걸죽해지면 끝. 목살에 소금 후추를 솔솔 뿌린다. 목살 앞뒤면을 튀김가루로 코팅한다. 팬에 기름을 넉넉히 두르고 중불로 유지한다. 여기에 목살을 올려 앞뒤면을 노릇노릇 구워준다.고기가 말리면 말린 자리를 가위로 잘라 스테이크처럼 평평히 만든다. 넓은 접시를 준비한다. 그위에 목살스테이크를 올리고 토마토카레 소스를 부어준다. 밥을 겻들인다.\\n마지막으로 통깨 솔솔. 끝\', \'[한국조리사관전문학교]육우 고소미 스테이크 우리나라 최고의 소고기 스테이크와 고소한 깨무스, 산뜻하면서 알싸한 산초소스를 함께 먹는 음식 으로 일반적으로 가정집에서 손님이 왔는데 요리는 하지 못한다.... 그래서 간단하면서 색다른 식감을 주면서 맛있게 대접을 할수 있는 음식입니다. 1. 양파는 마른팬에 볶아줘야 갈색으로 변하면서 단맛이 올라온다.\\n2. 깨를 먼저 곱게 갈아준다.\\n3.스테이크를 구울땐 미리 팬을 달궈놓는다. [주재료] 채끝 등심 150g, 찹쌀 누룽지 50g, 가지 1/4개, 미니 파프리카 각 1/2개, 표고버섯 1개, 방울토마토 1/2개, 깻잎 4장, 적양파 1/4개\\n[깨무스] 참깨 7T, 검은깨 3T, 간장 1T, 식초 1T, 청주 2T, 매실청 1/2t, 설탕 2t, 양파(대) 1개\\n[산초소스] 산초가루 1/2t, 간장 4T, 참기름 1T, 고추기름 2t, 설탕 2t, 다진마늘 1t 양파를 얇게 채썰어준후 마른팬에 갈색이 나도록 볶아준다. 참깨7T와 검은깨3T를 곱게 믹서에 갈아준 후 간장1T, 식초1T, 설탕2t, 청주2T, 매실청1/2t,볶은 양파를 넣고 갈아준다. 파프리카와 표고는 스몰다이스로 자르고 가지는 어슷하게 썰어 소금,후추간을 해서 기름에 따로볶아준다. 적양파는 얇게 채썰어 찬물에 담궈두고 깻잎은 채썰고 방울토마토는 4등분을 해준다. 찹쌀 누룽지를 튀겨 곱게 부숴준다. 소고기에 소금,후추를 뿌려주고 높은 온도의 팬에 구워 육즙을 가두면서 구워준다. 산초1/2t,다진마늘1t,간장4T,참기름1T,고추기름2t,설탕2t를 넣고 잘섞어 산초소스를 만든다. 만든것을 그릇에 이쁘게 담아준다.\']','토마토카레  소스  목살  스테이크  리  스테이크  카레  목살  토마토  토마토카레  소스  목살  카레  토마토  토마토카레  돼지목살  양파  카레  후추  소금  조금  단호박  야채  토마토  소스  카레  한소금  토마토카레  소스  목살  소금  후추  목살  튀김가루  팬  목살  앞뒤면  리  스테이크  리  토마토카레  소스  끝  스테이크  스테이크  요리  음식  양파  단맛  스테이크  팬     간장  설탕  양파  마른팬  갈색  양파  파프리카  소금  적양파  깻잎  방울토마토  찹쌀  누룽지  소고  소금  후추  팬  산초소스'),(26,'리조또','[\'소시지 크림 리조또 이태리 크림 리쪼또에 목우촌 원칙을 지키는 프랑크와 환상적인 콜라보! 부드러운 풍미에 한번 먹어보면 흠뻑 빠져드는 소시지 크림 리조또 한번 만들어 보실까요? [재료] 파프리카 2개, 소금 조금, 후추 조금, 양파 1/2, 브로콜리, 우유 500ml, 목우촌 원칙을 지키는 프랑크 1개, 밥, 슬라이스치즈 3개 목우촌 원칙을 지키는 프랑크를 준비해주세요. 목우촌 원칙을 지키는 프랑크를 한 입 크키로 썰어줍니다. 나머지 재료들(양파, 브로콜리, 파프리카)도 먹기 좋은 크기로 썰어 준비해줍니다. 나머지 재료들(양파, 브로콜리, 파프리카)도 먹기 좋은 크기로 썰어 준비해줍니다. 팬에 기름을 두르고 손질한 재료들을 모두 볶아줍니다. 잘 볶아진 재료들에 우유를 넣어줍니다. 우유가 끓어오르면 밥을 넣고, 소금과 후추로 간을 해줍니다. 슬라이스 치즈늘 넣고 약한 불에 졸여주면 소시지 크림 리조또 완성! 입에 들어가자 살살 녹는 소시지 크림 리조또!\', \'토마토 리조또 만들기 뚝딱 만들어요 :) 토마토소스와 야채만 있으면 누구나 10분이면 만들 수 있어요!\\n리조또는 밖에서 사 먹기만 해서 만들기 어려울 줄 알았는데\\n진짜 너무너무 쉽더라구요!\\n토마토 리조또 만들기 우리 함께 시작해보아요! [재료] 토마토소스 적당량, 올리브유 적당량, 밥 한공기 반, 캔옥수수 반캔, 양파 1/2개, 다진 마늘 한숟갈, 피자 치즈 70g, 버터 한숟갈, 파슬리 약간, 소금 약간 토마토 리조또를 만들기 위해 필요한 재료들을 먼저 알려드릴게요. 먼저 양파 1/2개는 깨끗이 씻어서 얇게 썰어서 준비해주세요. 달궈진 프라이팬에 올리브유 적당량을 넣어서 둘러주세요. 다진 마늘 한 숟갈을 넣고 볶아주세요! 버터도 한 숟갈 넣어주세요. 다진 마늘과 함께 버터를 잘 녹여주세요. 버터가 다 녹았으면 얇게 썰어놓은 양파를 넣어줍니다. 양파가 노릇해질 때까지 볶아주세요. 캔옥수수는 넣고 싶은 만큼 넣어주셔도 돼요!\\n토마토소스는 먼저 밥숟가락으로 두 숟갈 반을 넣었어요.\\n처음부터 너무 많이 넣어버리면 간이 짤 수도 있기 때문이예요! 캔옥수수와 토마토소스를 골고루 잘 섞어주세요. 냉장고에 있던 밥이라 너무 딱딱해서 전자레인지에 1분 30초 돌려서 프라이팬에 넣어주었어요!\\n그럼 훨씬 더 볶기 편해져요.\\n밥 한공기 반을 넣어주시구요! 밥과 토마토 리조또 소스가 잘 섞이도록 볶아주세요! 벌써부터 먹음직스러워 보여요!! 간을 봤는데 너무 싱거워서 소금 약간이랑 토마토소스 한 숟갈을 추가해서 넣어주었어요. 다시 한번 토마토소스가 잘 섞이도록 볶아주세요.\\n밥 색깔이 약간 토마토처럼 빨개야 간이 맞는 것 같아요! 가스 불을 약하게 켠 상태에서 피자치즈 70g을 밥 위에 골고루 뿌려주세요! 프라이팬의 뚜껑을 2분 정도 닫고 피자치즈를 녹여주세요. 피자치즈가 생각보다 정말 금방 녹더라구요!\\n피자치즈가 적당히 잘 녹았어요! 이제 가스 불을 끄고 프라이팬을 뺀 후 그 위에 파슬리를 솔솔솔 뿌려주세요! 토마토 리조또를 만드는 데 10분밖에 안 걸렸어요!\\n너무너무 간단해요.\\n가까이에서 사진을 찍으니 더욱더 맛있어 보이는 토마토 리조또 ♥ 치즈 늘어나는 거 보세요!\\n토마토 리조또를 만들 때 프라이팬에 밥을 얇게 편 상태에서 약한 불에 2분 정도 기다리시면 토마토 리조또의 밥 밑부분이 약간 누룽지처럼 되면서 더욱 맛있는 토마토 리조또를 맛보실 수 있어요! 조리과정도 얼마 안 걸리고 맛도 좋고!\\n집에 있는 각종 야채나 고기류의 제품, 토마토소스만 있으면 누구나 쉽게 맛있는 토마토 리조또를 만들 수 있어요.\']','소  크림  리조또  크림  목우촌  원칙  프랑크  한번  소  크림  리조또  한번  재료  소금  조금  양파  브로콜리   우유  목우촌  원칙  프랑크  밥  목우촌  원칙  프랑크  준비  목우촌  원칙  프랑크  재료  양파  브로콜리   준비  나머지  재료  양파  브로콜리   파프리카)  준비  재료들  재료들  우유  우유  밥  소금  후추  간  불  소  크림  리조또  입  소  크림  리조또  토마토  리조또  토마토소스  수  리조또  재료  토마토소스  적당량  적당량  밥  반  캔옥수수  양파  마늘  버터  한숟갈   소금  토마토  리조또  재료들  양파  준비  프라이팬  올리브유  적당량  마늘  숟갈  버터  숟갈  마늘  버터  버터  양파  양파  캔옥수수  숟갈  반  간  수  캔옥수수  토마토소스  밥  프라이팬  한공기  반  밥  토마토  리조또  간  소금  약간  토마토소스  숟갈  한번  토마토소스  \\\\밥  토마토  간  것  불  피자치즈  밥  프라이팬  피자치즈  피자치즈  가스  불  프라이팬  위  파슬리  토마토  리조또  토마토  리조또  치즈  것  \\\\토마토  리조또  때  프라이팬  밥  상태  불  정도  토마토  리조또  밥  토마토  리조또  수  것  야채  토마토소스  누구  토마토  리조또  수'),(27,'파스타','[\'초간단 담백한 파르펠레 올리브 파스타 만들기 맛이 깔끔해요 :) 일반 파스타면과 예쁜 리본모양 파스타인 파르펠레를 함께 넣어서 \\n비주얼까지 예쁜 초간단 파르펠레 올리브 파스타를 만들었어요!\\n담백한 올리브 파스타 만들기! 우리 함께 만들어요! [재료] 체반 1개, 파스타 건면 2인분 양, 파르펠레 적당량, 기름에 부친 햄 약간, 후추 약간, 파슬리 약간, 올리브 오일 5큰술, 소금 약간, 다진 마늘 2스푼, 면수 2국자 초간단 담백한 파르펠레 올리브 파스타를 만들기 위해 \\n필요한 재료들이예요! 먼저 미리 기름에 부친 햄을 가위로 길쭉길쭉하게 잘라서 준비해주세요. 파스타면을 미리 삶아서 준비해줄게요.\\n냄비에 물을 넣고 소금을 약간 넣어준 뒤 물을 팔팔 끓여줍니다. 물이 끓기 시작하면 파스타 건면 2인분 양을 골고루 펼쳐 넣어주세요.\\n파스타 건면의 양은 면을 모아놓았을 때 500원짜리 동전 크기만큼 넣어주었어요! 파스타 면을 냄비에 모두 넣고 끓여주세요. 이 과정에서 파스타 건면을 너무 푹 삶아주시지 않으셔도 돼요!\\n이따가 프라이팬에 또 한 번 조리할 거예요!\\n팔팔 끓는 물에 5분 정도 끓여주세요. 파스타 건면을 삶고 난 뒤 면에서 우러나온 물인 면수를 \\n2국자 정도 그릇에 덜어주세요!\\n촉촉한 올리브 파스타를 만들기 위해 면수를 넣어줄 거예요! 삶아준 파스타 면은 체반에 그대로 옮겨 담아주세요.\\n찬물로는 씻지 말아주세요! 리본모양 파스타인 파르펠레도 삶아줘야겠죠?\\n파스타 건면을 삶아주는 과정과 똑같이 냄비에 물을 넣고 소금을 약간 넣어준 뒤 물이 팔팔 끓기 시작하면 파르펠레를 넣고 7분~8분 정도 끓여주세요. 파르펠레는 파스타 건면보다는 두꺼운 편이기 때문에 \\n파스타 건면을 삶는 시간보다 조금 더 삶아주시는 게 좋아요! 그리고 특히 파르펠레는 삶아지면서 서로 잘 붙기 때문에 나무젓가락이나 집게로 서로 붙지 않도록 저어주시는 게 좋아요! 8분 정도 팔팔 끓는 물에 파르펠레를 삶아주었어요! 삶아준 파르펠레도 파스타 건면과 마찬가지로 파스타 건면과 함께 체반에 옮겨서 자연스럽게 물기를 빼주세요! 이제 모든 재료를 프라이팬에 넣고 볶아주기만 하면 돼요!\\n달궈진 프라이팬에 올리브오일 5큰술을 넣어주세요. 길쭉길쭉하게 썰어준 햄을 바삭하게 익혀줄 거예요!\\n기름에 미리 부쳐준 햄을 넣어주세요. 올리브오일에 잘 볶아줍니다. 햄이 어느 정도 노릇하게 볶아졌으면 다진 마늘 2스푼을 넣어주세요. 햄과 함께 달달 볶아주세요! 아까 체반에 옮겨 놓은 파스타 면과 파르펠레를 프라이팬에 모두 옮겨 담아줍니다.\\n이때 그릇에 담아놓은 면수 2국자도 넣어주세요! 면에 아예 간이 되어 있지 않기 때문에 소금을 솔솔 뿌려서 간을 맞춰주세요! 면에 골고루 소금 간이 잘 배도록 섞어줍니다. 후추도 솔솔 뿌려주세요.\\n소금으로만 간을 맞추는 것보다 후추도 함께 넣어서 간을 맞춰주면 더 좋아요! 후추까지 면에 골고루 간이 배도록 섞어주면 초간단 담백한 파르펠레 올리브 파스타 만들기! \\n완성이예요! 파르펠레가 들어있어서 양이 더 푸짐한 것 같아요! 리본리본한 파르펠레 ♥\\n진짜 비주얼이 너무너무 예뻐요! 마지막 장식으로 파슬리 가루도 솔솔 뿌려주었어요!\\n초록초록한 파슬리 가루를 뿌려주니까 \\n올리브 파스타가 굉장히 신선해 보입니다. 보기만 해도 굉장히 담백하고 깔끔한 맛이 날 것 같은 \\n초간단 파르펠레 올리브 파스타!!!\\n맛은 어떨지 한번 먹어보도록 할게요. 포크에 파르펠레랑 길쭉하게 썰어준 햄이랑 함께 먹어봤어요!\\n햄이 들어있어서 적당히 짭짤하니 심심하지 않은 맛이라서 좋더라구요!\\n담백하고 깔끔한 맛의 파르펠레 올리브 파스타를 원하신다면 요렇게 파스타 면과 예쁜 파르펠레를 넣어서 \\n먼저 눈으로 한번 먹고 입으로 또 한번 먹는 \\n초간단 담백한 파르펠레 올리브 파스타를 만들어서 드셔보세용!\', \'치마살 로제 파스타 치마살과 로제파스타를 함께 먹어요! 물을 끓여줍니다. 파스타 면을 삶을 때, 오일 한스푼과 소금 반스푼을 넣어서 삶아줍니다. 나머지 재료를 준비해줍니다. 치마살을 달구어진 후라이팬에 올려줍니다. 삶은 파스타면을 체에 부어 물기를 빼줍니다. 고기를 앞뒤로 구워줍니다. 키친타올로 기름을 닦아줍니다. 양파를 넣어줍니다. 후추를 넣고 같이 볶아줍니다. 로제 소스를 넣어줍니다. 삶은 파스타면을 넣어줍니다. 소스가 골고루 베이도록 섞어줍니다. 접시에 이쁘게 담고 맛있게 먹으면 됩니다.\']','초간단  담백한  파르펠레  올리브  파스타  맛  파스타면  파스타  파르펠레  초간단  파르펠레  올리브  파스타  올리브  파스타  재료  체반  파스타  건면  양  파르펠레  햄  약간  후추  약간  파슬리  약간  올리브  소금  약간  면수  초간단  담백한  파르펠레  올리브  파스타  햄  준비  파스타면  준비  물  소금  뒤  물  물  파스타  건면  분  양  \\\\파스타  건면  양  면  파스타  면  파스타  건면  프라이팬  거예요  물  정도  파스타  건면  뒤  면  물  면수  정도  올리브  파스타  면수  거예요  파스타  면  체반  리본모양  파스타  파르펠레  \\\\파스타  건면  과정  냄비  물  소금  뒤  물  시작  파르펠레  정도  파르펠레  파스타  건면  때문  \\\\파스타  건면  삶  것  파르펠레  때문  것  정도  물  파르펠레  파르펠레  파스타  건면  파스타  건면  체반  재료  프라이팬  프라이팬  햄  거예요  햄  햄  정도  마늘  햄  체반  파스타  면  파르펠레  프라이팬  그릇  면수  면  간  때문  소금  간  면  소금  간  후추  간  것  후추  간  후추  면  간  배  초간단  담백한  파르펠레  올리브  파스타  파르펠레  양  것  파르펠레  파슬리  파슬리  가루  파스타  깔끔  맛  것  파르펠레  올리브  파스타  한번  햄  맛  맛  파르펠레  올리브  파스타  파스타  면  파르펠레  한번  한번  \\\\초간단  담백한  파르펠레  올리브  파스타  치마살  파스타  치마살  물  파스타  면  삶  때  소금  재료  준비  치마살  삶  파스타면  후추  로제  삶  파스타면  소스'),(28,'함박스테이크','[\'만들어 놓으면 뿌듯한 함박스테이크 10월 31일, 10월의 마직막날에는 할로윈이죠~\\n할로윈파티음식으로 함박스테이크와 감자그라탕을 만들었어요~\\n오랜만에 집에서 분위기를 냈더니 너무 뿌듯하네요 ^^\\n함박스테이크 굽는 방법과 함박스테이크 소스 만들기 그리고 남은 함박스테이크 냉동실 보관 방법까지 자세히 올려두었으니 \\n영상으로 확인해보세요~\\n이번 할로윈은 집에서~! 조촐하게 파티를 열어보심은 어떠실까요~^^* 소분해서 냉동실에 넣어놓고 꺼내먹으면 간단하게 한끼를 해결 할 수 있는 함박스테이크!\\n만들어 놓으면 뿌듯하답니다 ^^ 만드는 방법도 어렵지 않으니 꼭 한번 도전해보세요~\\n아이들 도시락 반찬이나, 방학때 많이 만들어 놓고 냉동고에 두고 드시면 너무 좋아요:) [재료] 다진 돼지고기 400g, 다진 쇠고기 200g, 양파 1, 다진 마늘 1큰 술, 소금 1티스푼, 후추조금, 전분 가루 3큰 술, 빵가루 8큰 술, 계란 2, 체다치즈 2\\n[스테이크 소스] 돈가스 소스 4큰 술, 굴소스 1큰 술, 케찹 1큰 술, 꿀 1큰 술, 후추 조금, 물 2~3큰 술\\n[샐러드 소스] 야채믹스, 발사믹 식초 1+1/2큰 술, 올리브유 3큰 술, 꿀 1큰 술, 파슬리 조금 양파를 잘게 썰어주세요\\n식용류 1 큰 술을 넣고 다진 마늘과 양파를 볶아줄꺼에요\\n소금과 후추로 심심하게 간을 해주세요 볶은 다진 마늘과 양파는 식혀줍니다\\n뜨거울때 섞으면 고기가 익어서 안돼요! 다진 돼지고기와 소고기를 넣고 반죽을 만들어주세요\\n반죽이 질다 느껴지면 빵가루를 조금씩 더 섞어가면서 치대주시면 됩니다 \\n저는 10분정도 반죽했어요 그래야 구울때 모양이 망가지지 않아요! 소고기와 돼지고기는 1:1 비율로 많이 하죠~ \\n소고기 비율을 높이셔도 좋지만 좀 뻑뻑한 느낌이 들어 개인적으로는 돼지고기가 많이 들어간 부드러운 느낌을 좋아합니다 큰 반죽과 작은 반죽으로 나눠서 보관 할꺼에요~ 위생봉투를 잘아서 반죽을 보관하면 나중에 해동하고 드실때 쉽게 고기를 분리 할 수 있어 좋아요!\\n영상에 자세히 올려두었으니 참고하세요! 요렇게 지퍼백에 넣어서 냉동실에 고고~!! 분량의 소스도 약불에서 보글보글 끓여주세요 샐러드 소스는 발사믹입니다\\n자칫 느끼할 수 있는 함박스테이크를 요소스의 샐러드와 함께 먹으면 너무 맛있어요 궁합이 좋으니 추천해요! 식용류 1 큰 술을 두른 팬을 달궈주세요\\n중약불로 줄이고 고기를 올려 구워주시면 됩니다 고기를 올려주실때는 고기반죽 가운데를 한번 꾸욱 눌러주세요\\n볼륨이 있기 때문에 센불에 구우면 겉만 타고 속이 제대로 익지 않아요! 앞뒤로 노릇하게 익혀주신후, 물을 넣고 뚜껑을 닫아 완전히 익혀줄꺼에요 이제 완성입니다~!!\', \'돼지고기 함박스테이크 함박스테이크 [재료] 돼지고기 다짐 육 500g, 양파 1/개, 대파 2대, 달걀 2개\\n[양념] 간장 2, 맛술 2, 빵가루 컵, 다진 마늘 2, 설탕 1, 소금 0.2, 후춧가루 0.3, 생강가루 약간\\n[소스 ] 새송이버섯 1개, 돈가스 소스 5, 케첩 5, 물 1/2컵, 올리고 당 2, 후춧가루 약간 대파 2대는 송송 썰어 준비하고\\n양파 1/2개는 잘게 다져 주세요. 팬에 식용유를 살짝 두르고 썰어놓은 대파, 양파를 모두 넣고\\n달달 볶아주세요.\\n양파가 투명해질 때까지 볶아주고\\n볶아 놓은 재료는 충분히 식혀 줍니다. 돼지고기 다짐 육이 그릇에 담고\\n볶아서 식혀 놓은 양파, 대파를 넣어주고\\n양념재료인 간장 2, 맛술 2, 다진 마늘 2, 빵가루 1컵, 설탕 1,\\n소금 0.2, 후춧가루 0.3, 생강가루 약간을 \\n모두 한데 넣어 주세요. 그리고 비닐 위생장갑을 끼고\\n반죽을 고루 섞어 찰지게 반죽을 해주세요. 반죽을 4개로 나눠 둥글 넓적하게 만들고\\n가운데 부분은 움푹 파서 돼지고기 함박스테이크를 만들어 주세요. 달군 팬에 식용유를 적당히 붓고\\n만들어 놓은 함박스테이크를 넣고 중약불에서\\n한 쪽 면을 노릇하게 구워 주세요.\\n한 쪽 면이 잘 구워지면 뒤집어주고\\n다른 면도 노릇하게 굽다\\n물을 약간 넣어 뚜껑을 닫고 속까지 촉촉하게 익혀주고\\n겉 부분을 노릇하게 구워 주심 돼요. 팬에 식용유 또는 버터를 두르고\\n새송이버섯 1개를 적당하게 썰어 볶아줍니다.\\n\\n버섯은 아무거나 사용하세요 ㅋ\\n양송이버섯이 좋은데 없어서 새송이버섯 사용했어요.\\n느타리버섯도 좋아유~ 소스 재료인 돈가스 소스 5, 케첩 5, 물 1/2컵을 붓고\\n재료가 고루 섞이도록 잘 젓어주고 바글바글 끓여 주세요.\\n그리고 마지막에 올리고 당 2, 후춧가루 약간을 넣어 \\n소스 농도를 조절해 마무리합니다. 달걀 프라이도 해주세요. 그릇에 구워놓은 돼지고기 함박스테이크를 올리고\\n만들어 놓은 소스를 취향껏 끼얹고\\n달걀 프라이를 얹어 주면\\n\\n돼지고기 함박스테이크 완성 ^^\']','뿌듯  함박스테이크  함박스테이크  뿌듯  방법  함박스테이크  소스  함박스테이크  냉동실  보관  방법  집  냉동실  수  함박스테이크  뿌듯  방법  재료  돼지고기  양파  마늘  술  술  빵가루  술  소스  돈가스  소스  술  술  술  술  소스  술  술  술  양파  술  마늘  양파  후추  마늘  양파  고  돼지고기  반죽  빵가루  반죽  때  소고  돼지고기  비율  돼지고기  반죽  반죽  보관  반죽  보관  때  고  수  \\\\영상  냉동실  소스  소스  수  함박스테이크  샐러드  술  팬  고  고  때  한번  노릇하  돼지고기  함박스테이크  함박스테이크  재료  돼지고기  양파  개  대파  빵가루  마늘  소금  후춧가루  돈가스  소스  리  후춧가루  대파  팬  식용유  대파  양파  때  재료  돼지고기  다짐  육  양파  대파  간장  맛술  마늘  빵가루  설탕  후춧가루  생강가루  반죽  반죽  돼지고기  함박스테이크  팬  식용유  함박스테이크  면  노릇하  쪽  면  면  노릇하  뚜껑  속  부분  노릇하  팬  식용유  새송이버섯  사용  소스  재료  돈가스  소스  케첩  당  후춧가루  약간  달걀  그릇  돼지고기  함박스테이크  소스  함박스테이크  완성'),(29,'피자','[\'홈메이드 브런치 또띠아 피자 집에 또띠아가 많이 남아서 만들어본 응용요리에요^^ [재료] 또띠아, 방울토마토, 햄(아무종류나), 토마토소스, 모짜렐라치즈, 옥수수통조림, 체다치즈, 다진양파(생략무관) * 재료 : 또띠아 (지름 20cm)\\n피자 치즈. 후랑크소세지. 옥수수캔. 토마토소스. 방울토마토. 치즈. 지름 20cm의 또띠아를 후라이팬 에 깔고... 그위로 토마토 소스를 고루 펴발라준다 피자 토핑 올릴 재료들 준비.\\n (후랑크소세지. 방울토마토) 준비한 토핑을 차례로 또띠아 위에 데코.\\n(토마토소스 - 프랑크소세지 - 콘옥수수 - 다진양퍄(생략무관) 모짜렐라치즈와 체다 치즈를 올려주고 올리브가 있다면 올리브와 방울토마토를 함께 올려준다.\\n다음에 그위로 모짜렐라 치즈를 한번더 해줘도 좋을듯. 마른 팬에 약불에서 뚜껑을 덮고(치즈녹이기 위함) \\n\\n후라이팬에 할경우 상태를 봐가며 대략~ 중약불에서 10분내외로 익혀주면됨.\\n\\n오븐의 경우 200-230도에서 15분-20분사이 \\n\\n전자렌지를 활용해도 됨\\n(상태 봐가며 돌려주면됨. )\', \'또띠아 고르곤졸라 피자 무화과쨈을 넣어 꿀을 찍어먹을 필요없는 고르곤졸라 피자입니다. 또띠아로 간단하게 만들어 먹을 수 있어 더 좋아요. [또띠아고르곤졸라피자] 또띠아 3장(20cm), 고르곤졸라치즈 20~30g, 모짜렐라치즈 200~250g, 꿀 0.5큰술, 무화과쨈 1큰술, 다진마늘 0.5큰술, 냉도 블루베리 적당히 또띠아 한장에 무화과쨈을 골고루 발라주세요 모짜렐라치즈와 고르곤졸라치즈를 적당히 올리고 또띠아 한장을 더 올려줍니다. 이어서 꿀과 마늘을 섞어 얇게 펴발라줍니다. 다시 모짜렐라치즈와 고르곤졸라치즈, 냉동 블루베리를 적당히 올려주세요. 남은 또띠아는 반으로 접어 똑같이 진행해주세요. 오븐팬에 올려 190도에서 10분간 구워줍니다. 10분뒤 꺼내줍니다. 치즈가 노릇하게 잘 구워졌죠??\']','또띠아  피  또띠아  방울토마토  재료  치즈  토마토소스  방울토마토  치즈  또띠아  피  방울토마토  토핑  또띠아  모짜렐라치즈  치즈  올리브  방울토마토  그  치즈  피  무화과쨈  고르곤졸라  또띠아  또띠아  모짜렐라치즈  무화과쨈  또띠아  무화과쨈  모짜렐라치즈  고르곤졸라치즈  또띠아  한장  꿀  모짜렐라치즈  블루베리  또띠아  치즈'),(30,'짜장면','[\"집밥 백선생 짜장면 응용 버전 오늘은 짜장면 레시피를 작성해봅니다~^^ 짜장면을 만들기 어렵다고 생각하실 때는 집밥백선생님 소환♥ 그래서 집밥백선생 짜장면 만들기 시작해봅시다!! 아',' 저는 집밥백선생님 짜장면 레시피 참고하였고'),(31,'짬뽕','[\'매콤 심플 짬뽕 집에서 먹는 매콤하면서도 심플(간단)항 짬뽕이에요.\\n간단하고 쉽게 짬뽕을 즐겨보세요!. -육수를 사용하거나 조개등을 더 넣어주면 더 맛있는 짬뽕을 즐길수 있지만 심플하게 이정도만 넣어도 맛있는 짬뽕을 즐길수 있습니다.\\n-집에 고춧가루가 매운고춧가루여서 충분히 맵게 먹었지만 집고추가루가 맵지 않으면 추가로 청양고추를 썰어 넣어주세요.\\n-면이 없을때는 밥말아먹어도 좋아요. [재료] 칼국수면 130g(1인분), 돼지고기 1줌, 칵테일새우 5개, 양파 1/2개, 대파 1/2개, 숙주 1줌, 다진마늘 1작은숟\\n[양념] 매운고추가루 2T, 굴소스 2T, 간장 2T 재료를 씻은 후 손질한다\\n-마늘은 다진다\\n-양파는 채썬다\\n-다파는 손가락 한마디 크기로 자른다\\n-칼수면도 물에 행궈 겉에묻은 가루를 제거해준다(텁텁한맛이 없어짐) 팬에 기름을 살짝 두른 후 고기부터 구워 고기기름을 내준다.(웍이 없으면 가정용 후라이팬에 해도 무방하다) 삼겹살에 살짝 색이 나올때쯤 양파를 넣어준다.(이때 부터 불을 중불로 줄여 물을 넣기 전까지 중불로 볶는다) 다진 마늘을 넣고 볶아준다. 새우를 넣고 볶아주다 새우가 익어갈때쯤 고춧가루를 넣고 볶아준 후 굴소스를 넣고 마저 볶아준다. 고추가루가 타지않을 정도까지만 충분히 볶아준다. 불을 샌불로하여 물을2컵 넣어주고 대파를 넣고 끓여준다.\\n(먼저 1컵만 넣고 칼국수 끓인 물로 농도를 맞춰가며 2컵을 채워준다) 간장으로 간을 한 후 충분히 끓으면 불을 끄기 직전에 숙주를 넣어준다. 칼국수면을 끓여준다.\\n(다 끓이고 국물육수 농도 조절용으로 물을 반컵정도 남겨둔다) 그릇에 국수를 덜어놓는다. 면에 국물과 건더기를 넣고 맛있게 먹는다.\', \'얼큰한 국물이 먹고 싶을 때, 집밥백선생 짬뽕 만들기. 집밥 백선생님 레시피로 얼큰한 짬뽕을 만들어 보았습니다. [주재료] 양파, 호박, 당근, 부추, 배추, 파, 삼겹살(어느부위든상관X), 해물믹스\\n[양념] 생강(다진생강), 고춧가루, 후추, 진간장, 소금, 식용유\\n[면] 밀가루(중력분), 물 먼저 야채를 손실합니다. 양파, 호박, 당근 채 썰어 줍니다. 부추와 배추는 적당한 크기로 자르고, 대파는 쫑쫑 썰어줍니다. (그리고, 원래 집밥백선생님은 배추 말고 양배추를 사용했는데,,, 전 양배추가 없길래 그냥 배추로 ㅋㅋㅋ 그리고 부추는 선택사항!!이라고 말씀하셨습니다.) 생강을 다져줍니다.(전 집에 다진 생강이 없어 그냥 생강을 다져 사용했습니다.) 저는 집에 삼겹살 부위 밖에 없어 그냥 삼겹살을 사용했어요 ( 제 생각인데 딱히 부위는 상관없을 것 같습니다!!!) 그래서 삼겹살을 채 썰어주거나 다져주시면 됩니다. 전 집에 해물 믹스가 있길래 잠시 물에서 해동시켜주시고 오징어는 따로 건져 놔둡니다 (집밥백선생님께서 통오징어를 사용하셨는데 ,,,,, 전 해물 믹스 오징어 ㅋㅋㅋㅋㅋ) 프라이팬에 식용유 두르고, 파, 생강을 넣어 파 기름을 만들어줍니다. 그 후 돼지고기를 먼저 넣고 볶아주다가, 오징어를 넣고 볶아줍니다. 그 후 진간장을 넣어줍니다. 제일 먼저 양파를 넣어 볶아줍니다. 그 후 모든 채소와 해물 믹스를 넣어 볶아줍니다. 그다음에 고춧가루를 넣어 볶아줍니다. 물을 넣고 굵은소금, 후추로 간을 해주면 짬뽕 완성! 만들어 놓은 짬뽕에 부추를 넣어 마무리. 중력밀가루와 물(소금물)로 반죽을 해줍니다. (전,,, 짬뽕면이 집에 없길래 그냥,,,, 칼국수 면 만든다고 생각하면서 면을 만들어봤어요^^) 먼저 면을 담을 쟁반에 밀가루를 뿌려둡니다. 도마에 밀가루 뿌려주시고, 반죽을 절반으로 나누어 사용. 밀대를 이용해 밀어줍니다. 그 후 밀가루를 뿌려줍니다. ( 접을 때 서로 붙는 거 방지!!) 3~4등분으로 접어주시고 최대한 얇게 썰어 줍니다. 면을 아까 그 쟁반에 털어주시듯 합니다. 물이 끓이면 면을 삶아줍니다. 면을 그릇에 담아주시고, 짬뽕을 부어주시면 진짜 완. 성.!!!\']','짬뽕  집  짬뽕  사용  짬뽕  짬뽕  수  고춧가루  때  칼국수  양파  대파  재료  후  물  후  삼겹살  때  양파  물  전  중불  새우  때  고춧가루  후  굴소스  대파  칼국수  물  간장  후  숙주  물  면  국물  때  짬뽕  짬뽕  양파  부추  배추  고춧가루  물  양파  호박  당근  부추  배추  대파  배추  사용  전  양배추  배추  부추  생강  전  집  생강  생강  사용  집  삼겹살  삼겹살  사용  저  부위  삼겹살  채  전  집  해물  믹스  물  오징어  사용  전  해물  믹스  오징어  파  생강  후  돼지고기  오징어  후  양파  후  해물  믹스  고춧가루  물  후추  간  짬뽕  짬뽕  부추  전  집  칼국수  면  생각  면  면  밀가루  밀가루  반죽  사용  후  밀가루  때  것  면  쟁반  물  면  면  그릇  짬뽕'),(32,'샤브샤브','[\'간단한 소고기 샤브샤브 주말이라 가족이랑 마당에서 바람이 불어도 오래간만에 샤브샤브를 간단하게 만들어 다들 맛나게 먹었습니다 소스는 만들지 않고 그냥 월남쌈 소스한병사고 채소와 다시물만 내고 단시간에 준비했는데 모두들 너무 잘 먹었다고 하니 기분이 좋네요^^ 샤브소스는 시판하는 월남쌈소스를 사고 다시물은 집에있는 야채랑, 다시마 ,멸치,를 넣고 끓여주고 간은* 소금이랑* 국간장을1대1로 했습니다 간은 보시고 조금식 하세요 *샤브용야채는 어떤 야채도 다가능 해요 소고기와 여러가지 야채는 모두 깨꿋이 씻어 썰어놓고 \\n*(소고기는 샤브샤브할꺼니 최대한 *얇게 썰어줄라고 하세요 꼭꼭요 두꺼우면 잘익지도 않고 질긴것 같아요) 다시물에다 소금이랑 국간장으로 간한후 여러가지 야채를 넣고 소고기를 넣고 살짝익혀 월남쌈을 조금 따뜻한 물에 1~2분 담가 개인접시에 놓고 야채와 고기를 소스에 찍어 쌈싸먹어 보세요 담백하니 맛나요 고기를 다먹고 파, 물만두 한봉지를 넣고 팔팔끓인다\\n*( 칼국수나 국수를 기호에 따라 넣어도 됩니다 ) 요렇게 맛나게 끓으면 드시면 됩니다 \\n소고기 샤브샤브 정말 만들기 간단해요 한번 해보세요 아주 쉽게 할수 있답니다\', \'일본정통 샤브샤브 , 이렇게 쉬운데 이렇게 맛있다니♥ 진~한 육수에 샤브샤브를 퐁당퐁당! \\n요즘같은 환절기에 체력보충으로 따봉bbbb \\n소스에 콕콕 찍어먹으면 한도끝도없이 들어가네 ㅠㅠ \\n\\n세상의 모든 레시피 만개의레시피 [필수재료] 샤브샤브육수 1팩, 샤브샤브용쇠고기 300g, 배추 300g(약8장), 곤약 200g, 두부 1/2모, 당근 50g, 대파 1대\\n[소스재료] 폰즈소스, 참깨소스\\n[선택재료] 밥 1공기, 달걀 1개, 김가루 1줌, 참기름 1숟가락, 쪽파 약간 배추는 최대한 비스듬히 썰어서 준비한다. 대파는 어슷 썰고 두부는 한입 크기로 썰어 준비한다. 곤약은 약 1Cm 두께로 썰어 가운데 칼집을 넣고 꼬아서 준비한다. 당근은 필러를 이용해 얇게 썰어 말아 준비한다. 냄비에 물 1400ml를 넣고 샤브샤브 육수 1팩을 넣는다. 육수가 끓어 오르면 준비한 채소와 고기를 넣어 익힌다. 폰즈소스와 참깨소스를 곁들여 먹는다. 육수를 적당히 남겨 밥을 넣어 국물을 졸이고 달걀, 김가루, 쪽파, 참기름을 넣어 죽을 만들어 먹는다.\']','소고  샤브샤브  샤브샤브  준비  야채  야채  소고  야채  야채  소고  월남쌈  야채  고  소스  고  샤브샤브  간단  샤브샤브  한  육수  샤브샤브  배추  준비  대파  두부  준비  곤약  준비  당근  준비  샤브샤브  육수  육수  채소  고  육수  밥  달걀  참기름'),(33,'쌀국수','[\'베트남 쌀국수 찬바람이 부는 요즘 뜨끈한 국물이 생각나서\\n남편이랑 주말에 부부홈쿡~ 토핑 레몬과 땡초는 먹기전에 잘섞어주고\\n레몬은 먹기전에 건져놓고 드시면 맛있어요~ [재료] 쌀국수 250g (4인분), 숙주 200g이나 원하는만큼, 양파 1개, 소고기(샤브용) 200~300g, 땡초 2개, 홍초(붉은고추) 1개, 레몬(슬라이스) 2조각, 물 5리터\\n[양념] 청정원 베트남쌀국수 소스 1통 쌀국수 삶기 (젤 맛있게 먹으려면 물어 30분~1시간 정도 불리는게 좋아요)\\n너무 오래 끓이면 면 탄력성이떨어져서 끊어지니 면 흐물해질때까지만 건져서 찬물에 행궈서 물빼기 물5리터에 소스 넣어 끓이기 숙주 흐르는물에 씻어 체에 받치기 양파 반잘라서 가로로 썰기 토핑 (땡초,홍초,레몬 슬라이스) 준비 3번 소스넣은 물이 끓으면 숙주,양파먼저넣고 익을때쯤 소기기 넣어 끓이기 큰 그릇에 면 넣고 건더기 올리고 국물붓고 마지막 6번 토핑 올리면 완성~!♡\', \'이마트에서 구매한 가성비&맛 까지 다잡은 베트남식 쌀국수 쌀국수를 좋아하지는 않지만, \\n밤 9시쯤에 이마트를 갔는데\\n때마침 세일을 하고 있더라구요.\\n가격은 2600원이였구요\\n세일의 늪에 빠져버려서 한번 구매해봤습니다. [재료] 베트남식 쌀국수 1개, 소목심 70g 먼저 구성을 보면 소스, 면, 숙주, 고추,대파, 양파, 고수 \\n2600원에 엄청난 가성비를 제공합니다.\\n다른 재료들은 딱히 필요가 없습니다. 야채들은 따로 빼서 물로 헹궈주세요.\\n이때 고수는 나중에 넣어줘야 하기 때문에 따로 빼줍니다. 면은 뜨거운 물에 5분간 담가놓습니다. 물에 소스를 넣고 끓여줍니다. 끓으면 준비한 야채와 고기를 넣고 다시 한소끔 끓여주세요 5분간 불린 면에 육수를 부어줍니다. 위에 숙주를 얹어주면 끝!\']','쌀국수  토핑  먹기전  쌀국수  숙주  양파  땡초  소스  쌀국수  면  면  소스  숙주  양파  토핑  물  면  토핑  리  쌀국수  쌀국수  구매  재료  베트남식  쌀국수  소스  면  숙주  양파  물  고수  면  물  물  소스  면  숙주'),(34,'월남쌈','[\'오리훈제 월남쌈 몸에 좋은 오리고기로 눈으로 한번 입으로 또 한번 먹을 수 있는 월남쌈 만들어 보세요~! [재료] 참프레 오리훈제 슬라이스 500g, 파프리카 2개, 깻잎 한 묶음, 당근 1/2개, 오이 1/2개, 라이스페이퍼, 파인애플 참프레 오리훈제 슬라이스 , 기호에 따른 각종 야채 라이스페이퍼를 준비합니다 파프리카,깻잎,당근,오이 등 야채들은 일정한 크기로 잘게 잘라줍니다. 참프레 오리훈제를 후라이펜에 노릇노릇 구워줍니다. 자른 야채들을 접시에 플레이팅하고 가운데 오리훈제를 올려주세요! 기호에 따라 소스를 준비하여 주세요\', \'월남쌈 샌드위치 만들기~더위에 물러나지 않기!! 주말엔 열심히 먹었으니까...오늘 저녁 한끼정도는 가볍게!!먹어야겠습니다. 가벼운 샌드위치!저칼로리 샌드위치를 만들었어요.\\n\\n바로바로~~월남쌈 샌드위치요~\\n 이거 하나면 끝나요~~ㅎㅎㅎㅎ\\n불 1도 쓰지않는 월남쌈샌드위치!! 점보월남쌈~~\\n라이스페이퍼위에서 후~딱 말아주는게 팁!! [재료] 라이스페이퍼 4장, 로메인이나쌈야채 4장, 양파 1/5개, 양배추 손바닥크기2장, 방울토마토 2개, 오이 1/4개, 삶은달걀 1개, 참치, 후추 샤샤샥\\n[소스] 시판땅콩소스 집에있는 야채는 총출동합니다.\\n\\n쌈야채만 사왔네요~~\\n집에있는 야채들 모두 넣어주심 되어요.\\n이참에 냉장고 한번 또 털어주심 되겠죠?? 라이스페이퍼도 준비해주세요.\\n\\n라이스페이퍼가 오늘의 포인트!!랍니다~~~\\n동원 바로먹는 더:참치 to go 레몬페퍼맛이예요.\\n샌드위치에 잘어울릴거 같아서 선택!! 모든 재료는 채썰어주심 되어요.\\n\\n월남쌈에 야채 많이 들어가잖아요.\\n듬뿍듬뿍 넣어줄거예요.\\n한개만 먹어도 다른생각안나게요...ㅎㅎㅎ\\n\\n참치와 양파는 진짜 잘어울리니까 꼭~넣어주세요. 잘랐을때 이쁜 비주얼 담당 방울토마토~\\n붉은색이면 됩니다.\\n파프리카 넣어주셔도 너무 좋겠죠?? 단백질 보충을 위해서 달걀도 하나 넣어줍니다.\\n\\n저의 10년된 달걀채썰기도구가 철끈이 하나 끊어졌어요.ㅠㅜ\\n요리를 시작하면서 구매한것인데...\\n하나 끊어진채로 사용하고 있긴합니다.ㅎㅎㅎ\\n\\n다른것으로 구매를 할까..똑같은것으로 구매를 할까 고민중이예요~\\n뭐 좋은거 있음 추천해주세요~~~\\n(제가 백날 추천해달라고 해도...아무도 추천안해주신당~~!!!ㅋㅋㅋㅋ) 이렇게요~~저기 빨간부분도 라이스페이퍼예요..ㅎㅎㅎ\\n저렇게 4장을 겹쳐두는거예요.\\n\\n그리고 칙칙이로 물을 칙칙!\\n\\n근데 또 이게 너무 흥건하게 뿌려주심 안되고요.\\n이음새가 붙을정도만 뿌려주세요.\\n안그럼 나중에 다 들러붙고 난리난리~~~ 라이스페이퍼 위에 우리 준비해둔 야채들 올려줍니다.\\n양배추 듬뿍올리고...양파도 듬뿍.\\n슬라이스한 계란도 올리고요. 동원 바로먹는 참치 더 to go\\n레몬페퍼맛으로 올려주었어요~\\n\\n젓가락으로 흘러내리지않게 가지런히~~ 전 후추를 좋아해서 후추를 샤샤샥 더 갈아넣어주었네요. 그 위에 방울토마토와 오이로 참치를 덮어주고\\n\\n자자 이제 맙시다~~~ 라이스페이퍼 끌어다가 찢어지지않게 힘조절!!\\n\\n샤샤샥 동글~~말아주면 되어요~~ 이렇게요~~\\n\\n월남쌈 샌드위치가 돌돌 잘 말렸어요.ㅎㅎㅎㅎㅎ\\n\\n말아놓고 좀 뻣뻣하다싶음 그때 물을 더 칙칙 뿌려주심 됩니다. 반 딱!!잘라서~~\']','오리훈제  월남쌈  한번  한번  월남쌈  재료  프레  오리훈제  라이스페이퍼  프레  오리훈제  슬라이스  야채  라이스페이퍼  준비  야채들  프레  오리훈제  야채들  오리훈제  기호  준비  월남쌈  샌드위치  샌드위치  샌드위치  재료  라이스페이퍼  양파  오  참치  후추  야채  야채들  한번  라이스페이퍼  준비  오늘  재료  야채  양파  구매  구매  것  구매  라이스페이퍼  라이스페이퍼  준비  야채들  양파  바로먹  참치  후추  후추  위  방울토마토  참치  라이스페이퍼  샌드위치  물  칙칙'),(35,'커리','[\'카레 라이스 만들기 / 부드러운 코코넛밀크를 넣은 특별한 요리 꿍팟퐁커리 태국의 유명한 요리\\n푸. 팟. 퐁. 커. 리.......\\n푸...게를 뜻해요 튀긴 게에 보드라운 커리와\\n함께하는 태국의 대표적인 요리\\n이번엔 새우를 넣어서 커리에 부드런 코코넛 밀크와\\n계란으로 만들어보았어요\\n\\n꿍....새우\\n팟....볶다\\n커리....우리가 아는 카레... 카레 종류는 독특한 향이강한 인도식카레...\\n우리가 잘 알고있는 한국식카레....\\n향신료와 과일맛으로풍미가 가득한 태국식 카레가 \\n있는데요\\n좋아하는 카레는 어떤것도 좋을듯합니다\\n구입도 요즘은 인터넷으로 편하게 할수있는거같아요~\\n(카레 양은 입맛에 따라 가감해서 풀어주세요~)\\n\\n코코넛 밀크는 우유로 대채하셔도 부드러움을 느낄수있으세요\\n\\n [재료] 칵테일새우 7마리, 코코넛 밀크 1큰술 하고1/2, 계란 2개, 당근 약간, 양파 약간, 피망 약간, 치킨스톡 종이컵 1컵, 인도식카레 1큰술, 고추기름 약간 계란은 풀어주고 야채들은 적당한 크기로 잘라주세요\\n치킨스톡 육수에 커리를 풀어주고\\n냉동새우는 자연해동해서 살짝 데쳐주세요 달군 팬에 고추기름을 두르고 새우를 볶아주기\\n시작해요.. 살짝~ 새우가 어느 정도 볶아지면 준비해놓은\\n야채도 같이 볶아주고\\n당근이 살짝 익어가면 풀어놓은 카레도 넣어주세요\\n\\n부드러움 속에 약간의 매콤함이 좋아서 \\n고추기름으로 볶아주었는데요\\n아이들을 위해 준비한다면 보통 오일을 사용하는 것이\\n좋을 거 같아요 카레 국물이 끓어오를 즘 코코넛 밀크도 넣어주고\\n풀어주세요 코코넛밀크도 녹고 끓어오르면\\n풀어놓은 계란도 넣어줍니다\\n계란이 들어가면 약불을 유지하다가\\n바로 불을 꺼주세요\\n남은 잔열에서 자연스럽게 반숙으로 익어야\\n보드라움을 최대한 살릴 수 있거든요 새우요리를 좋아해서 자주 하지만\\n코코넛밀크와 계란 그리고 카레의 조화가\\n기대 이상이에요\\n\\n고슬고슬 막 지어진 밥에 얹어준\\n꿍팟퐁커리~♬\\n방금 한 뜨끈한 밥에 올린 카레 자태가\\n너무 사랑스럽네요 >*\', \'태국식 랍스터 카레를 집에서 간편하게 뿟팟퐁 커리 랍스터가 푸짐하게 들어간 태국식카레 뿟팟퐁 커리.\\n집에서 시판 게맛살을 이용해서 간편하게 만들어보세요. 게맛살은 게살맛에 가까운 고급 게맛살을 이용하세요. 게맛살(크래미 등) 170g, 다진돼지고기 100g, 감자 1개, 당근 1/2개, 양배추 1줌, 양파 1개 카레가루 100g, 물 700ml, 달걀 5개 식용유 두른 팬에 돼지고기 다진 걸 볶아주세요. 당근과 양파를 볶음밥보다 크게, 일반 카레보단 작게 썰어서 넣고 볶아주세요.\\n뭐 사이즈는 내맘대로지만 재료들이 소스처럼 자금자금하게 들어가게 하고싶어서 작게썰었어요. 양파와 양배추도 잘게 썰어 넣고 볶아주세요. 물 2컵을 먼저 넣고 끓여주세요.\\n오래 끓이게되면 물이 줄어드니까 맛의 취향따라 보충하셔도 무관합니다. 물 1+1/2컵에 카레가루를 푼 다음 넣고 저어가며 함께 끓여주세요. 재료가 다 익으면 고급 게맛살을 뜯어 넣은 다음 마지막에 달걀을 휘휘 풀어서 한번 휘리릭 섞은 다음 불에서 내립니다.\']','카레  게  태국  새우  커리  코코넛  카레  카레  카레  카레  밀크  코코넛  밀크  계란  당근  약간  양파  약간  약간  인도식카레  계란  커리  고추기름  새우  새우  카레  약간  카레  코코넛  밀크  코코넛밀크  계란  계란  카레  밥  카레  카레  커리  랍스터  뿟팟퐁  커리  게맛살  간편  게맛살  게맛살  이용  당근  양파  팬  당근  양파  양파  양배추  카레가루  다음  재료  고급  게맛살  다음  달걀  다음'),(36,'김밥','[\'냉장고를 털어라 간단 김밥 도시락 김밥 만들려면 이것저것 준비해야할 것 같죠?\\n\\n손쉽고 간단한 재료로도 충분히 맛있게 만들 수 있어요 집에 있는 아무 반찬을 넣어도 맛있는 김밥! [재료] 김밥김, 집반찬 김밥용으로 밥솥에 밥을 한가득 했어요\\n약간 꼬들밥으로 해줬습니다 오늘 컨셉은 집반찬 김밥이기 때문에 \\n집에 있는 것들을 꺼내옵니다\\n\\n단무지의 식감을 살려줄 수 있는\\n김치! 야채를 찾아보니 깻잎과 당근이 있어서 각각 먹기 좋은 사이즈로 채썰어주었어요 김밥용 밥을 지을 땐 참기름 넣어주시는 거 잊지마세요!\\n저는 추가로 식감을 위해 집반찬 멸치를 추가하였습니다 대략 준비가 끝나고 이제 말아볼까요! 밥 위로 재료들을 풍성하게 올려주세요 두툼하게 싸주면 간단 도시락 끝!\', \'갓김치로 만드는 별미 김밥, 초간단 김밥 레시피. 오늘은 하나의 재료로만 만든 초간단 김밥입니다.\\n얼마 전 얻어온 갓김치만 사용하여 맛있는 갓김치김밥이\\n만들어졌습니다. 재료는 하나지만 열 재료 안 부러운 \\n갓김치 김밥이 탄생됩니다. 한 끼 식사로 손색이 없네요. 김은 너무 얇지 않은 김밥용 김을 사용하면 좋습니다.\\n갓김치가 간이 있으니 밥에 소금은 넣지 않습니다.\\n [재료] 밥 3~4공기, 김 4장, 갓김치 6~8줄기, 참기름 약간, 통깨 약간 김밥용 김은 약간 두꺼운 걸로 사용해 주세요. 김밥 말다 터지는 수가 있습니다. 둘이 먹을 거니 4장 정도 준비합니다. 석쇠로 바로 불에 구워도 되고 프라이팬에 넣고 구워도 좋습니다. 프라이팬에서 구우면 빨리 타지 않아요. 밥을 준비합니다. 2인분 정도라 3~4 공기면 적당할 듯합니다. 김밥은 4개 말을 겁니다. 참기름 약간, 통깨 약간 넣어 주세요. 소금은 갓김치가 간이 되어 있으니 넣지 않아도 됩니다. 밥알이 으깨지지 않게 잘 섞어 주세요. 갓김치를 준비합니다. 김밥에 길게 넣을 거니 자르지 말고 그대로 두세요. 김발 놓고, 밥 1공기 (조금 적어도 됩니다) 분량을 올리고 골고루 잘 펴주세요. 김 길이와 비슷하게 갓김치를 잘라서 1/3 정도 지점에 올려주세요. 갓김치의 간 세기에 따라 더 넣으셔도 됩니다. 갓김치 간을 보고 너무 짜지 않게 조절해 주세요. 잘 말아 주시면 됩니다. 재료가 하나밖에 안 들어가서 마는 게 그리 어렵지는 않을 거예요. 잘 썰어 주면 끝입니다. 그리 어렵지 않게 초간단 스피드로 갓김치 김밥이 완성되었습니다. 모양은 예쁘지 않지만 맛은 최고입니다. 김치만 넣고 만드는 김치김밥과는 또 다른 깊은 맛이 있습니다.\']','김밥  김밥  준비  것  재료  수  김밥  재료  집반찬  김밥용  밥  집반찬  김밥  수  김밥용  밥  참기름  것  식감  집반찬  추가  준비  밥  도시락  김밥  초간단  김밥  오늘  재료  초간단  김밥  갓김치  사용  재료  재료  김밥  김  김밥용  김  사용  \\\\갓김치  간  밥  재료  밥  갓김치  참기름  김밥용  김  사용  김밥  수  것  정도  준비  프라이팬  밥  준비  정도  김밥  참기름  약간  통깨  소금  갓김치  간  갓김치  준비  김밥  것  밥  갓김치  정도  갓김치  갓김치  간  재료  것  끝  초간단  갓김치  김밥  맛'),(37,'떡볶이','[\'떡볶이 맛있게 쉽고 간단하게 만드는 방법 칠리 떡복이^^ 대한민국 누구나 좋아하는 떡볶이 조금 색다르지만 맛있게 만드는 방법으로 이보다 더 쉽고 간단할 수 없는 떡볶이 레시피랍니다. \\n쉽고 간단하지만 맛도 완전 환상이랍니다. \\n\\n달달함에 살짝 매콤한 맛에 바삭함까지 더하니 아이들이 엄지 손가락을 번쩍 들어올려주더군요.\\n 떡볶이 소스 국물이 생기지 않도록 물 양을 늘이지 마세요 ~~ 바삭바삭함이 살아있어요. [재료] 떡볶이떡 1봉지(1봉지 350g), 물 1국자, 식용유 1국자\\n[양념] 칠리소스 3큰술 마른 궁중팬에 불을 켜서 떡볶이 떡을 올리고 잠시 구우다 물을 부워 끓여 떡이 부드러워지면 식용유를 넣어 떡을 바삭하게 구워지면 칠리소스를 넣었어요. 빨간 칠리소스 잘 버무려서\', \'맛짱은 가끔, 떡볶이와 오뎅이 먹고 싶을때가 있어요. 그런걸 보면... 맛짱은 아직 덜 컸나봐요?^^;; 주말에 아이와 둘이있어 우리 점심에 떡볶이 만들어 먹을까? 하였더니... 그러지 않아도 오랜만에 떡볶이가 먹고 싶었었는데 잘 되었다며 좋아 하네요. 그래서 아이와 의기투합하여 떡볶이를 맛있게 만들어 먹었답니다. 그런데 울 님들은 떡볶이 어떻게 만들어 드시나요? 맛짱은 여러가지로 만들어 먹어요. 평범하게 떡볶이를 만들어 먹지만, 라면이나 만두등을 넣어서 먹기도 하고, 피자치즈를 넣어 먹기도 하는데 떡볶이와 함께 먹는것이 있어요~ㅎ 그것은.. 따뜻한 밥이예요. 혹시, 떡볶이를 먹을때 밥과 함께 드셔 보셨나요? 떡볶이와 함께 먹는 밥! 정말 맛있어요. 그리고.. 너무 잘 어울린다는거~, 그거~~ 이해가 가시나요? ^^;; 이긍.. 적다보니.. 무슨말을 적었는지.. ㅎ 어찌까나 오늘 올리는 떡볶이는 밥과 잘 어울리는 떡볶음과 비벼먹는 떡볶이랍니다. ㅋ 그리 거창한 조리는 아니지만 밥과 먹는 떡볶이를 만들어 봅니다.◈ 밥과 먹는 떡볶음과 비벼먹는 떡볶이 ◈[재 료] 떡볶이 350그램, 양파 1개, 양배추 양파보다 약간 많은양, 어묵 2장, 설탕, 미강유 [양념장] 고추장 1숟가락, 간장 1숟가락반, 다진마늘 3분의2숟가락, 다진파 1숟가락, 물엿1숟가락유기농 옥수수캔, 멸치다시물 1컵- 밥과 비벼 먹는 떡볶이용 육수 * 떡볶이는 요즘 퓨전으로 만들어 시판하는 치즈떡볶이와 일반 떡볶이를 반반 섞었어요.[참고]♪ 국물 요리와 반찬이 맛있어 지는 육수 3가지 팬에 기름을 두루고 떡볶이를 넣어 볶다가 양파, 양배추, 어묵을 넣고 양파가 숨이 죽을 정도로 볶다가 양념장을 넣고 섞어가며 잘 볶아준다. 쨔잔~ㅎ 덜 달다고 하시는분은 설탕으로 단맛을 조절하여 주시면 되고, 마무리는 깨소금을 솔솔 뿌리시고, 참기름은 옵션이예요. 완성된 떡볶음이랍니다. 야채는 아작아작 떡볶이는 쫄깃쫄깃~매콤하고 쫄깃하게 잘 볶아진 떡볶음이랍니다. ㄸㅓㄲ볶음의 장점은 국물 떡볶이와는 조금 다르게 쫄깃하고 고소하답니다. 떡볶음을 드실때 밥에 올려 드셔보세요. 을매나 잘 어울린다고요.^^ 다음은 국물이 자작하게 있는 국물 떡볶이예요. 일반 떡볶이와 별다른 것이 없는데 ..맛짱이 호들갑을 떨고 있지요? ㅋ 그렇치만, 떡볶이를 아주 쉽고 맛있게 만들 수 있는 방법이랍니다.* 국물 떡볶이도 떡과 야채를 볶다가 국물을 넣으면 떡이 졸깃하고 야채맛도 한층 좋아진답니다. 조리방법은 앞에 떡볶음과 동일하고 다 볶아진 떡복음에 깨소금을 넣어 마무리 하기전에 육수를 넣어 뽀글뽀글 끓이다가 불을 끄고 유기농 캔 옥수수를 넣어주면 됩니다. 여기서도 참기름은 옵션이예요. 떡볶이 양념의 맛이 제대로 느끼면 먹으려고 참기름을 넣지 않는답니다. 퓨전 떡볶이를 자르면 치즈가 쭈욱~ㅎ 이대로 국물까지 떠서 밥에 쓱쓱 비벼 먹으면 된답니다.완성된 떡볶이는 밥에 올려 먹거나 떡볶이를 먹은뒤에 남은 국물에 밥을 볶아 먹어도 좋답니다.밥을 볶을때는 참기름이나 들기름을 넣고, 약간에 야채를 곁들이면 볶으면 볶음밥을 더욱 맛있게 드실 수 있답니다. 오늘 맛짱네는.. 볶은밥 패스~! 두가지 중에 어느것이 맛이 있냐는 질문을 하지마세요~ㅋ 전.. 어느 한가지를 선택을 할 수가 없답니다~^^;;[참고]♬ 뜨끈한 국물이 생각나는 날, 어묵꼬치가 짱! 중간중간에 톡톡 터지는 옥수수는 매운맛 속에 고소한 묘미를 느끼게 해 준답니다. 울 님들도 기회가 되면 떡볶이와 밥을 함께 드셔보세요. 밥과도 잘 어우러지는 떡볶음과 비벼먹는 떡볶이랍니다.^^\']','떡볶이  간단  방법  떡볶이  방법  간단  수  떡볶이  간단  맛  맛  떡볶이  국물  칠리소스  떡볶이  떡  떡  식용유  떡  칠리소스  칠리소스  떡볶이  때  맛짱  떡볶이  떡볶이  아이  떡볶이  떡볶이  맛짱  떡볶이  떡볶이  밥  떡볶이  때  밥  떡볶이  밥  떡볶이  밥  떡볶음  비벼먹  떡볶이  밥  떡볶이  밥  떡볶음  비벼먹  떡볶이  떡볶이  양파  양파  양  밥  육수  떡볶이  떡볶이  국물  육수  떡볶이  양파  양배추  어묵  양파  양념장  설탕  참기름  야채  떡볶이  떡볶음이랍니  국물  떡볶이  쫄깃하  떡볶음  때  밥  국물  국물  떡볶이  일반  떡볶이  것  맛짱    떡볶이  수  방법  국물  떡볶이  떡  야채  국물  떡  떡볶음  깨소금  마무리  육수  불  참기름  옵션  떡볶이  맛  참기름  퓨전  떡볶이  국물  밥  완성  떡볶이  밥  떡볶이  국물  밥  밥  때  참기름  야채  수  오늘  맛  수  국물  옥수수  님  떡볶이  밥  밥  떡볶음  비벼먹  떡볶이'),(38,'라면','[\'[편의점을털어라]차슈딘나멘 # 사리곰탕으로 끓여본 이색 라면 냉동실에 물만두, 돼지고기가 잠자고 있다면 사리곰탕 이색 라면으로 변신해 보아요.~ 구수한 사리곰탕국물에 만두 조화가 좋았어요.~ 삼겹살이 곁들여져 일본라멘 돈코츠 느낌입니다.ㅎ [재료] 사리곰탕라면 1개, 간 마늘 1T, 통삼겹살(또는 편육) 3~4점, 물만두 5~6개, 계란(옵션) 1개, 부추 또는 쪽파 한 줌 진국의 맛! 농심 사리곰탕 면ㅎㅎ(홍보아님) 라면 1개 물 양 = 550ml 인데 + 1/2종이컵 더 넣어줬어요.\\n끓는물에 자른 통삼겹과 물만두를 넣고 끓여줍니다. \\n돼지고기 잡내 잡기 위해 간 마늘 1/2T 넣어주세요.(사진보다 더 넣었음) 라면 건더기, 스프, 면을 넣고 3분간 끓여줍니다. 익은 통삼겹살은 건져서 김 굽는 석쇠위에 올려 가스불에 구워줍니다.\\n(토치 사용가능) 라면위에 삼겹살, 삶은계란을 올려주고 부추 또는 쪽파를 뿌려주세요.~\\n그냥 라면 끓이는것 만큼 쉽지요.~\', \'돈까스 라멘 돈까스 라멘 \\n한 입먹고 반해서 두번 세번~\\n\\nby. 편한식사 [재료] 신라면, 돈까스, 대파, 뜨거운물 봉지를 뜯어 라면스프를 부어주세요. 라면스프 위에 돈까스를 올려주세요. 대파를 썰어 올려주고 뜨거운 물을 부어주세요. 뚜껑을 덮고 전자레인지에 2분 돌려주세요. 전자레인지에 2분 돌린후 잘 섞어주세요.\']','사리곰탕  라  물만두  사리곰탕  이색  사리곰탕  물만두  사리곰탕  라  물만두  마늘  라  삼겹살  부추  쪽파  라  라멘  재료  라면스프  돈까스  대파  전자레인지'),(39,'오므라이스','[\' 사과와 치즈가 들어간 오믈렛 피망과 양파, 햄이 들어간 오믈렛\', \'오므라이스 이이지마 나미 레시피를 참고해서 만든 오므라이스에요.\\n오믈렛은 부드럽게 우유를 조금 넣고,\\n소스는 돈가스나 스테이크소스에 케찹을 섞어서 사용해요.\\n은근히 손이 많이가고 어려운 요리지만,\\n차려놓으면 뿌듯한 한접시랍니다. - 피망은 살짝만 볶도록 나중에 넣기\\n- 불을 끄고 밥과 케찹을 섞은 다음에 다시 불을 켜서 볶아주기\\n- 달걀물에 우유를 넣으면 부드러운 오믈렛을 만들 수 있어요.\\n- 스테이크소스와 케챱을 섞을 땐, 너무 짜지 않도록 적당량 섞어서 사용해보세요.\\n [재료] 양파 1/8개, 피망 1/8개, 햄 약간, 달걀 2개, 우유 1큰술, 밥 1공기(200g), 식용유 또는 버터 약간, 소금과 후추 약간, 케찹 2큰술, 돈가스소스 또는 스테이크소스 1큰술 양파, 피망, 햄은 잘게 썰어준비해주세요. 달걀 2개에 우유 1큰술을 섞어주세요. 달궈진 프라이팬에 식용유를 살짝 두르고, 양파와 햄을 먼저 볶아줍니다. 양파가 투명하게 거의 다 익으면 피망을 넣고 살짝 볶아줍니다 불을 끄고 남을 열을 이용해 볶은 야채에 케찹 1큰술을 넣고 섞어줍니다. 밥 1공기를 넣고 골고루 꼼꼼하게 잘 섞어주세요. 식용유를 살짝 두르고, 후추와 소금을 약간씩 넣어준 뒤 다시 불을 켜고 골고루 섞듯이 볶아줍니다. 사용한 프라이팬을 씻어준 뒤 사용하거나 새로운 프라이팬에 버터약간을 쓰거나, 식용유를 넣고 팬을 달궈줍니다. 우유를 섞은 달걀물을 넣고 두세번 휘저어줍니다. 달걀이 단단해지면 휘젓지 않고 불을 꺼준 뒤에 볶음밥을 한쪽으로 잘 담아 지단으로 밥을 덮어주고 그릇에 굴리듯 담아줍니다. 스테이크소스와 케찹은 1:1 또는 원하는 비율로 섞어서 오므라이스 위에 뿌려주면 완성!!\']','피망  양파  햄  우유  스테이크소스  케찹  사용  피망  불  밥  케찹  불  우유  오믈렛  스테이크소스  사용  양파  피망  햄  약간  달걀  우유  밥  식용유  약간  약간  케찹  스테이크소스  양파  피망  햄  달걀  우유  프라이팬  식용유  양파  햄  양파  피망  불  케찹  밥  식용유  후추  소금  뒤  불  사용  프라이팬  뒤  사용  프라이팬  식용유  우유  달걀물  달걀  불  뒤  밥  스테이크소스  케찹  오므라이스'),(40,'컵밥','[\'노량진 컵밥 만들기 노량진까지 걸어갈 수 있던 동네에 살던 시절\\n신랑이랑 산책하러 노량진에 갔다가 자주 먹었던 컵밥입니다^^\\n노량진 컵밥 거리에서 컵밥을 시작으로 쌀국수까지 뷔페 온 거처럼 길거리 음식을 먹곤 했어요 ㅋㅋ\\n추억이 새록새록 한 노량진 컵밥 레시피에요~\\n가끔 자극적인 게먹고 싶을 때 추천합니다^^ 노량진 컵밥을 실제로 먹어보면 좀 질퍽한 느낌이랄까요?\\n그 느낌 그대로 느끼하게 드시고 싶다면 \\n캔 옥수수 국물과 마요네즈를 취향대로 추가하시면 됩니다~^^ [재료] 밥 2공기, 숙주 1움큼, 캔 옥수수 4큰 술, 스팸, 비엔나햄, 김치, 계란 2, 김\\n[양념] 고추장 1큰 술, 설탕 1/2큰 술, 마요네즈 1+1/2큰 술, 캔 옥수수 국물, 식용유 3큰 술, 후추 가끔은 자극적인 게 먹고 싶죠~\\n노량진 컵밥 레시피 입니다^^ 숙주 나물을 시작으로 모든 재료를 볶아주세요~ 준비된 재료를 그릇에 담아주세요~ 돈까스 소스와 김을 뿌려주면 완성입니다\', \'컵밥 간단하고 간편하게 즐기는 \\n컵밥 레시피!\\n맛있는건 다 들어가 있어서 놓칠 수 없어~!!\\n\\nby. 편한식사 [재료] 소세지 8개, 계란 1개, 햇반 1개, 스위트콘 2T, 치즈 1장\\n[소스] 간장 1T, 고추장 1T, 설탕 0.5T, 케찹 1T 팬에 기름을 두르고 소시지를 볶아주세요. 팬에 기름을 두르고 계란후라이를 만들어주세요. 볼에 간장, 고추장, 설탕, 케찹을 넣고 소스를 만들어주세요. 전자레인지에 햇반을 2분 돌려주세요. 그릇에 밥을 담고 치즈를 올려주세요. 소시지를 올려주세요. 스위트콘을 올려주세요. 계란후라이를 올리고 소스를 올리면 완성~!!\']','컵밥  노량진  컵밥  컵밥  노량진  컵밥  노량진  컵밥  옥수수  재료  옥수수  술  고추장  술  설탕  술  마요네즈  술  옥수수  국물  술  자극적  것  컵밥  숙주  시작  재료  재료  소스  레시피  수  재료  계란  고추장  설탕  팬  간장  고추장  설탕  케찹  소스  햇반  그릇  밥  치즈  소시지  스위트콘  계란후라이  소스  완성'),(41,'브리또','[\'브리또 만들기 삼겹살과 단무지의 조합 좋아요 :) 브리또는 또띠아 안에 어떤 재료를 넣느냐에 따라서\\n다양한 종류의 브리또를 만들 수 있어요!\\n저는 한 끼 식사로도 거뜬하게 해결할 수 있도록\\n밥이 들어간 브리또를 만들었어요. [재료] 밥 2공기, 대패 삼겹살 적당량, 또띠아 3장, 간장 2숟갈, 참기름 1숟갈, 다진 마늘 1스푼, 단무지 적당량, 양파 약간, 대파 적당량 저는 삼겹살과 단무지가 들어간 밥브리또를 만들 거예요!\\n브리또를 만들기 위해 필요한 재료들을 알려드릴게요. 먼저 단무지와 양파를 작은 크기로 썰어서 준비해주세요. 달궈진 프라이팬에 식용유를 적당량 넣어주세요. 대패 삼겹살을 달궈진 프라이팬에 올려 구워주세요.\\n대패 삼겹살은 어느 정도 녹이고 나서 프라이팬에 구워주시는게 좋아요!\\n저는 그냥 바로 프라이팬에 올려서 구우면서 녹여줄게요. 서서히 녹고 있는 대패 삼겹살!\\n저처럼 냉동실에 대패 삼겹살이 오래 보관되어 있었으면\\n약한 불을 켠 상태로 프라이팬에서 천천히 구워주시면 잘 녹아요! 대패 삼겹살은 얇아서 빨리 구워진다는 점이 좋은 것 같아요! 대패 삼겹살이 어느 정도 익었으면 가위로 대패 삼겹살을 잘라주세요.\\n너무 잘게 자르진 마시고 브리또에 넣을 적당한 크기로 \\n잘라주시면 됩니다! 대패 삼겹살에서 기름이 너무 많이 나오면 키친타올로 닦아주세요. 썰어놓은 대파를 넣어주세요. 다진 마늘도 1스푼 넣어줍니다. 양파도 넣어주세요! 골고루 잘 섞어줍니다.\\n야채와 함께 대패 삼겹살이 잘 구워졌습니다! 브리또에 들어갈 밥을 만들 거예요.\\n밥 2공기를 넣어주세요. 밥을 잘 풀어주세요.\\n그리고 간장 1큰술을 넣어 함께 잘 볶아줍니다. 간을 봤는데 약간 삼삼해서 간장 1큰술을 추가로 더 넣어주었어요!\\n다시 골고루 잘 섞어주세요! 간장 2큰술을 넣으니까 밥이 딱 맛있게 잘 되었어요!\\n고소한 맛을 내기 위해 참기름도 1큰술 넣어주세요. 골고루 잘 섞어주시면 브리또에 들어갈 삼겹살 밥이 완성됐습니다! 이제 브리또를 만들기 위한 세팅을 해주시구요. 또띠아 한 장을 올리고~ 그 위에 삼겹살 밥을 또띠아 가운데에 올려주세요. 오늘 브리또의 핵심!!\\n단무지를 송송 올려줍니다. 그리고 양옆의 또띠아를 포개서 브리또 모양을 만들어주시면 삼겹살과 단무지의 조합으로 만들어진 브리또가 완성입니다. 시중에서 판매하는 브리또는 하얀 밥이 들어간 브리또를 \\n많이 판매하는 편인데요.\\n저는 잡곡밥이 들어간 브리또라 색감이 또띠아와 더 잘 어울리는 것 같아요! 브리또를 반으로 잘라서 먹어봤어요!\\n단무지가 약간 새콤달콤한 맛이 있잖아요!\\n그래서 그런지 대패 삼겹살의 기름진 맛을 싹! 잡아줘서 맛있더라구요 ♥\\n단무지의 아삭아삭한 식감도 정말 좋아요!\\n하나만 먹어도 든든한 한끼식사가 되서 정말 좋습니다!\', \'간단간식 오리고기 브리또 또띠아에 오리고기와 다양한 야채들을 넣고 돌돌말아주면 간단하면서도 든든한 간식이된답니다. [재료] 훈제오리고기 1줌, 양파 1/5개, 양상추 1장, 치커리 1개, 양배추 1장, 토마토 1/2개, 또띠아 1장, 옥수수콘 1스푼, 머스타드소스 1/2t, 마요네즈 1/2t, 칠리소스 적당량, 치커리 1개 양상추는 깨끗이 다듬고 양파, 토마토, 양배추를 채썰어주세요. 또띠아는 살짝 구워주세요. 훈제오리고기는 전자레인지에 30초간 데워주세요. 부추와 함께 볶아주셔도 좋아요. 유산지위에 또띠아를 올리고 위에 양상추, 양배추, 양파를 올려주세요. 옥수수콘 1스푼에 머스타드 1/2t, 마요네즈1/2t를 섞어 올려주세요. 훈제오리고기를 올려주세요. 칠리소스를 뿌리고 토마토, 치커리를 올려주세요. 또띠아를 돌돌 말아주세요. 먹기 좋게 반으로 썰면 오리고기 브리또가 완성이되요.\']','삼겹살  단무지  브리또  또띠아  재료  브리또  \\\\저  수  브리또  재료  밥  대패  삼겹살  적당량  또띠아  간장  단무지  적당량  양파  적당량  삼겹살  단무지  단무지  양파  프라이팬  적당량  대패  삼겹살  프라이팬  삼겹살  프라이팬  \\\\저  프라이팬  대패  삼겹살  대패  삼겹살  프라이팬  대패  삼겹살  대패  삼겹살  정도  대패  삼겹살  브리또  대패  삼겹살  대파  마늘  양파  대패  삼겹살  브리또  밥  거예요  밥  간장  간장  간장  밥  맛  참기름  브리또  삼겹살  밥  브리또  또띠아  삼겹살  밥  또띠아  브리또  또띠아  브리또  삼겹살  단무지  조합  브리또  완성  브리또  밥  브리또  판매  \\\\저  브리또  또띠아  것  브리또  \\\\단무지  맛  대패  삼겹살  맛  오리고기  브리또  또띠아  오리고기  든든  재료  훈제오리고기  양파  양상추  치커리  양배추  토마토  또띠아        적당량  치커리  양상추  양파  토마토  양배추  또띠아  훈제오리고기  또띠아  위  양상추  양배추  양파  옥수수콘     훈제오리고기  칠리소스  토마토  치커리  또띠아  반  오리고기  브리또'),(42,'햄버거','[\'미니 햄버거 잼베이스 스팸어니언 버거 ㅋㅋ 하하하 만들기 오늘저녁은 좋은 동료의 도움받을 일이 있어서 세미야근을 했어요.♡ 가볍게 ^^ 퇴근시간전에 명랑한 쥬시를 먹었기에... 가볍게 만들어 먹는걸로.. [재료] 모닝빵, 양파, 후추, 스팸, 딸기잼 얇게 썰은 스팸 굽기 후추 찹찹찹 약간 어니언을 볶아줬음 에도 매웠어요 더 볶던지 안 매운 양파를 쓰는걸로.. 칼로 슥삭슥삭 버거 미니언즈 ♡\', \'만능 햄버거 패티부터 햄버거 만들기(소풍도시락으로도 손색없어요) 재료를 하나씩 사놓다보니 햄버거 만들기가 딱이더라고요. 패티 반죽으로 모양만 다르게 하면 미트볼, 미니 버거, 완자,난자완스 등 다양한 요리를 할 수 있어 유용하니 냉동해놓고 언제든 해먹을 수 있어 좋아요. 하나먹어도 배부른 햄버거라 소풍도시락으로도 딱이네요.^^ 1. 패티 재료 중 돈가스 소스 대신 우스터소스 가능 홀그레인 머스터드 생략 가능해요.\\n2. 참고로 전 패티 110g 씩 계량해서 모양을 만들었어요. 패티 기준 10인분 정도 나오는 양이에요.\\n3. 햄버거 재료는 2개 분량이에요. [패티 재료] 돼지고기 다짐육 300g, 소고기 다짐육 500g, 양파 2개, 다진마늘 2큰술, 빵가루 4큰술, 돈가스소스 4큰술, 홀그레인 머스터드 1큰술, 후춧가루 톡톡톡톡 4번\\n[햄버거 재료] 패티 2장, 햄버거빵 2개, 양파 1/2개, 토마토 1/2개, 상추 4장, 베이컨 2줄, 슬라이스치즈 2장, 마요네즈 두큰술, 돈가스 소스 두큰술 패티 재료 * 햄버거 패티 만들기\\n- 양파 잘게 다지기\\n- 팬에 기름 조금 두른 후 분량 외 소금 4꼬집 넣어 볶기 수분 없어질 때까지 볶으면 돼요. - 볼에 고기와 나머지 재료 몽땅 넣어 치대기 끈적일 때까지 치대주세요. - 원하는 크기와 두께로 모양 만들기\\nTip. 구울 경우 수축이 되면서 가운데만 봉긋 올라오게 돼요. 방지하기 위해가운데를 움푹 들어가게 눌러주세요. 전 세 가지 형태로 만들어줬는데요.\\n패티는 햄버거, 함박스테이크, 미니는 미니 버거, 난자완스, 고기전 볼은 미트볼, 전골 등에 쓰일 수 있게 만들어줬어요. 필요한 용도로 만들어 용기에 넣어 냉동 보관하면서 사용하면 돼요. 햄버거 만들기\\n재료 준비 만든 패티 바로 사용해요. - 햄버거 빵 반자른 후 마른 팬에 굽기 - 베이컨 반 자른 후 노릇하게 굽기 - 양파 채 썬 후 소금 한 꼬집 넣어 수분 없어질 때까지 볶기\\n- 토마토 얇게 4장 슬라이스하기 기호에 맞게 두툼하게 슬라이스해도 상관없어요. - 빵 양쪽에 마요네즈 한큰술 바르기\\n- 상추 2장, 토마토 2개 올리기\\n- 볶음 양파 올리기\\n- 베이컨 2개 올리고\\n- 돈가스 소스 한큰술 바르기 - 기름 조금 두른 팬에 패티 굽기 전 패티가 얇아서 뚜껑을 열고 구웠지만 두껍게 만들었을 경우 중불에서 굽다 뚜껑 덮고 약불에서 구워주세요. - 패티가 다 익으면 슬라이스 치즈 한장 올려 약간 녹이기 - 치즈가 흘러내리면 버거에 올리기\\n- 나머지 빵 한쪽 덮어주기 햄버거 완성~!\']','햄버거  버거  재료  양파  후추  양파  버거  햄버거  햄버거  재료  햄버거  패티  모양  수  수  햄버거  소풍도시락  패티  재료  돈가스  소스  가능  전  패티  모양  패티  햄버거  재료  재료  다짐육  양파  홀그레  머스터드  재료  패티  양파  토마토  베이컨  돈가스  소스  패티  재료  햄버거  패티  양파  팬  후  분량  때  재료  때  치  모양  전  햄버거  버거   볼  미트볼  등  수  냉동  햄버거  패티  사용  햄버거  후  팬  베이컨  후  양파  후  소금  수분  때  토마토  마요네즈  상추  토마토  올리기\\\\-  양파  올리기\\\\-  베이컨  돈가스  소스  한큰술  팬  패티  전  패티  경우  뚜껑  패티  치즈  버거  올리기\\\\-  나머지  빵  햄버거'),(43,'샌드위치','[\'수제 인기가요 샌드위치 만들기! (or 피크닉 샌드위치) \\n요즘 그렇게 핫하다는 GS 편의점 아이돌 샌드위치를 사서 먹어봤는데 정말 맛있더라고요ㅋㅋ 그래서 오늘은 집에서 직접 만들어봤어요!! 피크닉 샌드위치로 좋을 거 같아요^^ 저는 빵을 파리바게트에서 두꺼운 걸로 사 왔는데 최대한 얇은 걸로 만드시는 게 좋을 거 같아요!! [재료] 식빵 8장\\n[1단] 계란 1개, 마요네즈 4T\\n[2단] 딸기쨈 2T\\n[3단] 크래미 1개, 양배추 50g, 양파 1/4개, 피클 6개, 마요네즈 3T, 케쳡 1T 먼저 계란은 15분 정도 삶아주세요~ 삶아준 계란에는 마요네즈만 넣어주세요. (1단에 들어갈 재료 완성!!) 양배추, 양파, 피클을 잘게 다져주세요. 크래미 1개를 적당한 크기로 잘라 케요네즈 소스에 버무려 주세요. (3단에 들어갈 재료 완성!!) 안에 들어갈 속재료 완성 :) 1단 : 계란, 2단 : 딸기잼, 3단 : 크래미 순서대로 채워줍니다. 예쁘게 담아주기만 하면 완성.\', \'참치피클 샌드위치 만들기 간단한 아침식사 또는 간식으로 간단하게 해결할수있는\\n참치오이피클 샌드위치 입니다\\n야유회 나갈때 김밥과 샌드위치 함께 준비하시면\\n눈과입이 더욱더 행복해 합니다 주말야유회때 준비했는데 인기 최고 주인공이\\n되었던 참치샌드위치 입니다\\n커피와 함께하면 좋아요^^\\n 재료들을 준비 하시고요 참치는 채에 받쳐서 물기를 제거\\n하여 주세요 양파는 채썰어서 잘게 다진후\\n물기를 꼭 짜 주시고 오이피클도 잘게 다져서 물기를 꼭\\n짜 주세요\\n피클을 많이넣으면 아삭하게 씹히는\\n맛이 더 좋습니다 삶으계란도 잘게 썰어 주시고요 옥수수캔은 채에 받쳐서 물기를\\n빼 주시면 되겠습니다 준비하신 재료들을 볼에 모두\\n넣고 후추 약간 뿌린다음\\n마요네즈를 넣으면서 골고루\\n잘 섞어 주세요\\n*참고로 오뚜기 골드 마요네즈가\\n 더 고소 해요 나무주걱으로 골고루 섞어 주시면\\n샌드위치속이 완성됩니다\\n이 정도양이면 식빵 20장 정도\\n발라지게 됩니다\\n샌드위치속이 남으면 냉장보관\\n하셔도 일주일 정도는 괜찮습니다 식빵 테두리는 잘라내신후 맛있게\\n만든 속 재료를 듬뿍넣어서 잘 눌러\\n주신다음 예쁘게 썰어주시면\\n영양이 가득한 아침식사 또는 간식이 완성 됩니다\']','샌드위치  샌드위치  샌드위치  피크닉  샌드위치  것  걸  것  것  재료  식빵  계란  마요네즈  크래미  양파  마요네즈  계란  계란  마요네즈  재료  완성  양배추  양파  피클  크래미  재료  완성  완성  계란  크래미  완성  샌드위치  샌드위치  샌드위치  준비  준비  양파  채  준비  재료들  식빵  정도  식빵  재료  아침식사  식  완성'),(44,'치킨','[\'영양간식 호두를 넣은 치킨 너겟 아이들 어릴때 만들어 줬던 닭가슴살 전이에요. 일명 치킨 너겟을 영양가 있게 호두를 잘게 다져 만들었어요. 꼭 호두가 아니어도 땅콩이나 다른 견과류도 괜찮습니다.\\n닭가슴살도 갈아서 만드니까 하나도 퍽퍽하지 않고 호두하고도 \\n너무 잘 어울려요. [재료] 닭가슴살 3조각, 호두 40g, 양파 1/2, 대파 1줄, 간장 3T, 맛술 2T, 간마늘 2T, 소금 1t, 후추 닭가슴살은 깨끗이 씻어 토막내 분쇄기에 갈아 주세요. 호두는 비닐에 넣어 고기 망치로 다져 줍니다. 단.입자있게 다져 주세요. 볼에 닭가슴살,다진양파,잘게썬 대파,간마늘,다진 호두를 넣어 줍니다. 밀가루를 넣어 수저로 뒤적이다 손으로 반죽해 주세요.마지막에 소금과 후추 넣어 더 반죽하면 됩니다. 후라이팬에 한수저씩 떠서 노릇노릇 부쳐주면 완성 됩니다.\', \'한입에 쏙쏙 :: 야채 쏙쏙 꼬마 치킨 바삭바삭 소리마저 맛있는 치킨은 어른과 아이들 모두에게 최고의 간식이죠.\\n통조림 옥수수로 톡톡 터지는 식감을 살리고, 채소를 듬뿍 넣어 영양가도 높인 야채 쏙쏙 꼬마 치킨 이랍니다. [재료] 닭 다리 살 600g, 통조림 옥수수 100g, 당근 1개, 빨강 파프리카 1개, 초록 파프리카 1개, 양파 1/2개, 빵가루 3컵, 식용유 5컵\\n[밑간] 소금 약간, 후춧가루 약간\\n[반죽] 전분가루 2컵, 튀김가루 2컵, 소금 약간, 후춧가루 약간 닭 다리 살은 소금과 후춧가루로 밑간을 한 뒤 한 입 크기로 썰어주세요. 통조림 옥수수는 체에 밭쳐 물기를 빼주세요. 당근, 빨강 파프리카, 초록 파프리카, 양파는 잘게 다져주세요. 볼에 밑간 한 닭 다리 살, 당근, 파프리카, 양파, 통조림 옥수수와 반죽재료를 모두 넣고 반죽해주세요. 반죽을 동그랗게 빚은 뒤 빵가루를 고루 묻혀주세요. 170도로 예열한 식용유에 노릇하게 튀긴 뒤 키친타월에 밭쳐 기름기를 빼주면 완성!\']','호두  닭가슴살  너겟  호두  호두  호두  닭가슴살  호두  양파  소금  닭가슴살  호두  호두  반죽  소금  후추  반죽  아이들  옥수수  야채  꼬마  재료  닭  다리  살  통조림  옥수수  당근  파프리카  양파  소금  후춧가루  소금  약간  후춧가루  닭  다리  살  소금  후춧가루  뒤  통조림  옥수수  당근  빨강  파프리카   초록  파프리카   양파  볼  밑  닭  다리  살  당근  파프리카   양파  통조림  옥수수  반죽  반죽  뒤  빵가루  식용유  뒤  밭쳐  완성'),(45,'타코','[\'샘킴의 타코 판타지아 -냉장고를 부탁해 187회 냉장고를 부탁해187회\\n방송일 : 2018-07-09\\n동영상출저 :곰TV [재료] 할라페뇨라임원액, 고수, 커민, 라임, 사워크림, 렐리시, 케이퍼, 토마토, 아보카도, 파프리카가루, 틸라피아, 블랙올리브, 샬롯, 토르티야, 루콜라, 양상추, 설탕, 고춧가루, 다진마늘, 간장, 대파, 양파, 청양고추, 소금, 레몬, 올리브오일, 밀가루, 달걀, 후추 핸드블렌더에 할리페뇨라임원액, 고수, 커민, 설탕, 고춧가루, 다진 마늘, 간장, 적당한 크기로 썬 대파를 넣고 간다. 간 재료에 라임즙을 넣는다. 양파를 잘게 썬다. 간 재료에 잘게 썬 양파를 넣고 한 번 더 갈아 할라페뇨고수소스를 만든다. 기름을 두른 그릴팬에 슬라이스한 양파와 청양고추를 굽는다. 굽던 양파와 청양고추, 할라페뇨고수소스에 각각 소금을 더한다. 사워크림에 레몬즙, 렐리시, 다진 케이퍼, 올리브오일, 잘게 썬 양파를 넣고 섞어 사워크림소스를 만든다. 토마토와 양파, 고수를 잘게 썰어 섞는다. 8에 잘게 썬 아보카도를 넣는다. 밀가루에 달걀, 물, 파프리카가루를 넣고 섞어 튀김반죽을 만든다. 틸라피아를 적당한 크기로 썬 뒤, 튀김반죽을 입힌다. 핸드블렌더에 블랙올리브를 넣고 간다. 간 블랙올리브와 구운 양파, 잘게 썬 샬롯, 레몬즙, 소금, 올리브오일, 후추를 섞어 양파절임을 만든다. 튀김반죽을 입힌 틸라피아를 기름에 튀긴다. 틸라피아튀김을 건져낸 뒤, 소금과 커민을 넣고 버무린다. 슬라이스한 토마토를 그릴팬에 굽는다. 구운 청양고추를 적당한 크기로 썬 뒤 토마토, 양파, 고수, 아보카도와 섞는다. 17에 올리브오일, 후추, 레몬즙을 더해 토마토살사를 만든다. 양상추를 잘게 썬다. 마른 팬에 토르티야를 굽는다. 접시에 구운 토마토와 양파절임을 담고, 루콜라를 올린다. 구운 토르티야 위에 토마토살사>틸라피아튀김>사워크림소스>할라페뇨고수소스를 올린다. 타코에 잘게 썬 고수, 양상추를 올린다. 적당한 크기로 썬 라임을 곁들여 마무리한다.\', \'도시락 간단요리 간식 만두피 에그 타코 만두피를 이용해 멕시코 요리 타코 만들기!!\\n아삭아삭한 양배추와 고소한 계란이 들어가 배도 든든 부담스럽지않게 밥대용으로도 먹을 수 있어요.\\n도시락 메뉴로도 추천드려요. 양배추의 아삭한 맛과 건 크렌베리의 달콤한과 고소한 계란이 만나 생각 이상의 맛을 내줘요.\\n그외 집에 있는 다양한 재료들을 활용해 만들어보세요. [재료] 만두피 7개, 삶은계란 3개, 양배추 1줌, 건 크렌베리 1/2줌\\n[타코샐러드 소스] 마요네즈 4스푼, 설탕 1/2스푼, 소금 한꼬집, 후추 약간 삶은 계란은 노른자와 흰자를 분리 후 흰자는 잘게 썰어주세요. 양배추는 채 썬 후 흐르는 물에 씻은 후 물기를 빼주세요. 건 크렌베리를 넣고 마요네즈, 설탕, 소금, 후추를 넣고 잘 섞어주세요. 만두피는 식용유를 살짝 두른 후라이팬에 노릇노릇 구워주세요. 뜨거운 상태에서 반으로 접어 모양을 잡아주세요. 만들어 놓은 샐러드를 구운 만두피 사이에 채워주세요. 다 채워준다면 먹음직스러운 에그 타코가 완성이 되요.\']','코  냉장고  재료  고수  토마토  블랙올리브  양상추  설탕  양파  소금  올리브오  후추  고수  커민   설탕  고춧가루  간장  적당  대파  재료  양파  재료  양파  양파  양파  청양고추   할라페뇨고수소스  소금  레몬즙  렐리시   케이퍼   올리브오  양파  토마토  양파  고수  밀가루  달걀  튀김반죽  적당  뒤  튀김반죽  핸드블렌더  블랙올리브  블랙올리브  양파  샬롯   레몬즙  소금  올리브오  후추  튀김반죽  틸라피아  뒤  소금  슬라이스한  토마토  그릴팬  청양고추  적당  뒤  토마토  양파  고수  아보카도  올리브오  후추  레몬즙  양상추  토마토  양파절  토르티야  코  고수  양상추  적당  만두피  코  만두피  코  양배추  계란  양배추  거  크렌베리  고소한  계란  맛  재료  만두피  양배추  거  크렌베리  설탕  소금  후추  계란  후  자  양배추  후  물  후  거  크렌베리  마요네즈  설탕  소금  후추  만두피  만두피  코'),(46,'갈비찜','[\'#LA갈비찜만들기 #연두순으로만드는 갈비찜 #갈비찜양념 #간단하게만드는갈비찜양념 추석선물오 받아서 아직도 남아 있는 배를 넣고 양파, 생강을 넣어서 갈아서 만든 갈비찜 기본양념이지요. \\n단맛으로 배도 단맛을 주고 양파도 단맛을 주지만 거기에 꿀과 매실액을 넣어 주었지요. \\n간은 양조간장으로 해주고 감칠맛과 마지막 간으로 연두순으로 해주었어요. \\nLA갈비찜에 그래도 들어갈 것은 다 들어간 갈비찜이지요. [재료] LA갈비 12대, 양파 1/2개, 생강 1/2톨, 배 1/4개, 양조간장 3큰술, 연두순 2큰술, 매실액 2큰술, 꿀 2큰술, 다진마늘 2큰술, 표고버섯 7개, 당근 1개, 대추 3개, 깐밤 10개, 대파 1대, 참기름 1큰술, 통깨 1작은술 냉동된 상태였기 때문에 LA갈비는 일단 핏물을 빼 줍니다. 물은 3번정도 갈아 주셔야 합니다. 그래야 연하면서 잡내도 없어지기 때문이지요. 핏물을 빼는 사이에 갈비찜의 양념을 만들어 줍니다. 배, 양파, 생강을 넣어서 갈아 줍니다. 간 양념에 다진마늘을 넣어 줍니다. 그리고 양조간장을 넣어 주시고요. 이것이 기본간이 됩니다. 단맛으로는 매실액과 꿀을 넣어 줍니다. 그리고 후추도 조금 넣어 주시고요. 그리고 감칠맛을 위해서 연두순을 넣어 줍니다. 그럼 감칠맛도 나지만 간도 색없이 깔끔하게 맞춰 줄 수 있지요. 이제 갈비찜의 재료들을 준비합니다. 표고버섯은 씻은 후에 물기를 빼주시고 예쁘게 하기 위해서 열십자로 칼집을 내어서 모양을 만들어 주시고요. 그런데 열십자로 모양을 내고 남은 표고버섯 버리지 마세요. 그냥 갈비찜에 넣어 주셔도 됩니다. 그리고 당근도 동글동글하게 만들어 주시고요. 대추는 원래 말린 대추여야 하는데 추석때에 사용했던 그냥 대추를 넣어 주려고요. 밥은 깐밤으로 준비해 주시고 대파는 어슷어슷하게 썰어서 준비해 놓습니다. 그럼 재료 준비 끝이지요~~~~~ 완전하게 핏물을 빼 준 갈비입니다. 이제 만들어 놓았던 양념을 넣어 주어야겠지요. 준비한 재료들을 모두 투하해 줍니다. 표고버섯도 다 넣어 주시고 밤도 넣어 주시고요. 무지 간단하게 만드는 갈비찜이지요. 여기에 만들어 놓았던 양념장을 부어 줍니다. 그리고 통깨 뿌려 주시고 참기름 한바퀴 돌려 주시고 이 상태로 그대로 냄비에 올려서 끓여 주셔도 되지만 조금 숙성을 시켜 주기 위해서 잠시 냉장고에 30분 정도 넣어 줍니다. 숙성된 재료들에 물 1/2컵을 부어 줍니다. 그리고는 센불에서 팔팔 끓이다가는 끓어오르고 10분이 지나면 약불에서 30분이상 더 끓여 줍니다. 그럼 진하면서도 달콤하고 연한 LA갈비찜이 완성되는 것이죠. 나중에 더 첨가할 것도 없습니다. 푹 끓여낸 연두순을 넣은 LA갈비찜 완성입니다. 밤도 완전하게 양념색이 입혀 지고 당근도 갈색으로 변했지요. 버섯도 폭식폭신해지고요. 통깨를 솔솔 부려서 마무리하시면 되는 것이죠. 여기엔 왠지 청주가 잘 어울릴 것 같네요.\', \'갈비찜 소갈비 800g, 무 8조각, 밤 4개, 당근 1/2개, 대추 3개, 홍고추 1개, 잣 1작은술, 계란지단 약간, 은행 10개 등\\n\\n양념- 진간장 8큰술, 흑설탕 1과1/2큰술, 물엿 1큰술, 다진마늘 1과1/2큰술, 배즙 4큰술, 청주 2큰술,매실청 1큰술,다진양파 3큰술, 후추가루 약간, 멸치육수 1큰술 등\\n\']','갈비찜  배  양파  생강  갈비찜  배  단맛  양파  단맛  매실액  양조간장  감칠맛  연두순  것  갈비찜  갈비  양파  생강  배  양조간장  연두순  매실액  다진마늘  표고버섯  당근  대추  통깨  갈비  핏물  때문  핏물  갈비찜  양념  배  양파  생강  양념  다진마늘  양조간장  단맛  매실액  꿀  감칠맛  연두순  감칠맛  간  갈비찜  재료들  표고버섯  열십자  모양  표고버섯  갈비찜  당근  대추  대추  대추  깐밤  대파  준비해  재료  준비  핏물  갈비  양념  재료들  표고버섯  밤  갈비찜  통깨  참기름  상태  숙성  재료들  갈비찜  것  것  연두순  갈비찜  완성  밤  완전  당근  통깨  것  여기  것  갈비찜  무  밤  당근  대추  다진마늘     청주  약간'),(47,'찜닭','[\'쌍화탕 한병 넣었는데 맛이 고급집니다. 쌍화탕 찜닭 나이가 들어 그런지 한약재 냄새가 참 좋습니다. 늘 해먹던 찜닭 양념에 쌍화탕 한병 넣었는데 맛이 확 달라지네요. 닭 바란내도 잡고 은은하게 나는 한방내음이 참 좋습니다. [재료] 닭 750g, 당면 50g, 식용유 1큰술, 참기름 1큰술, 다진마늘 1큰술, 대파 1대 간장 6큰술, 청주 3큰술, 매실 1큰술, 올리고당 1큰술, 후추 1/2작은술, 쌍화탕 1병, 물 1+1/2컵, 감자 1개, 양파 1/2개, 청양고추 3개 마트에서 잘라진 닭 한팩 750g 을 사와 너덜거리는 기름과 껍질은 떼어 내고 씻어 물기를 빼 주었습니다. \\u200b 당면 50g은 물에 담궈 살짝~이 불려 줍니다. 당면이 부러지지않게 휘어지면 된답니다. 달군 팬에 식용유 1큰술, 참기름 1큰술을 두르고 다진마늘 1큰술, 대파 1대 흰부분을 다져 넣고 한번 볶아 준 후.... 준비한 닭을 넣고 볶아 줍니다. 닭 겉면이 익도록 골고루 볶아 줍니다. \\u200b 간장 6큰술,청주 3큰술, 매실 1큰술, 올리고당 1큰술,후추 1/2작은술, 쌍화탕 한병 을 넣고 섞은 양념을.... \\u200b 볶아준 닭에 부어 줍니다. \\u200b 그리고 물 1 + 1/2컵을 붓고 준비한 당면을 넣고 함께 끓여 줍니다. \\u200b중간에 한번씩 저어 주세요. 센불에서 전체적으로 골고루 한번 팔팔 끓으면 불을 중~약불로 줄여 준 후 감자 큰거 한개를 덤성허니 잘라 넣고 함께 끓여 줍니다. \\u200b 양념이 바닥에 한층 자박하니 깔리면 양파 1/2개를 굵직하니 채썰어 넣고 대파 1대 초록부분, 청양고추 3개를 어슷하니 썰어 넣고 한번 골고루 볶아 주세요.\', \'닭안심 찜닭 만들기. 닭안심요리. 백종원 고기용소스 활용. 닭요리를 참 좋아하는데요.\\n닭뼈 발라내는게 참 귀찮아요.\\n그래서 닭안심을 좋아하지요.\\n닭가슴살은 많이 뻑뻑하지만\\n닭안심은 좀 부드럽거든요.\\n\\n간편하게 그냥 쏙쏙 집어먹을 수 있는\\n닭안심 #찜닭~~~~좋다!!!\\n달콤하고 짭쪼름한 #찜닭\\n청양고추를 좀 넣어주면 매콤~~해서\\n어른들 술안주로도 좋구요.\\n청양고추를 넣지 않으면\\n아이들 밥반찬이나 간식으로도 좋아요.\\n(고기용 만능소스 : \\n진간장 두컵, 설탕 한컵, 맛술 한컵, 물 두컵, \\n다진마늘 반컵, 다진생강 1T, 파 1컵, 참기름 1/3컵) [재료] 닭안심 25개, 당근 1개, 양파 1개, 감자 2개, 대파, 청양고추 두개, 홍고추 한개, 고기용만능소스 2컵\\n[고기용만능소스] 다진마늘 반컵, 다진생강 1T, 파 1컵, 참기름 1/3컵, 진간장 두컵, 설탕 한컵, 맛술 한컵, 물 두컵, 다진마늘 반컵, 다진생강 1T, 파 1컵, 참기름 1/3컵 고기용 만능소스를 만들어요.\\n진간장 두컵, 설탕 한컵, 맛술 한컵, 물 두컵, 다진마늘 반컵, 다진생강 1T, 파 1컵, 참기름 1/3컵 닭안심 25개를 한번 데쳐 내어 물에 헹궈주세요. 냄비에 닭안심과 고기용 소스를 두컵 넣어주세요. 준비한 채소도 넣어주세요.\\n파는 나중에 넣어주셔도 되지만\\n저는 그냥 한꺼번에 넣어주었어요. 보글보글 끓여주지요.\\n감자와 당근이 익을때까지요..^^\\n닭안심에 간장양념이 베어들도록~~~\\n이때 미리 불려놓은 당면을 넣어주셔도 되지요.\\n저는 이번엔 생략하고 먹었어요. 닭안심 찜닭 완성! 닭뼈 안발라내도 되고\\n간편하게 먹을 수 있어 좋아요.^^\\n뼈가 없으니 아이들 간식으로도 \\n반찬으로도 좋겠죠?\\n어른들은 맥주나 소주 안주로도 좋지요.\\nㅋㅋㅋㅋㅋㅋ 짭쪼름하고 달콤한 찜닭\\n완전 간단하죠?^^\\n부드러운 닭안심이라 더 좋구요.\']','쌍화탕  한병  쌍화탕  찜닭  찜닭  양념  쌍화탕  한병  맛  닭  닭  당면  참기름  다진마늘  대파     쌍화탕     양파  청양고추  닭  당면  당면  식용유  참기름  다진마늘  대파  한번  준비한  닭  닭  간장  올리고당     쌍화탕  한병  을  양념  닭  준비한  당면  한번  후  양념  양파  대파  청양고추  한번  찜닭  닭안심  두컵   설탕  한컵   맛술  한컵   두컵   반컵   다진생강  파  참기름  재료  닭안심  양파  대파  청양고추  한개  다진마늘  반컵   다진생강  파  참기름     두컵   설탕  한컵   맛술  한컵   두컵   다진마늘  반컵   다진생강  파  참기름  만능소스  \\\\진간장  두컵   설탕  한컵   맛술  한컵   두컵   다진마늘  반컵   다진생강  파  참기름  닭안심  한번  물  닭안심  고기용  준비한  당근  당면  닭안심  찜닭  수  식  닭안심  좋구요'),(48,'갈비탕','[\'쌀쌀한 날씨엔 역시 뜨끈한 국물이 최고인 갈비탕 끓이기 쌀쌀한 날씨가 되니 뜨끈한 국물 생각에 갈비탕을 끓여봤어요~ 갈비탕 간 맞출때는 입맛에 맞게 해서 싱거우면 소금을 짜면 물을 부어 맞추면 되니 걱정없이 만드시면 됩니다~ [재료] 소갈비탕용 1Kg, 다진대파 넉넉히, 불린당면 넉넉히, 팽이버섯 1/2개\\n[육수재료] 무 1/5토막, 양파 1개, 대파 2대, 생강 1톨\\n[갈비탕국물간] 국간장 2큰술, 소금 1큰술, 다진마늘 1큰술 정육점에서 갈비탕용 고기 1kg 사와서 찬물에 담가 해동하면서 핏물을 빼주었어요~\\n대략 1시간 정도면 핏물도 빠지고 해동도 됩니다. 찬물에 몇번 헹궈낸다음 냄비에 물 하나가득 넣어주고요. 바글바글 끓여줍니다.\\n이건 익히는게 아니고 불순물 제거하기 위해 한번 데쳐내는겁니다. 30분 정도 끓인 후 찬물에 행궈냅니다.\\n갈비 하나하나 꺼내 이물질 씻어냅니다.\\n냄비도 다시 깨끗하게 닦아줘야 잡내가 나지 않아요~ 헹궈낸 갈비에 물 하나 가득 넣고 육수 우릴 재료를 넣고 끓여줍니다.\\n1시간 정도 끓여주면 됩니다. 그 사이 고명으로 올릴 대파도 다져줍니다. 당면도 찬물에 담가 넉넉히 불려둡니다. 1시간 정도 끓인 후 무를 제외한 나머지 재료는 체망으로 건져냅니다. 무는 젓가락으로 찔러봐서 쑥 들어가면 익은것이니 건져내 나박썰어 준비합니다. 고기를 끓이는거라 기름이 많아요..\\n계속 건져내주면서 끓이면 됩니다. 어느 정도 걷어낸 갈비탕입니다~ 여기에 간은 국간장 2큰술 넣어주고요. 소금 1큰술 넣어 간을 맞추면 갈비탕 완성입니다~ 마지막에 다진마늘 1큰술을 체망에 넣은 후 숟가락으로 저어가며 마늘맛을 넣어줍니다.\', \'삼삼한 갈비탕 깨쟁이요리 인삼넣어 푹고아만든\\n맛있는 갈비탕^^\\nhttps://blog.naver.com/yejin1108/221024880944 - 고기삶을때 거품이 생기면 수시로\\n걷어줍니다.\\n- 기호에따라 소금.후추를 드실때 추가하세요.\\n-고기양에 따라 육수1시간 시간을 더 늘리세요. 소찜갈비 600g, 무 1/5, 양파 1/3, 파 1개, 인삼 2~3뿌리 진간장 1T, 올리고당 1T, 국간장 1T, 소금 1T, 다진마늘 1T, 통마늘 3T 고기는 흐르는물에 잘\\n씻고 5~6시간 충분히\\n핏물을빼둡니다.\\n[고기10분]\\n후에 잠길정도로 물을넣어\\n5분끓여 삶아내고 물을버린뒤 다시물2컵.진간장2.\\n올리고당1을 넣고\\n5분졸이기 [야채육수15분]\\n물(갈비양2배)무,파,마늘,\\n인삼,생강을 넣고 15분 센불로 육수를 내줍니다.\\n이때 인삼은 빼고 나머지는 걸러줍니다. [고기+야채육수1시간] 양념된 고기를 넣어주고 인삼넣고 센불30분 중간불30분 뚜껑을\\n닫고 졸여줍니다. 중간불10분전 / 고기가 익었다면 얇게썰은 무조금,다진마늘1T,\\n국간장1T,소금1T,\\n미향1T을 넣어주세요~ 그릇에담아 맛있게\\n먹습니다.\']','갈비탕  날씨  뜨끈한  국물  갈비탕  갈비탕  소금  재료  넉넉  국간장  소금  다진마늘  갈비탕  고  찬물  정도  핏물  해동  찬물  것  정도  후  찬물  재료  정도  대파  찬물  담  정도  후  재료  것  고  것  정도  갈비탕  국간장  소금  간  갈비탕  다진마늘  체망  후  갈비탕  소금  때  무  양파  국간장  소금  다진마늘  육수  인삼  나머지  고  고'),(49,'설렁탕','[\'알토란 깍두기 / 설렁탕 집 깍두기 우연히 티브이를 보다가 임짱 깍두기라고~저도 따라 해봤어요^^ 아삭하니 국물은 시원하고 개운하네요~ [깍두기 재료] 무 3개, 대파 2대\\n[양념] 고춧가루 1/2컵, 소주 2컵(소주잔), 간 양파 1/2컵, 간 배 1/2컵, 간 마늘 3T, 간 생강 1/2T, 새우젓 3T 꽃소금 3T, 설탕 3T, 요구르트 3병 무는 4cm정도 크기로 잘라 물에 5~10분간 담갔다 건져 물기를 빼주고 물기 뺀 무는 볼에 담아 소주 2잔을 부어 뒤적거려주고 고춧가루1.2컵을 넣고 3~5분간 뒤적여 주세요 뒤적거려 잠시두고 대파2대 길이로 썰고 마늘 ,생강 간 배 간 양파 준비합니다 무에 간 재료 마늘 생강 꽃소금 1 새우젓 3 요구르트 3병을 넣고 버무려줍니다 요구르트 3병이 생각보다 많았어요^^ 설탕은 3T만 넣어주었는데요 본 레시피에는 4~5T로 돼 있어요 너무 단듯해 설탕을 줄였어요 소금량도 총 2T에서 2T를 더 추가했어요 마지막에 소금과 대파 넣고 버무려 주세요 실온에 5일 두었다 냉장 보관해 드시면 되는데요 설탕 과 소금량은 가감 하면 돼요 아삭하고 국물은 개운하니 맛있는 알토란 깍두기 완성입니다\', \'솔여시의 진한 설렁탕 황금레시피 이제 살랑살랑 찬바람이 부니 따근한 설렁탕이 땡기내요^^\\n그럼 여기서 잠깐만요^^.... 우리 설렁탕과 곰탕에 차이점을 잠시 알고 가요^^\\n설렁탕은 주로 뼈가 많이 들어가고 사골 도가니 소머리 우적을 비롯해서 양지나 사태 등의 \\n정육을 넣고 거기에 우설이나 지라 허파 유통들 내장을 넣고 푸~고아 끓인 것이고\\n곰탕은 뼈는 안 들어가는 대신 보다 질 좋은 고기와 내장 위주로 넣어 끓인 음식이에요^^\\n그리고 설렁탕은 12기산 이상 또는 하루 정도는 끓여줘야 뽀얗고 진한 국물이 되는데요^^\\n곰탕은 서너 시간 정도 끓여 사태나 양지 내장 등이 익었을 때 무와 다시마를 넣고 더 끓여 기름진 맛을 내는 \\n것이 특징이에요^^\\n이렇게 설렁탕과 곰탕에 차이를 간단하게 알아봤구요^^\\n오늘은 저랑 같이 설렁탕 끓여보아요^^\\n 뼈국물을 만드실때 끓는도중 물을 추가사지 마세요^^\\n잡내에 원이이되기도 합니다^^ [재료] 우족 502g, 잡뼈 536g, 사골 606g, 생강 19g, 대파 조금, 소면 한줌, 삼각살 236g 우선 요즘 들어 부쩍 뼛국을 찾는 딸아이를 위해 인터넷에서 사골과 잡뼈 우족을 각각 1K씩 사서 뼈들을 이등분으로 나눴어요^^\\n그리고 어던 분들은 생강을 한 주먹씩 넣는다는 분도 계시는데 그럼 저는 이 뼈 국물에서 생강 향이나 맛이 좀 \\n강하게 나고 순수한 뼈 국물 특유에 꼬소한 맛이 덜한 것 같아 생강은 조금만 준비했어요^^ 그리고 흔히들 설렁탕 고기로는 양지를 많이들 쓰는데 저는 삼각살을 준이했네요^^\\n그럼 잠시 삼각살에 대해 알아보고 넘어갈게요^^\\n삼각살 하면 조금 생소 하실 텐데요^^.... 삼각살은 설도에 붙어있는 삼각형 모양에 살 이예요^^\\n정형을 해보면 삼각형 모양이라고 해서 삼각살입니다...\\n삼각살은 설깃살과 보섭살 사이에 있는 삼각형 모양에 대퇴근막긴장근을 분리하여 정형한 것인데요^^\\n설도에 소분한 모든 부위가 그렇듯이 삼각살도 육색은 짙고 근섬유가 굵지 않아 결도 그칠지 않아 조직감이 \\n부드러운 부위랍니다^^\\n또한 육즙도 풍부하고 마블링도 균일하여 향미가 아주 뛰어나요^^\\n그래서 구이용이나 산적 불고기 또는 육회나 육포로 많이 이용되는 부위랍니다^^\\n그래서 저는 양지보다는 아주 많이 싼 삼각살을 준비했어요^^ 우족과 잡뼈 사골에 핏물을 뺄 건데요^^\\n핏물은 2~3시간 정도만 빼줍니다 그 이상 핏물을 빼시면 그건 핏물을 빼는 게 아니라 핏물에 뼈들을 재워두는 게\\n되어 오히려 비릿한 잡내에 원인이 되기도 해요^^ \\n그리고 40~1시간 간격으로 물을 갈아줍니다^^..... \\n그래야 핏물이 아주 깨끗하게 재거가 된답니다^^ 저는 핏물을 2시간 정도 뺐어요^^ 그리고 물을 자작하게 붓고 뼈를 한번 끓여내어 이물은 버리고 뼈고 깨끗이 헹구어줘요^^..이걸 두 번 반복해주세요^^\\n아깝다 생각 마시고 깔끔하고 잡내 없는 뼈 국물을 위해 이렇게 두 번 반복해주세요^^ 뼈에 높이보다 2~3배에 물을 붓고 생각을 함께 넣어^^.... 뚜껑을 삐끔히 하고 끌이시는데요\\n이 때 끓기 시작하면 중불로 낮춰 은근히 끓여주세요^^\\n그리고 끓이는 도중 절대로 물을 추가하지 마세요^^... 끓는 도중 물을 추가하게 되면 특우에 냄새가 날 수도 있어요^^.....하지만 꼭 넣으셔야 한다면 끓는 물을 넣어주시고 되도록이면 물추가는 안 하는 게 좋아요^^ 그리고 떠오르는 기름 거품을 수시고 겉어내주세요^^\\n이 기름 거품을 겉어내주시면 훨씬 더 깔끔하고 담백한 국물이 돼요^^\\n물로 기름을 따라 잡내도 제거하는 방법이 되기도 하구요^^ 중불에서 5시간 동안 끓여낸 첫물이에요^^ 오~ 첫물인데도 색이 아주 진하네요^^ 첫 번째와 같은 방법으로 두 번째 물도 기름ㅇ르 수시로 겉어내면서 5시간 정도 끓였어요^^..물론 중불이구요^^ 이렇게 첫 번째 물과 두 분째 물을 석어주시고요^^ 그리고 두 번째 물을 끓이고 나면 요 잡뼈는 빼내주세요^^\\n\\n돼지든 소든 이 뼈 국물을 우려낼 때는 진한 감칠맛 때문에 잡뼈을 넣는데요^^......요 잡뼈는 뼈가 얇아서 두 번 정도 우려내고 나면 영양가 있는 성분들이 다 빠져나와 더 우릴 영양가가 더 이상 없게 된데요^^..... 그래서 빼내줍니다^^\\n고생했다 잡뼈야~ 세 번째도 처음과 두 번째 물과 같은 방법으로 중불에서 5시간 정도 우려냈요^^ 그리고 첫 번째와 두 번째 물을 세번째 물과 석어 다시 한번 팔팔 끓여줍니다 원래는 고기를 뼈 국물 우려낼 때같이 넣고 삶아내는데요^^\\n저는 그럼 고기에 육즙이나 단맛이 다 빠져나가 고기가 푸석해지는 것 같아 이렇게 따로 삶았어요^^\\n고기도 물론 핏물을 한 시간 정도 빼주었고요^^... 사진처럼 대파를 조금 넣고 고기를 삶았네요^^ 어느 정도 삶다가 고기를 칼로 찔러봤을 때 핏물이 나오지 않으면 다 익은 거라는 건 다들 아시기요^^ 하루 전날 끓여 냉장고에 넣어두었던 뼈 국물이네요^^\\n끓이는 동안 열씨미 기름을 걷어내서 그런가 기름이 별로 생기지 않았어요^^\\n이렇게 굳은 기름도 체로 걷어내주세요^^\\n 국물이 아주 잘 됐어요^^..... 걸쭉하네요^^\\n이제 고기도 삶아졌겠다 소면을 삶을 거예요^^.... 설렁탕은 또 요 소면을 넣어 함께 먹는 게 일품이잖아요^^ 요로케 샛팅을 하고 이제 국물만 부으면 끝이에요^^ 오~~~~~아주 뽀얗고 맑은 설렁탕이 완성이 되었네요^^ 얼마 전에 담근 설렁탕 깍두기가 기가 막히게 맛이 들었어요^^\\nhttp://www.10000recipe.com/recipe/6857007\\n오늘 끓인 설렁탕이랑 아주 환상에 짝꿍이지요^^ 깍두기 국물이 또한 아주 기가 막히네요^^... 요렇게 깍두기 국물을 넣어 김치를 척척 올려 먹으니 어느새 저는 설렁탕 한 사발을 뚝딱했다지요^^\']','깍두기  설렁탕  깍두기  깍두기  저  국물  깍두기  재료  무  대파           마늘  생강     설탕  요구르트  물  소주  마늘  생강  배  양파  무  재료  마늘  생강  꽃소금  새우젓  요구르트  요구르트  생각  설탕  설탕  추가  대파  두  설탕  소금량  아삭하  국물  개운  알토란  깍두기  한  설렁탕  설렁탕  설렁탕  뼈  사골  우  양지  내장  뼈  고  내장  설렁탕  이상  정도  한  국물  정도  사태  양지  내장  등  때  무  맛  설렁탕  곰탕  저  설렁탕  때  물  재료  우족  잡뼈  사골  생강  대파  삼각살  사골  잡뼈  우족  뼈  생강  저  뼈  국물  생강  맛  뼈  국물  맛  것  생강  설렁탕  고  양지  저  삼각살  삼각살  삼각살  삼각형  모양  삼각형  모양  삼각살  삼각형  모양  삼각살  저  양지  삼각살  준비했어요^^  우족  잡뼈  사골  핏물  정도  이상  핏물  핏물  것  핏물  뼈  잡  물  핏물  저  핏물  정도  물  뼈  뼈  두  번  생각  잡  뼈  국물  두  번  뼈  물  생각  때  중불  물  추가  도중  물  추가  물  것  수  거품  깔끔  국물  잡  방법  중불  첫  번  방법  두  번  물  정도  첫  번  물  두  분  물  두  번  물  잡뼈  소  뼈  국물  우  때  한  잡뼈  잡뼈  뼈  두  번  정도  우  나  우  이상  번  두  번  물  방법  중불  정도  첫  번  두  번  물  물  한번  고  뼈  국물  우  때  고  육즙  고  것  핏물  시간  정도  대파  고  정도  고  때  핏물  것  하루  뼈  동안  국물  고  설렁탕  소면  것  국물  설렁탕  완성  설렁탕  깍두기  맛  설렁탕  깍두기  국물  기  깍두기  국물  저  설렁탕'),(50,'막창','[\'집에서 식당처럼 곱창 & 막창 먹기. 마트에서 직화 불곱창과 이바라 막창을 구매했답니다!! 물론 밖에서 먹는 것도 좋지만....ㅎㅎ 집에서도 먹으면 더 편하고 양도 많고 가격도 싸서 ㅎㅎ 그럼 집에서도 식당처럼 해 먹기 시작합니다!! ★_★ [주재료] 직화불곱창, 이바라막창\\n[양념 곱창] 직화불곱창, 양파, 숙주, 식용유, 후추, 소금\\n[양파 간장절임] 양파, 간장, 식초, 설탕, 물\\n[부추 절임] 부추, 다진마늘, 액젓, 매실액, 식초, 참기름, 고춧가루, 깨소금\\n[야매 막장] 쌈장, 매실액, 깨소금, 부추\\n[그 외에 마늘 굽기] 통마늘 먼저, 막창을 잠시 물에 해동을 시켜줍니다. 양파 절반은 두껍게 채 썰어 → 양념 곱창, 양파 절반은 얇게 채 썰어 → 양파간장 절임 양파간장절임은 먼저, 양파 아린 맛 제거를 위해 식초물에 담가놓습니다.\\n진간장, 설탕, 식초, 물로 간장절임소스를 만듭니다. 숙주는 깨끗이 씻어 체어 받쳐 물기를 제거합니다. 어느 정도 해동이 되었으면, 막창을 물에 한번 헹궈주시고, 삶아 줍니다. (기름 제거 및 다 익혀져서 구울 때 수월!!) 마늘은 적당한 크기로 잘라줍니다. 마늘 안 좋아하시는 분들은 생략하셔도 됩니다. 저는 마늘 구워 먹는 걸 좋아해서 ㅎㅎ 마늘, 고기와 함께 구워 먹습니다~^^ 부추는 적당한 크기로 잘라주시고, 부추 약간은 남겨서 다져줍니다. → 야매 막장 쌈장을 넣고 먼저 매실액을 넣어 풀어주고 나서 깨소금을 넣어 섞어줍니다.\\n다진 부추는 나중에 먹을 때 넣어줍니다. 양념 곱창은 먼저 프라이팬에 식용유를 두르고 나서 양파를 넣어 소금과 후추를 넣어서 볶아준 뒤, 어느 정도 양파가 볶아지면, 곱창을 넣어 볶아줍니다. 마지막에 숙주를 넣어서 살짝 볶아주면 완성!! 이바라 막창 1kg에는 사진에 보다시피 6줄이 있었습니다. 먼저 반으로 잘라서 초벌 한다 생각하면서 구워주시다가. 적당한 크기로 잘라서 구워줍니다. 그냥 원래 상태로 잘라서 구워 먹어도 되고, 아니면 갈라서 네모 한 모양으로 구워 먹어도 됩니다. 저는 둘 다 좋아해서 골고루 해서 구웠습니다. 대충 다 구워지면, 자른 마늘과 함께 구워줍니다. 부추는 다진 마늘, 액젓, 매실액, 식초, 참기름, 고춧가루, 깨소금을 넣고 버무려줍니다.\', \'미카엘의 막창 한 번 믿어봐~ - 냉장고를 부탁해 31회 냉장고를 부탁해 31회\\n방송일 : 2015.6.15 [재료] 막창, 우유, 마늘, 올리브오일\\n[양념] 레드페퍼, 버터, 식초 물에 막창을 삶은 육수를 섞는다. 1에 잘게 썬 막창, 우유를 넣고 끓여 수프를 만든다. 다진 마늘과 식초를 섞는다. 올리브 오일에 버터를 녹인다. 4에 레드 페퍼를 넣어 고추기름을 만든다. 수프에 고추기름을 넣고 끓인다. 그릇에 수프를 담고 대파를 올린다. 마늘 식초를 곁들여낸다.\']','집  곱창  막창  막창    집    집  식당  곱창  직화불곱창   양파  숙주  양파  식초  부추  매실액  식초  매실액  깨소금  마늘  막창  물  양파  →  곱창  양파  절반  채  →  절  먼저   양파  제거  설탕  식초  물  숙주  제거  해동  막창  물  제거  마늘  적당  마늘  마늘    마늘  부추  적당  부추  →  막장  매실액  깨소금  부추  때  양념  곱창  식용유  양파  후추  정도  양파  곱창  숙주  이바  막창  적당  저  마늘  부추  마늘  액젓   매실액  식초  참기름  고춧가루  깨소금  막창  냉장고  부탁  마늘  식초  물  막창  막창   우유  수프  마늘  식초  버터  수프  고추기름  수프  마늘  식초'),(51,'곱창','[\'집에서 식당처럼 곱창 & 막창 먹기. 마트에서 직화 불곱창과 이바라 막창을 구매했답니다!! 물론 밖에서 먹는 것도 좋지만....ㅎㅎ 집에서도 먹으면 더 편하고 양도 많고 가격도 싸서 ㅎㅎ 그럼 집에서도 식당처럼 해 먹기 시작합니다!! ★_★ [주재료] 직화불곱창, 이바라막창\\n[양념 곱창] 직화불곱창, 양파, 숙주, 식용유, 후추, 소금\\n[양파 간장절임] 양파, 간장, 식초, 설탕, 물\\n[부추 절임] 부추, 다진마늘, 액젓, 매실액, 식초, 참기름, 고춧가루, 깨소금\\n[야매 막장] 쌈장, 매실액, 깨소금, 부추\\n[그 외에 마늘 굽기] 통마늘 먼저, 막창을 잠시 물에 해동을 시켜줍니다. 양파 절반은 두껍게 채 썰어 → 양념 곱창, 양파 절반은 얇게 채 썰어 → 양파간장 절임 양파간장절임은 먼저, 양파 아린 맛 제거를 위해 식초물에 담가놓습니다.\\n진간장, 설탕, 식초, 물로 간장절임소스를 만듭니다. 숙주는 깨끗이 씻어 체어 받쳐 물기를 제거합니다. 어느 정도 해동이 되었으면, 막창을 물에 한번 헹궈주시고, 삶아 줍니다. (기름 제거 및 다 익혀져서 구울 때 수월!!) 마늘은 적당한 크기로 잘라줍니다. 마늘 안 좋아하시는 분들은 생략하셔도 됩니다. 저는 마늘 구워 먹는 걸 좋아해서 ㅎㅎ 마늘, 고기와 함께 구워 먹습니다~^^ 부추는 적당한 크기로 잘라주시고, 부추 약간은 남겨서 다져줍니다. → 야매 막장 쌈장을 넣고 먼저 매실액을 넣어 풀어주고 나서 깨소금을 넣어 섞어줍니다.\\n다진 부추는 나중에 먹을 때 넣어줍니다. 양념 곱창은 먼저 프라이팬에 식용유를 두르고 나서 양파를 넣어 소금과 후추를 넣어서 볶아준 뒤, 어느 정도 양파가 볶아지면, 곱창을 넣어 볶아줍니다. 마지막에 숙주를 넣어서 살짝 볶아주면 완성!! 이바라 막창 1kg에는 사진에 보다시피 6줄이 있었습니다. 먼저 반으로 잘라서 초벌 한다 생각하면서 구워주시다가. 적당한 크기로 잘라서 구워줍니다. 그냥 원래 상태로 잘라서 구워 먹어도 되고, 아니면 갈라서 네모 한 모양으로 구워 먹어도 됩니다. 저는 둘 다 좋아해서 골고루 해서 구웠습니다. 대충 다 구워지면, 자른 마늘과 함께 구워줍니다. 부추는 다진 마늘, 액젓, 매실액, 식초, 참기름, 고춧가루, 깨소금을 넣고 버무려줍니다.\', \'초간단 곱창 없는 순대곱창볶음(feat.창난젓무침) 해피투게더 야간매점에서 창난밥을 본 이후로 종종 창난젓으로 볶음밥을 만들어 먹었더랬다. (창난은 볶으면 묘~하게 곱창 같다.) 창난? 곱창? 음....? 그럼 순대곱창볶음을 짝퉁으로 만들어 볼 수 있겠구만!!! 그래서 만들었다! 순대곱창볶음st. 곱창 없는 순대곱창볶음!!! [재료] 양배추, 순대, 창난젓무침, 식용유, 참기름 식용유를 두르고 양배추를 부드러워질 때까지 볶는다. 1에 창난젓무침을 넉넉히 넣고(순대까지 고려하여 간이 짭짤한 정도의 양) 양배추에 간이 배게 볶다가 양배추가 붉어지면 순대(찐 상태)를 넣고 볶는다. 순대에 양념이 배면 참기름 반 스푼 넣고 한 번 휘저어 준 후, 불에서 내려서 통깨를 뿌려 마무으리!\']','집  곱창  막창  막창    집    집  식당  곱창  직화불곱창   양파  숙주  식용유  양파  식초  부추  매실액  식초  참기름  매실액  깨소금  마늘  막창  물  양파  →  양념  곱창  양파  절반  채  →  절  먼저   양파  제거  설탕  식초  물  숙주  제거  정도  해동  막창  물  제거  때  마늘  적당  마늘  마늘    마늘  부추  적당  부추  →  막장  매실액  깨소금  부추  때  양념  곱창  식용유  양파  후추  정도  양파  곱창  숙주  이바  막창  적당  저  마늘  부추  마늘  액젓   매실액  식초  참기름  고춧가루  깨소금  곱창  곱창  곱창  곱창  순대곱창볶음  양배추  식용유  참기름  식용유  양배추  때  정도  양  양배추  간  양배추  상태  양념  배  참기름  반'),(52,'물냉면','[\'물냉면 집에서 싸게 만들어먹는 물냉면 여기서 나오는 양념장은 1인분 기준이 아니며, 약 3~4인분이 나온다. 면과 육수는 마트에서 저렴하게 구입 가능하다. [재료] 냉면 면, 냉면육수 1봉, 양파(생략가능) 1/4개, 고추장 1큰술, 물엿 1큰술, 간장 1큰술, 소금 1큰술, 다진마늘 1큰술, 매실청 2큰술, 설탕 4큰술, 식초 4큰술, 깨소금 1큰술, 후추 약간, 고추가루 1/2컵 계란을 삶아준다. (완숙 15분) 양념을 넣고 섞어준다.(양파를 넣을 시 믹서에 갈아준다).\\n그 후 고추가루1/2컵을 넣고 섞어준다. 끓는물에 냉면면을 넣고 3~40초가 삶는다. 접시에 면 - 육수 - 양념장 - 계란순으로 얹어 먹는다.\', \'더위잡는 보양식, 닭곰탕으로 쉽게 건강한 물냉면 만들기 저희는 인스턴트 냉면 육수/비빔장을 안먹거든요. 그래서 물냉면을 먹으려면 육수를 직접 만들어야 하는데 그게 보통일이 아니잖아요. 주로 열무물김치나 동치미국물을 사용하는데 아무래도 그러다보면 고기가 좀 땡겨서 뭔가 부족하다 싶었는데 언제 한 번 닭곰탕 먹고 남은 국물과 고기를 또 먹기가 싫어서 초계면을 토대로 초계냉면을 만들었더니 아주 좋더라구요. 저희는 늘 닭곰탕을 먼저 먹고 남은 국물을 냉장실에 넣어뒀다가 다음날에는 초계냉면을 해 먹습니다. 담백한 거 좋아하시는 분들 입맛에는 잘 맞을 듯 싶네요. [닭곰탕(육수)재료] 닭1마리 약5파운드남짓(약2.5키로), 마늘 20톨가량, 500원짜리크기편생강 7-10조각, 통후추 20개가량, 월계수잎 2-3개, 대추 7개, 구기자(생략가능) 약간, 말린 엄나무/뽕나무(생략가능) 2-3조각\\n[부재료 및 양념] 녹색채소 초록피망이나 오이, 붉은색채소 당근이나 빨간피망, 삶은달걀, 꿀식초소스 *참고, 연겨자 취향껏, 국간장(조선간장) 취향껏\\n[*꿀식초소스] 식초 5T, 꿀 6T, 소금 1/4t 작은 닭은 찾아보기가 힘들어서 늘 그냥 이렇게 토실토실 커다란 애들을 사용합니다. 그나마 그 중에 제일 작은 걸로 고른다고 골라도 거기서 거기니 음식하고나면 늘 남고, 남은 거 그대로 먹기 싫어서 고민하다가 탄생한 남은 음식 활용 레시피이기도 하지요.\\n닭을 깨끗이 씻어 껍질 벗겨내고 지방도 최대한 제거해준 다음 한 번 더 씻어줍니다. 커다란 솥에 같이 끓일 재료들을 바닥에 깔아놓습니다. 딱히 양을 꼭 정해진대로 써야하는 건 아니지만 대추는 너무 많이넣으면 색이 벌겋게 되고 국물 맛이 들큰해지는 경향이 있어서 10개를 넘기지 않도록 넣어줍니다. 삼계탕 재료 파는 거 보면 엄나무가 간혹 들어가 있던데 저는 집에 뽕나무가 있어서 그걸 넣었어요. 당뇨에 좋다고 하니까 넣은거고 냄새 잡는 데에 효과가 있는 건 모르겠네요. ^^; 부재료 위에 손질한 닭을 넣고 닭이 잠기도록 찬물을 채워넣고 굵은 소금이나 꽃소금을 두세꼬집 뿌린 뒤 불을 올립니다. 냄비크기가 넘 빠듯하면 끓으면서 핏물이 거품으로 올라와 가스렌지에 다 넘치는 수가 있으니 이렇게 부글부글 끓어오를 때까지는 뚜껑 열고 끓이다가 끓기 시작하면 불순물 거품을 좀 국자로 퍼내시고 불을 중간으로 줄여놓은 다음 뚜껑을 삐딱하게 걸쳐서 닫아놓고 50분가량 끓여줍니다. 뚜껑이 삐딱하게 열려있었던 만큼 국물도 수증기로 날아가 줄어들기도 하니까요, 중간에 물을 약간씩 추가해주셔도 좋아요. 저희집은 국물을 좋아해서 물을 중간에 조금씩 추가해주었답니다. 냉장상태의 닭을 손질해서 사용할 경우, 대략 50분가량 끓이면 속까지 다 익어요. 누런 기름은 국자로 걷어서 버려줍니다. 닭은 집게같은 걸 이용해서 큰 그릇에 옮겨 식히고 국물은 체반에 받쳐 걸러냅니다. 식힌 닭은 위생장갑 끼고 양손으로 열심히 뼈를 발라내구요, 살을 발라낸 고기는 마지막으로 잔뼈가 없는지 확인해서 반찬용기에 옮겨놓습니다. 저는 다시 국물에 넣어 닭곰탕으로 먹고 남은 것을 다시 걸러놓은 것이라 살바르고 난 직후와 그릇에 옮겨담은 것이 색이 살짝 달라요. 닭곰탕으로 먹을 땐 국물에 파송송 뿌리고 후추가루 톡톡해서 먹으면 끝내주죠. 그 사진은 생략했어요. 걸러서 남은 국물도 역시 반찬용기에 옮겨 냉장실에 넣어보관합니다. 살얼음을 원하시면 초계냉면 먹을 부재료를 준비할 때 냉장되었던 육수를 냉동실에 옮겨 넣어두시면 되어요. 계란 삶는 법은 다 아시죠? 냄비에 계란 담고 찬물 부어 끓어오르기 시작한 시간으로부터 6-8분정도 지나면 반숙되고요, 10분에서 12분사이는 적당한 완숙입니다. 그 이상하면 흰자와 노른자 사이에 검록색의 이상한 물질이 생기죠. 황화철인가 뭐시깽이라고 예전에 가정시간에 배운 것 같은데... 뭐래...ㅡㅡ; 하여튼 별로 좋은 건 아닌듯이요. 다 익은 달걀은 찬물에 풍덩~ 해야 껍질이 잘 까진대요. 부재료 중 나름 가장 중요한 부분입니다. 식초5T+꿀6T+고운소금1/4t 넣어 녹을 때까지 잘 저어주세요. 색깔을 예쁘게 하기 위해 당근이나 게맛살, 오이나 피망을 채썰어주시고 계란은 식은 뒤 껍질을 까 놓습니다. 냉면사리를 제품 뒷면 안내에 따라 익혀서 찬물에 여러번 헹궈 전분기를 없애주세요. 냉장되었던 육수를 이것저것 천천히 준비하면서 냉동실에 30분가량 뒀더니 살얼음이 많이 얼었어요. \\n중요한 포인트, 이 때 육수간을 꼭 보셔야합니다. 왜냐면 닭곰탕으로 따뜻하게 먹을 땐 좀 싱거워도 먹을만하지만 차가운 냉면이 싱거우면 이상하게 모든 맛이 겉도는 느낌이거든요. 간을 본 뒤, 싱겁다면 국간장으로 간을 맞춰주세요. 살짝 짤듯말듯 해야 나중에 면과 다른 부재료랑 다 같이 섞였을 때 싱거워지지 않아요. 육수 간이 다 끝났으면 냉면기에 삶은 냉면사리를 담고 육수를 살얼음과 함께 잘 국자로 떠 넣은 후 12번의 꿀식초를 2-3T정도 떠서 뿌려넣고 다른 부재료들을 취향껏 잘 둘러담은 뒤, 연겨자를 넣어 잘 섞어서 드세요.\']','물냉면  물냉면  분  면  육수  냉면  면  소금  계란  면  육수  양념장  닭곰탕  물냉면  냉면  육수  물냉면  육수  사용  닭곰탕  국물  고  초계냉면  저희  닭곰탕  국물  초계냉면  것  약간  양념  식초  소금  닭  사용  거기  것  껍질  번  거  대추  국물  재료  것  집  거  부재료  닭  닭  찬물  소금  뒤  때  뚜껑  거품  국자  중간  다음  뚜껑  뚜껑  삐딱  국물  중간  국물  물  중간  추가  닭  손질  사용  국자  닭  거  국물  닭  저  국물  닭곰탕  것  것  그릇  것  색  닭곰탕  국물  국물  반찬용기  냉장실  살얼음  초계냉면  부재료  때  육수  계란  계란  찬물  시작  완숙  것  데  거  찬물  껍질  부재료  중  때  당근  오  계란  뒤  껍질  찬물  냉장  육수  준비  냉동실  살얼음  때  닭곰탕  냉면  이상  맛  간  뒤  간  면  때  육수  간  삶  냉면사리  육수  살얼음  국자  후  뒤  연겨자'),(53,'비빔냉면','[\'비빔냉면 집에서 비빔냉면 만들어먹자! 냉면사리는 마트에서 구매할 수 있다. [재료] 냉면사리 1인분, 생수 80ml, 고추가루 4스푼, 다진마늘 1스푼, 국간장 4스푼, 설탕 2스푼, 물열 2스푼, 식초 1스푼, 통깨 1스푼 생수 1/2컵(80ml)과 양념(고추가루4스푼, 다진마늘1큰술, 국간장4큰술, 설탕2큰술, 물엿2큰술, 식초1큰술, 통깨1큰술)을 섞어준다. 냉면사리를 삶아준다. (끓는물에 40초) 섞으면 완성!\', \'너무 맛있는 비빔냉면 만들기 푹푹 찌는 여름....입맛은 떨어지고....면요리는 먹고 싶은데 파스타나 라면은 안땡기고 ㅜ ㅜ 그래 선택한!!! 비빔냉면 이에요^^ [재료] 냉면사리 2인분, 시판냉면육수 1봉, 오이 1/3개, 쌈무 소량, 참기름 적당량, 삶은계란 1\\n[양념] 고추가루 1큰술, 설탕 1큰술, 다진마늘 1큰술, 진간장 1큰술, 매실액 2큰술, 다진파 3큰술, 고추장 4큰술, 식초 4큰술, 깨소금 4큰술 먼저 시판용 냉면육수는 미리 냉동실에 넣어서 비빔냉면을 시원하게 먹을 수 있도록 준비해 준 후, 그릇에 고추가루 1큰술, 설탕 1큰술 고추장 4큰술 (푹푹 크게 뜨면 안됩니다~), 다진마늘 1큰술 매실청 2큰술, 진간장 1큰술 식초 3큰술 넣어주고~ 깨 4큰술은 위생봉투에 담아 밀대로 밀어서 전부 으깨 주세요 깨를 으깨주기만 하면되니까, 갈아도 되고 빻아도 됩니다^^ 으깬 깨소금 2큰술은 양념장에 담고 2큰술은 남겨주세요. 파는 3큰술 다져서 넣어 잘 섞어주세요 비빔냉면 양념장 완성 되었습니다^^ 냉면 사리는 비벼서, 서로 붙어있는걸 떼 내어주고 냄비에 물을 받아, 물이 끓어오르면 냉면사리를 넣고 2-3분간 끓여주세요 삶은 냉면 사리는 찬물에 바락바락 씻어 줍니다. 차가운 냉면을 먹기 위해 마지막 헹굼물은 얼음물이면 더 좋겠네요^^ 잘헹군 냉면사리는 물기를 꼭 짜내어 그릇에 옮겨 담고 위에 미리 만들어 놓은 양념 3큰술을 올려주세요 참기름은 취향이라 따로 양념장에 섞진 않았는데요. 참기름 넣는 분들은 양념장 위에 1큰술 넣어주면 됩니다~^^ 비빙냉면에 올릴 고명인데요 쌈무, 채썬 오이, 삶은 계란 이에요 차곡차곡 위해 올린 후, 시판 냉면 육수 작은 1국자 넣어주세요.(미리 냉동실에 넣었다가 조금 녹여 부으면 시원한 비냉 먹을 수 있어요)그리고 남은 으깬깨를 주변에 뿌려주면 맛있는 비빔냉면 완성^^\']','비빔냉면  비빔냉면  냉면사리  수  냉면사리  고추가루  다진마늘  설탕  식초  생수  냉면사리  완성  비빔냉면    비빔냉면  재료  냉면사리  분  참기름  고추가루  설탕  다진마늘  식초  비빔냉면  수  고추가루  설탕  고추장  다진마늘  진간장  식초  깨소금  양념장  비빔냉면  양념장  완성  냉면  물  냉면사리  냉면  사리  냉면  냉면사리  그릇  참기름  양념장  참기름  양념장  위  오  삶  후  냉면  냉동실  시원  수  비빔냉면  완성'),(54,'뼈해장국','[\'초대박 시래기 뼈다귀해장국 레시피 : 정말 우연히 잘된 뼈해장국 대박 맛있게 된 돼지고기 등뼈 뼈다귀해장국 가성비 끝판왕 7천원으로 뼈해장국 3그릇 양을 만들어 내다... 흐믓.~ 여기에 감자만 넣으면 감자탕 [메인재료] 돼지등뼈 2킬로그램\\n[양념] 생강 6조각, 대파 4뿌리, 마늘 2T, 고추장 6T, 된장 2T, 후추 약간, 소금 1T, 간장 1T, 청양고추 2개, 양파 1/4개, 들기름 약간, 허브맛솔트 1T, 고추가루 콸콸콸\\n[필수] 월계수잎 3장, 시래기 1덩이, 빨간소주 2컵 나는 돼지 등골 브레이커 돼지등뼈를 마트에서 7174원에 구매했는데 무게가 2킬로 그램이 조금 넘어요~ 핏기가 많이 있죠~ 고기류는 핏물을 1시간 이상 빼놔야 한대요... 핏물 빠지게 찬물에 담궈놓는 동안 컵에 고추장 6숟갈, 된장 2숟갈, 간장 1숟갈, 소금 1숟갈, 후추 조금 이렇게 해놓고 야채도 썰어놨어요~ 야채는 ? 대파, 양파, 생강, 청양고추 그리고 가장 중요한 시래기 ... 저 봉지에서 한정도 덜어서 했어요~ 핏물 우리는 동안 세탁기도 돌리고 설거지도 하고 등등 .... 우리는 인내가 참... 결국 1시간 못채우고 40분 있다가 조리시작~ !! 40분후에 ... 물에 두세번 헹궈주고 삶아주고 잔 찌꺼기들 버리고 ... 일단 ... 그리고 삶는동안 시간이 남으니까~ 양념은 위에서 적었는데 .. 고추장 6, 된장 2, 들기름 약간, 간장 1, 후추, 소금 1, 다진마늘 2, 생강 6조각 그리고 야채류를 넣어주고 같이 버무려놔요.. 야채류 : 대파 4, 청양고추 2, 양파 1/4 초벌로 삶은후에~ 물에 헹궈줘요~ 이제 냄비플레이 다시... 고기위에 또는 냄비 사이사이에 ... 시래기 양념한것을 넣어주고요... 빨간색 소주 진한거를 큰 커피잔으로 1컵 (종이컵으로는 2컵 정도) 부어주고 막 끓여주다가~ (잡내제거) 국물이 약해서 ... 원래는 고추장 3숟갈로 생각했다가 물이 많다는걸 깨닫고 3스푼 더 해서 고추장 총 6스푼 !!! 된장 2스푼 고추가루랑 후추 좀 첨가~ 어느정도 됐다 싶어서 뚝배기에 덜어서 준비 !!\', \'시래기 뼈해장국 든든한 음식~ 해장국으로 이만한 음식이 또 없을 거예요.\\n김장할 때 말려서 데친 시래기로 \\n푸짐하게 끓여낸 시래기 뼈해장국.\\n해장국이지만 술안주로도 환영받는 음식이라지요.\\n보양식으로도 아주 좋아요. [재료] 돼지등뼈 2.2kg, 시래기 700g, 무 양파정도크기, 양파 1/2개, 대파 2대, 청양고추 7개, 마늘 3큰술, 생강 1쪽, 된장 3큰술, 월계수잎 5장, 맛술 3큰술, 생들깨가루 8큰술, 물 3L\\n[양념] 고춧가루 7큰술, 소금 1큰술, 국간장 2큰술, 까나리액젓 1큰술, 마늘 2큰술, 생강 1작은술, 물 100ml 그리고 돼지 등뼈에 보면 \\n뼈 사이에도 기름 덩어리가 많아요\\n손으로 긁으면 다 나온답니다.\\n제거하고요.\\n이번 돼지 등뼈는 살이 아주 많아요.\\n그래서 더 좋더라는요.ㅎㅎ 돼지등뼈 냄비에 담고 \\n등뼈가 물에 잠길 정도로 물을 붓고요.\\n레시피엔 이 물양은 넣지 않았어요.\\n펄펄 끓여줍니다.\\n돼지고기가 겉면이 하얗게 변할 때까지만.\\n어구구~ 핏물이랑 불순물이 둥둥 뜨는데\\n모두 제거해야겠지요.\\n\\n물 모두 따라 버리고 깨끗하게 \\n돼지등뼈를 씻어 줬어요. 냄비에 다시 담고\\n물 3L 넣으니 잠기네요.\\n생강 한쪽 마늘 3큰술,\\n월계수잎 5장, \\n된장 3큰술 넣었어요.\\n저는 된장을 넣어야 맛있더라고요.\\n대파 1대와 양퍄 1/2개도 넣었고요.\\n맛술 3큰술도 넣었어요.\\n불에 올려서 센 불로 끓이고요..\\n무도 양파 크기로 넣었어요.\\n(앗! 근데 양파 크기가 주먹보다 큰 거였어요.) 감자 5개 물 넣고 삶아줍니다. 남은 대파 1대는 3cm 길이로 청양고추는 어슷 썰고요. 시래기 삶은 것은 \\n6~7cm 정도로 잘랐어요. 볼에\\n고춧가루 7큰술에 마늘 2큰술, \\n국간장 2큰술, 까나리액젓 1큰술, 물 100ml \\n모두 넣고 양념을 만듭니다. 양념 섞어서 불린 후 시래기 넣고 양념해 둡니다. 따끈한 물 8큰술에 \\n생들깨가루 8큰술 \\n넣어 불리고요. 보글보글 시래기 뼈해장국이 마구 끓으면\\n기름 제거하고요.\\n중간 불로 40분 삶았어요.\\n대파랑 무 양파 월계수 잎 건지고요. 양념한 시래기를 넣고 \\n보글보글 20분 넘게 끓였어요. 보글보글 끓은 후 \\n감자 삶은 것과\\n대파와 청양고추를 넣어 \\n한 번 후룩 끓입니다. 뒤적뒤적~\\n후루루 폭폭 끓여요.\\n겨자장 만들기\\n겨자 2큰술을 \\n뜨거운 물에 불린 후 발효하고요.\\n거기에 물 6큰술, 간장 3큰술,\\n식초 3큰술, 설탕 1큰술 넣어 \\n겨자장을 만들었어요.\\nㅋㅋ 엄청 매워요.\']','시래기  뼈해장국  등뼈  뼈다귀해장국  뼈해장국  돼지등뼈  생강  대파  마늘  고추장  된장  후추  약간  소금  간장  청양고추  양파  약간  시래기  돼지  돼지등뼈  핏물  핏물  고추장  된장  간장  소금  후추  야채  대파  양파  생강  청양고추  시래기  핏물  동안  우리  물  양념  고추장  된장  들기름  약간  간장  후추  소금  생강  야채류  대파  청양고추  양파  물  냄비  시래기  정도  고추장  물  고추장  된장  고추가루  후추  시래기  뼈해장국  음식  음식  시래기  시래기  뼈해장국  음식  돼지등뼈  시래기  양파  대파  청양고추  마늘  생강  된장  월계수잎  소금  마늘  생강  돼지  등뼈  돼지  등뼈  돼지등뼈  냄비  물  정도  물  양  때  핏물  냄비  마늘  된장  양파  양파  물  대파  청양고추  시래기  정도  마늘  까나리액젓  양념  양념  후  시래기  물  시래기  뼈해장국  제거  불  무  양파  것  시래기  보글보글  후  삶  청양고추  물  후  간장  \\\\겨자장'),(55,'순대국','[\'순대국 끓이기 쉽네요 이 동네는 순대국밥 배달되는곳이 없어서.... 먹고는 싶은데 사러나가기 귀찮아서 모바일 장보기로 순대국 재료를 구입애서 끓여먹어 보았어요^^ [재료 (1인분) ] 시판되는 사골국물 300g, 순대, 내장, 대파, 부추소량, 들깨가루 1큰술, 새우젓 1작은술\\n[양념] 고추가루 1큰술, 다진마늘 1/2큰술, 국간장 1/2큰술, 사골국물 1큰술, 후주가루 소량 사골국물은 냄비에 물을 반컵넣어 끓여주세요 사골국이 끓는동안 뚝배기에 순대와 내장을 당아 주고, 사골국이 끓으면 뚝배기로 국물을 옮겨 끓여주세요 일명 다대기라고 하는 양념을 만들건데요 고추가루 1큰술, 다진마늘 1/2큰술, 국간장 1/2큰술, 사골국 1큰술, 후추가루 약간 뿌려 넣어주세요 뚝배기의 순대국이 끓기 시작하면 새우젓 1작은술 넣어주고 팔팔끓으면 불을끄고 파 1/3대 정도 쫑쫑 썰어 넣고, 부추도 적당하게 썰어 넣어주세요 마지막으로 들깨가루 1큰술 넣어줍니다^^\', \'초간단 순대국 만들기 뭐야.. 이 맛은 순대볶음을 해먹고 남은 순대가 있어서\\n초간단하게 완제품으로 만든 순대국\\n누구나 가능하며 누구나 프렌차이즈 이상의 맛을 느낄 수 있습니다. 너무 간단합니다 칼쓸일도 순대 썰때말곤 없고 순대는\\n식자재 마트같은 곳에서 1kg 3천원 미만짜리 많더라구요\\n1kg이면 10인분 넘게 나옵니다.\\n들깨가루와 새우젓을 사놓고 사골곰탕 몇포 사다놓으면 언제든 먹고싶을때\\n해 드실수 있습니다. [순대국] 순대 10조각 정도, 부추 약간, 청양고추 2개, 새우젓 약간, 사골곰탕 1포, 후추 약간, 들깨가루 2큰술 순대를 넣습니다.\\n10조각 정도?! 원하는만큼 너무 많이 넣으면 질려요 부추 또는 파를 넣습니다.\\n전 남자니까 부추.... ㅎㅎ 전 양념장을 안넣기에 청양고추로 매콤 칼칼함을 시중에 판매하는 1000원 안하는 사골곰탕 1포\\n넣었습니다.\\n양이 적다면 물을 좀 넣으면 되고 \\n재료가 잠길 정도면 됩니다. 들깨가루 2큰술 정도\\n이걸 넣어줘야 식당에서 먹는 맛이 완성됩니다. 간은 새우젓으로 하는것이 좋습니다.\\n소금간 해도 되는데 감칠맛의 차이가 틀립니다.\']','순대국  재료  사골국물  들깨가루  새우젓        사골국물  사골국물  사골국  뚝배기  순대  내장  사골국  뚝배기  고추가루  다진마늘     국간장     사골국  뚝배기  순대국  새우젓  정도  부추  들깨가루  순대국  맛  순대  맛  순대  분  새우젓  사골곰탕  수  순대  정도  부추  약간  새우젓  약간  사골곰탕  약간  들깨가루  순대  정도  부추  부추  청양고추  사골곰탕  물  정도  들깨가루  맛  새우젓'),(56,'전','[\'부침개 만드는법, 뚝딱! 장떡만들기~ 며칠 전에는 장떡만들기를 해봤죠. 널찍한 부침개 만드는법보다 더 간단하고 쉽게 만들 수 있는 장떡만들기는 기본적으로 고추장이랑 부침가루 그리고 물만 있으면 되는데~~ 냉장고에 부추랑 깻잎이 있길래 향 솔솔 나는 걔들도 넣고 뚝딱 만들어봤어요. 울 큰 아이가 참 좋아하는 장떡, 고추장만 잘 풀어서 숟가락 하나 크기 만큼 뚝뚝 떼어 올려 부쳐내면 되는데 어찌나 잘 먹는지 혼자서 열 개 이상을 앉은 자리에서 먹곤 해요. 사실, 그렇게 만들면 별 영양가는 없는 그냥 그런 음식이 되는 거지만 시골에서 자란 것도 아니고 특별한 추억이 있는 것도 아닌데 고추장 장떡을 정말 좋아하네요. 덩달아, 동생들도 잘 먹으니 가끔씩 아이들 간식이나 반찬으로 만들게 되고요. 자, 그럼 오늘은 장떡만들기를 해볼까요? 부추와 깻잎을 넣어주니,씹히는 식감도 다르고 또 살짝 살짝 특유의 향이 나는 게 더 좋더라고요. 파를 넣어도 좋을 것 같고, 냉장고 정리할 때 자투리 초록 채소들이 보이면 장떡만들 때 넣어주는 걸로~ [재료] 부추 조금, 깻잎 조금, 고추장, 부침가루, 차가운물, 식용유 부추와 깻잎은 잘 씻어 물기를 제거하고 너무 길지 않게 썰어주세요. (장떡의 크기를 고려해서 적당히 썰어주시면 되겠죠?) 향이 좋은 부추와 깻잎은 우묵한 그릇에 먼저 담아주세요. 고추장을 2큰술 정도 넣어주시고 부침가루도 살살 넣어주세요. 차가운 물도 적당량 넣고 고추장과 부침가루를 잘 풀어주세요. (부침개나 튀김이 더 바삭하려면 차가운 물이 필요해요.) 잘 달궈진 팬에 기름을 넉넉히 두르고 장떡 반죽을 숟가락 하나 분량 만큼만 똑똑 떼어 올려주세요.\\n부침개는 기름이 넉넉해야 맛나니까, 칼로리 생각마시고 좀 넉넉히 넣으세요. 부추랑 깻잎은 익히지 않고도 먹는 채소니까 올려놓고 바로 휘릭 뒤집어주세요. 장떡은 얇고 크기도 크지 않으니 바로 바로 뒤집어 주셔야 타지 않겠죠?\', \'시래기 전 고소하고 영양많은 제철간식 시래기장떡과 효능 오늘은 누구나 좋아하는 시래기로 전을 부쳤어요~!~\\n\\n\\n\\n\\n조금은 특별나게 시래기를 들기름과 들깨 양념을 한 다음 \\n\\n된장과 고추장으로 양념을 해서 시래기 장떡을 부쳤어요~!~~\\n\\n\\n\\n\\n겨울철 간식으로 이보다 영양 많고 좋은 간식이 있을까요~!~\\n [재료] 시래기150g 들기름1큰술 들개가루1큰술 고추장1/2큰술 된장 1/2큰술 밀가루1컵 물2/3컵, 들기름1큰술+식용유 1큰술 시래기에 들기름과 들깨가루를 석어서 조물조물 무쳐놓았어요 고추장과 된장을 넣고 밀가루나 부침가루를 넣은 다음 \\n\\n물을 부어주어 걸쭉하게 반죽을 해줍니다~!! 들기름과 식용유를 석어서 부침 기름으로 사용했어요 팬이 달구어진 다음 기름을 넉넉히 둘러준 다음 반죽을 한 큰 술씩 떠서 올려줍니다\\n\\n한쪽 면이 노릇하게 익은 다음 뒤집어줍니다\\n\\n고소 고소한 냄새가 코를 찌르는 향에 부치면서 2개를 집어먹었지 말입니다\\n\\n어쩜 요리 맛날까요~!~ 부침 종류는 부치면서 먹는 게 제일 맛나지요~\\n\\n부치면서 먹으면서 그렇게 한 다음 남는 전 한 접시 담아 놓았어요 ㅎㅎ ★시래기 효능★\\n\\n\\n\\n\\n무청을 건조할 때 식이섬유 함량이 3~4배 증가되고\\n\\n포만감을 주며 배변활동을 도와 체중관리 및 변비에 좋다~~\\n\\n\\n\\n\\n혈중 콜레스테롤 수치를 낮출 뿐 아니라 \\n\\n장내의 독소 및 노폐물을 배출시켜줍니다~~\\n\\n\\n\\n\\n비타민C와 D 칼슘과 칼륨, 엽산 함량이 높아 \\n\\n항산화 작용과 면역기능 골다공증 예방에 효과적입니다~~\\n\\n\\n\\n\\n칼슘은 무청 100g당 칼슘 함량이 무보다 약 10배 \\n\\n철분이 풍부해 빈혈에도 좋다고 합니다 고소함을 들려주고 싶을 만큼 고소한 시래기 전~장떡입니다!~\']','부침개  장떡만들기  전  장떡만들기  부침개  만드는법  장떡만들기  고추장  부침가루  물  부추  깻잎  향  뚝딱  장떡  고추장  만큼  것  것  고추장  장떡  장떡만들기  부추  깻잎  향  나  것  것  냉장고  때  때  부추  깻잎  조금  고추장  부침가루  부추  깻잎  장떡  향  부추  깻잎  고추장  부침가루  물  고추장  부침가루  부침개  물  장떡  반죽  숟가락  하나  만큼  부추  깻잎  장떡  시래기  전  오늘  시래기  전  시래기  들기름  다음  고추장  양념  시래기  장떡  식  재료  시래기  들기름  고추장  된장  부침가루  다음  반죽  들기름  식용유  석어서  팬  다음  다음  반죽  다음  향  것  다음  전  때  함량  함량  칼슘  함량  만큼  고소한  시래기  전  장떡'),(57,'소고기','[\'소고기 장조림,쇠고기 장조림, 소고기 요리(생생 정보통 황금 레시피) 안녕하세요~ 몽베이향입니다 :) 밥도둑 만들기~ 이거 하나면 밥 순삭! 소고기 장조림3 생각보다 너무 간단해서 먹고 싶을때 마다 사먹지 않고, 만들어 먹을 생각인 밥반찬 겸 술안주~ 장조림과 산적용으로는 우둔이나 홍두깨살! 저는 2배로 만들었어요. 원래는 월계수 잎이 안들어가니까 생략 하셔도 좋아요 [재료] 4인분: 장조림용 소고기(우둔살 또는 홍두깨살) 200g, 무 1/4개, 양파 1/2개, 대파 2대, 통마늘 5알, 통후추 10알, 물 2컵(종이컵), 간장 20T, 설탕 1T, 월계수 잎 4개, 메추리알 40개(390g) -꽈리고추 20개, 마늘 2~3알, 간장 2T, 설탕 2T, 물엿 2T 소고기를 100g씩 썰어주세요 (길게 찢을수 있도록 결을 잘 보고 썰어주세요) 30분 정도 물에 담가서 핏물을 빼주세요 (황금 레시피에는 이 과정이 없으니 생략 가능 합니다) 꽈리고추는 깨끗하게 씻어서 앞뒤로 포크를 이용해 구멍을 내주세요(이 과정은 레시피에 없었으므로 생략하셔도 돼요~ 하실 분은 소고기를 오래 삶을때 해주시면 돼요) 마늘 2~3알은 편썰기를 해주세요 (꽈리고추와 함께 쓸 용) 양파는 반, 무는 적당한 두께, 파는 큼직하게 썰어서 준비해 주세요 냄비에 소고기가 잠길 정도로 물을 넣고 1분 정도 데친 후 씻어주세요 냄비에 물, 양파, 무, 대파, 통마늘, 통후추, 월계수잎과 간장 10T, 설탕 1T를 넣어주세요 데친 소고기도 넣고 뚜껑을 덮어서 끓기 시작하면, 약불에서 30분 더 끓여주세요 시간이 다 되면 뚜껑을 열어서 간장 10T를 더 넣고, 메추리알을 넣고 2분 동안 끓여주세요 *간편하게 시판용 메추리알을 사용했어요 소고기를 건져내서 10분 식혀주세요 결대로 찢어 주시거나 칼로 적당한 두께로 썰어주세요 메추리알을 건져주세요 채소를 다 건져내고, 간장 양념물은 채반에서 깨끗하게 걸러주세요 간장 2T, 설탕2T, 물엿 2T에 꽈리고추를 2분 동안 1차로 볶아주세요 편마늘을 넣고 1분간 2차로 볶아주세요 걸러둔 간장 양념물에 소고기, 무, 메추리알, 꽈리고추를 넣어두고 꺼내 드시면 돼요! 완성♡\', \'<신혼요리> 맛있고 간편한 쇠고기 편채! 새콤달콤 황금비율소스! 집들이 음식추천!! (소고기요리) 아삭아삭한 야채들과 그 맛을 온전히 덮어주는 고기!\\n알록달록 예쁘기도하고, 맛은 더더욱 끝내주는 쇠고기 편채~ 익히면 익힐수록 고기가 힘이 생겨 야채들을 꽉 잡아줍니다! 반드시 이음새부터 익혀주세요~! [재료] 샤브샤브용고기 10장, 파프리카(빨강) 반개, 파프리카(노랑) 반개, 양파 1/2개, 부추 한줌, 팽이버섯 1/2개\\n[양념소스] 간장 1큰술, 설탕 1작은술, 다진마늘 1작은술, 식초 1큰술, 후추 약간, 겨자 원하는만큼 참기름, 소금,후추로 15분정도 고기밑간을 해주세요~ 비율대로 황금소스를 만들어주세요! 고기를 밑에깔고 그 위에 버섯-부추-파프리카-양파를 넣고 돌돌돌 말아주신뒤 기름을 약간두르고 고기의 이음새부터 약불에서 익혀주세요^^\']','소고  장조  쇠고기  장조  소고  소고  생각  장조  생략  소고  홍두깨살  무  양파  간장  설탕  월계수  잎  메추리알  꽈리고추  간장  설탕  소고  정도  황금  생략  꽈리고추  과정  레시피  생략  분  소고  때  마늘  꽈리고추  양파  소고  정도  물  정도  냄비  양파  무  대파  간장  설탕  소고  뚜껑  간장  메추리알  메추리알  소고  결  적당  메추리알  간장  깨끗  간장  물엿  꽈리고추  동안  간장  양념물  소고  무  메추리알  꽈리고추  쇠고기  고  맛  쇠고기  채  고  야채들  재료  반개   양파  간장  설탕  후추  고  이음새  약불'),(58,'갈비','[\'갈비 두부조림 명절 음식이 남아 있어 돼지갈비랑 두부로 간단 두부조림을 만들었어요~ [두부조림 재료] 구운 손두부 반 모 정도, 익힌 돼지갈비 1공기, 양파 반개, 매운고추 2개, 홍고추 약간, 파 반 대, 다진 마늘 1 스푼, 멸치 다시 육수 1컵\\n[양념] 맛간장 3 스푼, 고춧가루 1 스푼, 설탕 1/2 스푼 양파는 굵게 채 썰고 매운고추 홍고추 송송 파 썰고요 두부는 부친 두부인데요 큼직하게 준비하고요 익힌 돼지갈비는 적당한 크기로 찢어주고, 작은 볼에 육수 조금 넣고 분량의 양념 재료 넣어 섞어주고요 냄비에 양파 깔고 위에 두부 올리고 양념과 멸치 다시 육수를 부어 끓여요 위에 찢어 놓은 갈비 올리고 국물을 끼얹어가며 끓이고요 두부에 간이 배면 파 고추 넣고 한소끔 끓여냅니다 간단 두부조림 완성입니다~\', \'한우 갈비 찜 특별한 날에 꼭 있어야 할 것 같은 그 요리~! 한우 갈비 찜~ [재료 ] 한우 갈비 찜용 1.6kg\\n[부재료] 감자 3개, 당근 1개, 양파 2개, 표고버섯 8개, 생강 1개, 통마늘 10개\\n[소스재료] 진간장 15T, 설탕 10T, 다진 생강 2T, 후추 약간 한우 갈비를 찬물에 3시간 정도 담가 핏물을 제거합니다. (중간에 깨끗한 물로 갈아주세요.) 핏물을 제거한 갈비를 깨끗한 물에서 팔팔 끓여 건져냅니다. 부재료는 적당한 크기로 손질하고 소스도 만들어 준비합니다. 냄비에 한우 갈비, 부재료 (표고버섯, 양파제외), 소스, 잠길정도의 생수를 넣고 센 불에서 끓여줍니다. 1시간 30분 정도 경과했을 때 표고버섯과 양파를 넣고 중불에서 졸여줍니다. 윤기나는 한우 갈비 찜 완성 :)\']','갈비  두부조림  돼지갈비  두부  두부조림  두부조림  재료  정도  돼지갈비  양파  반  스푼  육수  스푼  스푼  스푼  양파  매운고추  홍고추  두부  돼지갈비  육수  재료  양파  두부  양념  멸치  육수  위  갈비  리  두부  두부조림  한우  갈비  한우  갈비  재료  한우  갈비  양파  표고버섯  설탕  생강  한우  갈비  정도  핏물  제거  갈비  깨끗  물  적당  준비  냄비  한우  갈비  부재료  표고버섯  소스  정도  표고버섯  양파  한우  갈비  완성'),(59,'오리고기','[\'간단간식 오리고기 브리또 또띠아에 오리고기와 다양한 야채들을 넣고 돌돌말아주면 간단하면서도 든든한 간식이된답니다. [재료] 훈제오리고기 1줌, 양파 1/5개, 양상추 1장, 치커리 1개, 양배추 1장, 토마토 1/2개, 또띠아 1장, 옥수수콘 1스푼, 머스타드소스 1/2t, 마요네즈 1/2t, 칠리소스 적당량, 치커리 1개 양상추는 깨끗이 다듬고 양파, 토마토, 양배추를 채썰어주세요. 또띠아는 살짝 구워주세요. 훈제오리고기는 전자레인지에 30초간 데워주세요. 부추와 함께 볶아주셔도 좋아요. 유산지위에 또띠아를 올리고 위에 양상추, 양배추, 양파를 올려주세요. 옥수수콘 1스푼에 머스타드 1/2t, 마요네즈1/2t를 섞어 올려주세요. 훈제오리고기를 올려주세요. 칠리소스를 뿌리고 토마토, 치커리를 올려주세요. 또띠아를 돌돌 말아주세요. 먹기 좋게 반으로 썰면 오리고기 브리또가 완성이되요.\', \'간단한 훈제 오리고기 부추 볶음 연로 하신 우리 어머니를 위한 반찬으로 먹을수 있는 훈제오리 고기 볶음입니다.\\n (@6894343) 참고로 데리야끼소스 레시피입니다. 훈제오리고기 300g, 부추 1/3줌, 양파 1/6개, 청양고추 1개, 식용유 약간 데리야끼소스 1큰술 양파는 채썰고 부추,고추도 썰어주세요. 훈제오리 고기는 먹기 좋은 크기로 썰어주세요. 팬에 식용유를 두르고 양파를 넣고 볶다가 오리고기도 넣고 붂아주세요. 데리야끼소스를 넣고 볶다가 부추와 청양고추를 넣고 한번 더 볶아주세요. 완성그릇에 담아주세요\']','오리고기  또띠아  오리고기  훈제오리고기  양파  양상추  치커리  양배추  토마토  또띠아        치커리  양상추  양파  토마토  양배추  또띠아  훈제오리고기  부추  또띠아  양상추  양배추  양파  옥수수콘     훈제오리고기  칠리소스  토마토  치커리  또띠아  오리고기  브리또  오리고기  부추  데리야끼소스  훈제오리고기  부추  양파  데리야끼소스  양파  부추  훈제오리  식용유  양파  오리고기  데리야끼소스  부추  청양고추'),(60,'양고기','[\'양고기 숄더랙& 양꼬치 집에서 만들기 [양꼬치] 양꼬치용 양고기 200g, 소금, 후추, 쯔란\\n[양고기(숄더랙)400g] 소금, 후추, 올리브유, 양파, 호박, 통마늘, 쯔란, 스테이크소스\', \'깨쟁이요리 양고기구이 요즘유행하는 양고기구이\\n나름비린내없애는 방법연구\\n양고기 스테이크를 집에서~\\n\\nhttps://m.blog.naver.com/yejin1108/221164447030 소금.후추를 찍어먹습니다. 양고기 300g, 마늘 3, 올리브 5, 후추 2 미림으로 10분이상\\n재워둡니다. 마늘3.집에있는 백후추\\n흑후추등 총출동! 올리브5.마늘절편3을\\n넣고 향나도록 구워줍니다. 소금조금.후추를넣고\\n앞뒤로 노릇노릇\\n구워줍니다. 맛있게 먹습니다.\']','양고기  꼬치  양고기  소금  후추  소금  후추  소금  후추  양고기  후추'),(61,'팟타이','[\'볶음쌀국수 / 팟타이 - 쌀국수 요리 태국식 정통 팟타이는 아니지만\\n한국식 재료로 간단하고 맛있게 만들 수 있는\\n볶음쌀국수 팟타이 레시피 가져왔습니다 :D\\n\\n마리텔의 백종원님 레시피를 참고했어요 :) 볶음쌀국수 / 팟타이 만들기\\n1. 쌀국수는 찬물에 불려주고 재료들을 손질해준다\\n2. 팬에 마늘과 대파를 볶다가 새우를 넣고 한편에 밀어둔 뒤 스크램블을 만들어준다\\n3. 쌀국수 면과 소스를 넣고 볶다가 면이 익으면 숙주를 넣고 볶아준다\\n※양념 : 액젓 2 큰 술, 굴 소스 2 큰 술, 설탕 2 큰 술, 물 1/2컵 \\n4. 맛있게 먹는다 냠냠♥ [주재료] 쌀국수 200g, 달걀 2개, 대파 1/2컵, 마늘 5개, 숙주 1줌\\n[선택 재료] 새우 1컵, (또는 다진 돼지고기, 닭 가슴살, 해산물 등등)\\n[양념] 액젓 2큰 술, 굴 소스 2큰 술, 설탕 2큰 술, 물 1/2컵\\n[계량] 큰 술 - 밥숟가락 계량, 컵 - 종이컵 계량, 인원 - 2인분 기준 액젓과 굴소스로\\n 한국인 입맛에 잘 어울리는 \\n볶음 쌀국수 만들기 ♬♪ · 쌀국수는 찬물에 약 30분가량 불려둡니다 · 숙주는 깨끗이 씻어 \\n물기를 빼 주고 · 냉동새우는 실온에 해동시켜 줍니다 · 대파는 다져주고 · 마늘은 편으로 썰어줍니다 · 팟타이 양념을 만들어 줍니다\\n\\n\\n※ 팟타이 양념\\n【 액젓 2 큰 술, 굴 소스 2 큰 술, 설탕 2 큰 술, 물 1/2컵 】 \\n\\n\\n-밥숟가락 계량 · 팬에 기름 두 바퀴 두르고 \\n마늘과 대파를 볶아줍니다 · 향이 나기 시작하면 \\n새우도 넣고 볶볶 · 볶고 있던 재료를 한 쪽으로 밀어놓고\\n달걀을 풀어서 뒤집개나 나무젓가락으로 저어주며 스크램블을 만들어줍니다 · 불려놨던 쌀국수 면과 소스를 넣고 계속 볶아줍니다 면이 다 익었을 때쯤 숙주는 마지막에 넣고 원하는 만큼 익혀주면 완성!!! 집에 있는 한국식 재료로\\n간단하게 만들어 맛있게 먹는\\n볶음 쌀국수 / 팟타이\', \'팟타이 볶음쌀국수 쌀쌀한 날씨엔 따뜻한 국물요리도 좋지만 팬에 지글지글 볶아낸 뜨거운 볶음요리도 참 좋은 궁합인 것 같아요~ 특히 반찬류 보다는 한끼 식사로 먹을 수 있는 볶음요리가 더 좋은데요! 볶음요리 중 가장 쉽게 만들 수 있는 팟타이를 소개해드리겠습니다. 팟타이는 소스와 면 외에 들어가는 재료들은 원하는 재료를 마음껏 넣을 수 있다는 점이 장점이죠~ 정원이는 남은 재료들로 한번 만들어볼 테니 같이 만나보시죠! [재료] 백만송이 버섯 50g, 브로콜리니 2줄기, 숙주 50g, 계란 2개, 레몬 슬라이스 1조각, 청홍고추 각1/2개, 표고버섯 1개, 라이스누들 (팟타이용) 80g, 참기름 1/2 작은술, 카놀라유 1큰술, 팟타이소스 종이컵1/2컵 라이스누들은 찬물에 30분정도 불린다. 표고, 청홍고추를 얇게 썰고 브로콜리니를 반으로 자른다. 팬에 카놀라유를 두르고 계란을 넣어 스크램블 에그를 만들어 잠시 식힌다. 나머지 야채, 라이스 누들, 팟타이 소스를 넣고 중불로 약 1분정도 볶다가 숙주, 스크램블 에그, 참기름을 넣고 강불로 살짝 볶아 접시에 담는다. 청, 홍고추, 레몬 슬라이스로 장식한다.\']','쌀국수  팟타  재료  수  팟타  레시피  팟타  쌀국수  찬물  재료들  팬  마늘  대파  스크램블  쌀국수  면  소스  면  숙주  액젓  술  소스  술  설탕  술  쌀국수  대파  마늘  숙주  재료  새우  액젓  술  소스  술  설탕  술  술  계량  계량  액젓  쌀국수  쌀국수  찬물  숙주  대파  마늘  팟타  팟타  액젓  술  소스  술  설탕  술  계량  팬  대파  재료  스크램블  쌀국수  면  소스  면  숙주  쌀국수  볶음쌀국수  팬  볶음요리  수  볶음요리  볶음요리  수  팟타이  팟타  소스  면  재료들  재료  수  재료들  재료  숙주     술  라이스누  찬물  청홍고추  브로콜리니  팬  카놀라유  계란  스크램블  팟타  소스  약  숙주  스크램블  참기름  레몬  슬라이스'),(62,'생선구이','[\'가자미구이 오늘의 메뉴는 생선구이 세일 행사로 마트에서 4마리에 6,900원에 가자미를 구입. 다른 사람이 한거 먹기만 했지 내 손으로는 처음 사봤어요. 원래 얼마인지는 잘 모르겠지만 일단 세일이라고 해서 사들고 왔답니다. 찜을 할까 구이를 할까 살짝 고민을 했지만 간단한 가자미구이로 튀겨줬습니다. [재료] 가자미, 전분가루, 기름, 간장, 레몬 4마리 중 2마리만 해보려고 합니다. 마트에서 손질을 다 해서 팩에 넣어서 팔아서 집에서는 씻기만 했어요. 앞뒤로 칼집을 내줬어요. 그럼 안까지 잘 익기도 하고 빨리 익기도 하겠죠? 팬에 기름을 두르고 전분가루를 가자미에 묻혀줍니다. 밀가루로 하셔도 됩니다, 앞뒤로 뒤집어가면서 중약불에 천천히 노릇하게 튀겨주세요. 굽고 보니 칼집을 너무 크게 냈나 봐요..^^;;\', \'광어스테이크:우아~한 생선구이 도톰하게 썰어 냉동시킨 광어를 구워\\n멋스런 생선스테이크를 만들었어요.\\n [재료] 냉동광어 150그램, 레몬즙+소금+후추, 밀가루(부침가루) 2큰술, 식용유 1큰술, 버터+다진마늘 1큰술+1작은술, 파슬리가루+통깨, 어린잎채소 50그램, 토마토(소) 1개\\n[견과마요네즈] 마요네즈 1~2큰술, 하루견과 1/2봉, 우유 1큰술, 꿀 1큰술, 맛간장 1큰술\\n[레몬드레싱] 레몬청 1큰술, 올리브오일 1큰술, 소금+후추 조금씩 광어에 레몬즙과 소금,후추 뿌려 30분이상 냉장고에 둔다. 마리네이드한 광어에 밀가루를 골고루 얇게 묻힌다. 달군 팬에 식용유를 두르고 앞뒤로 노릇노릇 굽는다:아직 속까지 완전히 익지는 않은 상태. 버터와 다진마늘을 넣고 앞뒤로 한번더 구운 후 불을 끄고 잔열로 마저 익힌다 냄비에 소스 재료를 모드 담고- 핸드믹서로 갈아준 후 ㅡ 중약불에서 저어가며 끓인다. 접시에 어린잎채소를 펼쳐담고 한쪽에 토마토를 썰어 올리고 레몬청드레싱을 뿌린다. 샐러드 옆에 광어스테이크를 올리고\\n소스를 얹고 파슬리가루와 통깨를 뿌린다.\']','가자미  세일  재료  가자미  앞뒤  전분가루  가자미  앞뒤  칼집  생선구  광어  재료  광어  광어  밀가루  팬  식용유  앞뒤  앞뒤  재료  후  중약불  어린잎채소'),(63,'알탕','[\"탱탱한 알과 얼큰한 국물! 알탕 맛있게 끓이기! 안녕하세요 ~ 시윤입니당 \'0\'\\n가끔 일식집이나 횟집에서 먹었던 알탕을 직접 만들어봤는데요~\\n밥이랑 먹어도 좋고',' 술안주로도 좋은 알탕 레시피 시작해볼게요 ❛ ڡ ❛ 얼큰한 국물에 탱탱한 알을 품은 알탕이 완성되었어요 \'0\'\\n평소에 알을 너무 좋아해서 알탕만큼 좋아하는 음식도 없었는데'),(64,'떡갈비','[\'부모님 생신 상차림! 우엉 떡갈비 레시피 다이어트에 좋은 채소인 우엉!!\\n우엉 손질만 하고나면 간단한 레시피라 따라하시기 좋아요~\\n부모님이나 어르신들께 해드리면 정말 좋아하실 레시피입니다~ 건강한 느낌의 밥상이라서 부모님이나 어르신들에게\\n식사를 대접할 일이 있을 때 만들어보시면 좋습니다! [재료] 다진고기 140g, 설탕 1t, 간장 2t, 후추 톡톡, 깨소금 톡톡, 다진마늘 1T, 우엉 만들고 싶은 수량.., 밀가루, 참기름, 당근 맘대로.., 파 맘대로.., 소금,후추 톡톡, 식초물 고기와 재료들을 조물조물 할거에요.\\n크기가 적당한 볼에,\\n설탕 1t, 간장2t, 후추, 깨소금 톡톡, 다진마늘 1T를 넣어주시고, 다진고기 140g를 넣어서 조물조물해주세요. 우엉을 손질해줄 차례에요.\\n감자칼이나 그냥 칼을 이용해서 껍데기를 까주세요. 우엉은 갈빗대가 될 부분이에요.\\n메인 사진을 잘 보시면, 갈빗대가 뼈가 아니고 우엉을 고기 사이에 껴두는 거니, 잘 상상하셔서 썰어주세요!\\n\\n우엉 양은 먹고 싶은 수량의 갈빗대 만큼!!\\n남은 우엉은 그냥 구워드셔도 맛있습니다! 식초물에 담가뒀던 우엉을 빼시고,\\n밀가루를 발라줄 차례입니다.\\n밀가루 양은 갈빗대로 사용할 우엉을 다 발라줄 수 있을 정도? 우엉에 밀가루를 발라주는 이유는 고기가 잘 붙을 수 있게 하기 위해서에요.\\n골고루 잘 발라주셔야 고기가 잘 붙겠죠? 밀가루를 발라준 우엉에 다진 고기를 이런 모양으로 붙여주시면 됩니다!!\\n진짜 뼈인줄... ㅎ\\n먹기 전에 아무도 모릅니다. 우엉갈비와 같이 구워줄 당근과 파에요!!\\n한입이 집어먹기 좋은 크기로 썰어주시면 됩니다!\\n\\n색감 때문에 삼색 당근을 사봤어요~ 굽기 시작!!\\n팬에 참기름을 둘러주시고, 우엉갈비를 올려서 구워주세요!!\\n다 익기전에 탈 수 있으니 센불은 피하시고!! \\n중불에 익히시면됩니다. 갈비가 노릇노릇하게 제대로 익었으면,\\n갈비는 옆으로 빼주시고, 채소를 굽기 시작하면됩니다!!\\n소금, 후추도 살짝씩 뿌려주세요~ 당근은 익으려면 오래 걸리니\\n뚜껑을 닫아서 찌는 느낌으로 구워도 좋습니다. 플레이팅만 하시면 끝!!!\\n다음 레시피에 올리겠지만, 우엉밥과 같이 해드시면 좋답니다~\', \'소갈비살을 다져서 만든 떡갈비 소갈비살 2키로를 칼로 다져서 아이들이 좋아하는 떡갈비 만들어 봤어요~\\n명절에 갈비찜 대신 먹어도 될거 같아요~ 저는 소갈비살을 다져서 사용했지만 소고기 다짐육을 사용해서 만들어도 됩니다~\\n [재료] 소갈비살 2kg, 떡볶이떡 10개, 찹쌀가루 4큰술\\n[떡갈비양념] 진간장 1컵, 물 1컵, 요리당(올리고당) 1/2컵, 사과 1/2쪽, 양파 1/2개, 생강 1톨, 통마늘 7개, 요리당(추가분) 3큰술, 후춧가루 조금, 참기름 2큰술 소갈비살 1키로 2개를 다집니다. 손질이 안 된 갈비살입니다.\\n칼로 열심히 다져줍니다. 조금씩 잘라가며 칼로 다져주면 하기 더 편합니다.\\n힘줄과 질긴 부분 칼로 잘라주면 부드러운 떡갈비가 됩니다. 2키로 모두 다지니 양은 이만큼 되었어요~ 떡갈비 양념을 모두 넣고 믹서기에 갈아줍니다. 믹서기에 갈아서 거품은 조금 있지만 시간이 지나면 거품은 사라져요~ 가래떡이 없어서 집에 있는 떡볶이떡 쌀떡으로 준비했어요.\\n딱딱하니 끓는물에 한번 데쳐서 말랑말랑하게 만들어 준다음 칼로 다져줍니다. 다진 고기에 떡을 넣어줍니다. 떡갈비 양념을 넣어주는데요.\\n너무 질지 않게 넣어주면 됩니다.\\n5국자 정도 넣어주었어요. 떡갈비는 달달해야 하기 때문에 요리당 3큰술 추가 해줍니다. 후춧가루도 조금 뿌려주고 참기름 2큰술도 넣어줍니다. 그냥 치대도 뭉쳐지긴 하지만 찹쌀가루를 넣어 치대면 잘 뭉쳐집니다.\\n찹쌀가루 4큰술 정도 넣어줍니다. 이제 골고루 치대줍니다.\\n오래 치대야 잘 뭉쳐져요~ 이제 동그랗게 빚어줍니다.\\n동그랗게 빚은 다음 가운데 부분을 꾹 눌러주세요. 그릴팬에 기름 살짝 두르고 떡갈비 올린다음 구워줍니다. 뚜껑 덮고 약불로 오래 익혀준다음 뒤집어 또 익혀주면 떡갈비 완성입니다~\']','우엉  떡갈비  레시피  우엉  손질  레시피  부모님  후추  톡톡   톡톡   우엉  밀가루  참기름  당근  후추  톡톡   고  후추  깨소금  톡톡   다진마늘  다진고  우엉  손질  칼  우엉  갈빗대  부분  갈빗대  우엉  고  양  수량  갈빗대  우엉  식초물  우엉  차례  양  갈빗대  사용  우엉  수  정도  우엉  밀가루  고  수  고  밀가루  우엉  고  뼈  당근  파  당근  참기름  우엉갈비  수  채소  후추  당근  레시피  떡갈비  소갈비살  칼  떡갈비  소갈비살  사용  사용  재료  소갈비살  참기름  소갈비살  손질  칼  부분  칼  떡갈비  양  떡갈비  믹서  거품  떡볶이떡  칼  고  떡갈비  양념  정도  떡갈비  때문  후춧가루  참기름  치  찹쌀가루  치  정도  치  부분  떡갈비  떡갈비'),(65,'쭈꾸미','[\'주꾸미 볶음 만드는 법, 매콤한 쭈꾸미볶음 하나면 반찬이 필요 없어요 ~ 몸이 나른하고 피곤할 땐, 기운을 북돋아줄 제철 요리를 팍팍 먹어주는 게 최고 ~ \\n\\n그래서 오늘은 주꾸미를 이용한 요리 레시피 하나를 준비해보았어요.\\n [재료] 주꾸미 10마리 정도, 송송 썬 대파 1대, 양파 1/2개, 표고버섯 2 개, 당근 1/4개, 통깨 약간, 쪽파 약간, 참기름(선택) 1 큰 술\\n[양념장] 고추장 3 큰 술, 고춧가루 2 큰 술, 설탕 1 큰 술, 올리고당 1/2 큰 술, 다진 마늘 1 큰 술, 후춧가루 적당량, 깨소금 적당량, 다진 청양고추 취향껏 주꾸미는 손질을 먼저 해주세요.\\n\\n손질법은 아래를 클릭해주세요\\n@6886819 물기 없는 주꾸미 볶음을 원하시는 분들은 저처럼 끓는 물에 주꾸미를 가볍게 한 번 데쳐 준비해주시고요.\\n\\n잘 데쳐진 주꾸미는 먹기 좋은 크기로 잘라주세요. 야채도 손질합니다.\\n\\n대파는 송송 썰어주시고, 양파와 당근, 표고버섯은 슬라이스해주세요 ^^ 고추장 3 큰 술, 고춧가루 2 큰 술, 설탕 1 큰 술, 올리고당 1/2 큰 술, 다진 마늘 1 큰 술, 후춧가루 적당량, 깨소금 약간 넣고 잘 섞어서 양념장을 만들어주시고요.\\n\\n좀 더 칼칼하게 즐기고 싶으신 분들은 다진 청양고추를 넣어주세요 ^^\\n\\n저는 신랑이 너무 매운 음식은 잘 못 먹어서 안 넣었어요. 데친 주꾸미와 양념장을 잘 섞어서 준비하고요. 중불로 예열한 팬에 식용유 3-4 큰 술과 송송 썬 대파를 넣고 고소한 파기름을 만들어줍니다.\\n\\n이어서 양파와 당근을 넣고 가볍게 볶아주세요. 양파의 숨이 살짝 죽으면 양념한 주꾸미와 버섯을 넣고 휘리릭 볶아주세요.\\n\\n(너무 오래 익히면 주꾸미가 질겨지니 적당히 볶아주세요 ^^) 그러면 요렇게 먹음직스러운 주꾸미볶음이 완성된다는 ~ ^^ 오래간만에 먹는 매콤한 주꾸미 볶음에 뽕림이 부부는 젓가락을 들고 전투 모드에 돌입 ~ \\n\\n순식간에 주꾸미 볶음을 정복했다죠 ㅎㅎㅎㅎ\', \'쭈꾸미숙회 만드는 법, 주꾸미 손질법도 함께 배워봐요 ^^ 오늘은 제철 맞은 주꾸미를 이용해 맛있는 주꾸미숙회를 만들어보았어요.\\n\\n타우린이 풍부하게 함유되어 있어 피로회복에 도움을 주고, 불포화 지방산을 다량 함유하고 있어 콜레스테롤 감소에도 효과적인 주꾸미!\\n\\n거기다 칼로리는 낮고 필수 아미노산은 풍부하다 보니 다이어트 식품으로도 인기 만점이라고 하죠 :) [재료] 주꾸미 8마리, 밀가루 1 큰 술, 쪽파 한 줌, 초고추장 적당량 그럼 쭈꾸미부터 손질해볼게요.\\n\\n손질에 필요한 도구는 가위! 먼저 머릿속 내장부터 제거합니다.\\n\\n뒤통수를 들어보면 사진에서처럼 머리와 몸통을 이어주는 살 부분이 있는데요.\\n\\n이 부분을 가위로 잘라내야 머리통을 쉽게 뒤집을 수 있어요.\\n\\n내장과 알이 터지지 않도록 머릿속에 조심스레 가위를 집어넣어 잘라주시고요. 머리가 잘 안 뒤집어진다 싶으면 뒤통수 부분을 세로로 반 정도 잘라 뒤집어주세요.\\n\\n하얀 네모로 표시해 둔 부분이 쭈꾸미의 알인데요.\\n\\n요게 또 별미이기 때문에 알 부분은 살리고, 내장만 제거하도록 할게요. 내장과 머리를 이어주는 양쪽의 얇은 막을 제거하고 나면 세 번째 사진에서처럼 약간의 공간이 생기는데요. \\n\\n이 공간으로 가위를 집어넣은 다음 알과 내장을 이어주는 얇은 막의 경계를 잘 보고 조심스레 잘라내주세요.\\n\\n잘못하면 알이 터질 수 있으니 정신집중!!! +_+ 알과 내장이 잘 분리되었다면 이제 몸통과 내장을 잇고 있는 살부분을 잘라 내장을 완전히 제거해주세요.\\n\\n그리고 나서 다시 머리를 뒤집어주세요.\\n\\n(알이 머리에서 분리되지 않도록 조심해주세요 ^^) 이제 가위로 눈알 부분을 도려내주시고요. 다리 가운데에 있는 딱딱한 입도 제거해주세요.\\n\\n(반대쪽을 꾹 눌러주면 톡 튀어나와요.) 이제 주꾸미를 세척해주도록 할게요.\\n\\n밀가루 한두 큰 술과 물을 약간 넣고 빨래 빨듯이 박박 문질러줍니다.\\n\\n(빨판 속 불순물 제거가 수월하도록 다리 부분은 비벼 빨아주세요 ^^)\\n\\n\\n마지막으로 흐르는 물에 하나하나 깨끗이 씻어주기만 하면 주꾸미 손질법 끝!!\\n\\n(머리 부분과 빨판 부분은 좀 더 신경 써서 세척해주세요.) 손질한 쭈꾸미는 끓는 물에 넣고 가볍게 데친 후 체에 밭쳐 물기를 빼주시고요.\\n\\n먹기 좋은 크기로 잘라 맛있게 드시면 돼요 ^^ 단독으로 즐겨도 좋지만, 데친 쪽파와 함께 먹으면 더욱 좋은 쭈꾸미숙회 ♩ 주꾸미 숙회를 보니 갑자기 소주가 급 땡긴네요 +_+\']','주꾸미  요리  준비  주꾸미  양파  당근  약간  쪽파  약간  술  술  술  술  술  적당량  적당량  주꾸미  손질  주꾸미  물  주꾸미  준비  주꾸미  손질  양파  당근  표고버섯  고추장  술  고춧가루  술  설탕  술  올리고당  술  마늘  술  후춧가루  적당량  깨소금  들  청양고추  주꾸미  양념장  준비  술  대파  \\\\\\\\  양파  당근  양파  주꾸미  주꾸미  매콤한  주꾸미  주꾸미  법  주꾸미  오늘  제철  주꾸미  이용  함유  주꾸미  수  풍부  재료  주꾸미  술  쪽파  적당량  필요  가위  내장  제거  머리  부분  \\\\\\\\  부분  가위  수  알  머릿속  가위  머리  부분  정도  부분  부분  내장  제거  내장  머리  제거  번  사진  약간  \\\\\\\\  공간  가위  알  내장  막  알  수  알  내장  몸통  내장  내장  제거  머리  머리  분리  가위  부분  제거  주꾸미  할게요  술  물  제거  다리  부분  물  주꾸미  손질법  부분  부분  세척  손질  쭈꾸미  물  쪽파  주꾸미  +_+'),(66,'만두','[\'김치만두전골 만들기, 만두 요리, 김치요리, 만두전골 끓이는 법, 국물요리, 손님 초대요리 김치만두전골 만들기, 만두 요리, 김치요리, 만두전골 끓이는 법 ,국물요리, 육수만 있으면 금방 끓이기도 하고, 김치만두 전골, 오늘 냉장고 정리를 했더니 재료들이 눈에 더 잘 들어오더라고요 그냥 집에 있는 재료를 이용하여 얼큰 시원한 김치만두전골을 끓였습니다. 쉬운 레시피인 것 아시죠? 손님 초대요리로도 손색없을 것 같아요. 누구나 쉽게 만들수 있습니다. [전골 육수] 물 500mL, 황태채 20g, 마른다시마, 국간장 1T, 간 마늘 0.5T, 고춧가루 1T, 가쓰오부시 1T, 건표고 2개, 곤약 50g, 만두 5개, 팽이 10g, 김치/묵은지 50g, 홍고추 1개, 대파 1줄기, 라면 1/2개 물에 마른 다시마, 황태채, 가쓰오부시를 넣습니다. 이 중에 없으면 안 넣어도 되고 집에 육수 낼만한 건 다 좋아요. 건새우도 좋고 다시 멸치도 좋아요. 부담 갖지 말고 마구 넣어주세요. 물 500mL에 국간장 1T, 간 마늘 0.5T 고춧가루 1T 넣고 끓여줍니다. 그러면 육수 끝입니다. 체에 한번 걸러줍니다. 직접사용한 국물은 300mL정도될듯해요 은화고 버섯인데요. 표고로 가능합니다. 버섯은 생물일 때는 모양내기가 쉽지 않아요. 살짝 얼려서 칼집을 내어주면 예쁘게 칼집을 낼 수 있습니다. 곤약은 50g 물에 헹구고 먹기 좋은 크기로 잘라줍니다. 팽이, 곤약, 만두, 묵은지 김치는 먹기 좋게 잘라서 예쁘게 담아주고 포인트 될만한 홍고추, 파를 넣어줍니다 홍고추는 물에 씻어서 씨를 제거하고 넣으면 좋아요. 팽이는 밑동 제거하고 반 잘라서 바닥에 깔아주었어요. 체에 걸러진 육수를 붓고, 중불에 라면 끓을 정도로 5~6분 정도 끓여줍니다. 먼저 끓이고 있다가 끓기 시작하면 면을 넣어주면 좋아요. 육수만 부어주면 되니 모양도 그대로 예쁘고 쌀쌀해지는 요즘 국물요리로 딱 좋아요.\', \'냉동만두 요리 구워서 소스 올려먹는 만두 어제 마트 다녀왔는데 냉장고는 텅~ 하하하... 어제 장을 뭘 본거냐!!! 냉동실에 있는 만두 2봉지가 보여서 이걸로 뭔가 해먹어야겠는데 뭘 해야할지 굽고 찌고 튀기고... 그래서 오늘은 응용을 해서 냉동만두 요리를 만들어봤습니다. [재료] 냉동만두, 굴소스, 탄탄면소스, 식초, 물, 설탕, 간마늘, 양파, 대파, 청양고추, 홍고추, 기름 굴소스 1, 탄탄면소스 2, 식초 3, 물 3, 설탕 2, 간마늘 1/2를 넣고 잘 저어둡니다. 양파 1/4, 청양고추 1, 홍고추 1, 대파는 썰고 만든 양념에 넣고 섞어줍니다. 무슨맛일까 싶어서 찍어먹어보니 칼칼하니 중국풍(?) 맛이 나더라고요. 굴소스와 탄탄면소스가 들어가서 그렇겠죠??? 탄탄면소스 어디에 먹나 했더니 요렇게 저렇게 먹어가고 있답니다. 작은팬에 넣고 소스를 바글바글 끓여줘봤어요. 그리고 여기서 갈등을 했지요. 전분물을 조금 넣어볼까? 말까? 망설이다가 결국은 그만 두었지만요. 전분물을 넣어서 걸죽하게 했으면 만두깐풍기가 되었을수도 있겠네요. 만두는 튀겨주는데 기름이랑 물을 넣고 튀기듯이 구웠는데 기름이 여기저기 튀고 난리가나서 뚜껑을 덮어줬어요. 3면을 뒤집어주면서 노릇하게 구웠어요. 그러면 소스도 만들고 만두도 익혔으니 다했네요. 플레이팅만 하면 만두활용 요리 완성입니다.\']','김치만두전골  만두  요리  국물요리  김치만두전골  만두  요리  김치요리  만두전골  법  국물요리  육수  김치만두전골  것  손님  초대요리  것  수  전골  육수  만두  팽이  홍고추  대파  물  가쓰오부시  집  육수  국간장  마늘  고춧가루  육수  칼집  수  곤약  물  팽이  만두  만  홍고추  물  팽이  제거  체  육수  라  정도  육수  국물요리  냉동만두  요리  소스  만두  냉장고  어제  것  만두  뭐  오늘  냉동만두  요리  재료  냉동만두  물  대파  홍고추   탄탄면소스  식초  설탕  양파  홍고추  대파  굴소스  탄탄면소스  탄탄면소스  소스  전분물  수  만두  물  소스  만두  요리'),(67,'샐러드','[\'아삭이 고추 샐러드 비타민이 풍부한 아삭이 고추와 성인병 예방에 좋은 호두와 완전 식품이라고 하는 계란으로 초 간단 샐러드를 만들어 봤습니다.\\n제 아침 식사 이기도 합니다.ㅎ 아삭이 고추는 물기를 닦아주세요.\\n구운 계란은 껍질을 까주세요. 아삭이 고추는 한입 크기로 썰고.계란도 썰어주세요. 완성 그릇에 담고 호두알도 담아 주세요. 마요네즈 1큰술.허니 머스더드 1작은술.꿀 1작은술.매실청1작은술을 섞어서 비닐에 넣고 끝 부분을 약간 잘라 준후 그위에 뿌려 주세요.\', \'상큼한 감귤 소스와 샐러드 탕수육 만드는 방법~! 상큼한 감귤 소스와 샐러드 탕수육 만드는 방법~! [재료] 감귤주스 1병, 양상추 1개, 돼지고기등심 300g, 당근 1/4개, 노랑 파프리카 1/4개, 빨강 파프리카 1/4개, 어린잎 1줌, 레몬 1/2개 첫째로 물 녹말을 만들어 줄 텐데요 스탠 볼에 옥수수전분 7t와 물을 넣고 녹말이 충분하게 물을 먹을 수 있도록 물을 넣어주신 다음 소스를 만들어 줄 건데요 냄비를 준비해주신 다음 감귤주스 500ml를 넣고 레몬 반 개를 손으로 꽉 눌러서 짜주신 다음 설탕 3t 식초 3t 레몬수 2t 소금 살짝 넣어주신 다음 보글보글 끓어오르면 녹말물을 넣어서 농도를 만들어주신 다음 바로 냉장실에 넣어주세요~! 샐러드 위에 뿌려서 먹을 거니까 시원해야 더 맛있겠죠!? 양상추는 손으로 한 입 크기로 찢어주신 다음~ 당근은 얇게 채 썰고 소스에 들어갈 파프리카는 0.5*0.5cm 큐브 모양으로 썰어주세요 저는 좀 크게 했는데 ㅜㅜ 안 예쁘더라고요 좀 더 작아야 좋을 것 같아요~! 고기는 1cm로 썰어주세요 ㅎㅎ 여기까지 하시면! 재료 손질 끝~! 양상추에 어린잎 올리고 채 썰어 주신 다음~ 물을 받아서 아까 안 씻은 양상추와 어린잎을 씻어주시면서 물속에서 야채들이 예쁘게 잘 섞일 수 있도록 해주세요 ㅎㅎ 카메라는 정말 어려운 것 같아요... 이건 왜 이렇게 어둡게 나온거죠....ㅜㅜㅜ 시간이 지나면 이렇게 녹말 이층과 물 측이 분리가 돼요 조심스럽게 물만 버려주신 다음 계란 흰자 1t와 소금 살짝 넣어서 반죽에 간을 해주세요 계란 흰자는 안 넣으려 했지만.. 옆에서 친구가 넣으면 더 맛있다는... 성화에 못 이겨... 흰자 1t만 넣었어요 ㅜㅜ 사진처럼 밑간 된 반죽에 고기를 넣고 조물조물 잘 버무려 주세요! 그리고 160도에서 170사이에 온도가 올라오면 고기를 넣고 튀겨주세요! 저는 튀겨서 바로 먹을 거라서 재벌은 안 하고 초벌만 한번 했어요 ㅎㅎ 좀 더 바삭한 식감을 원하시면 165도에서 초벌 해주신 다음 180도에서 빠르게 재벌 해주시면 좀 더 바삭하게 만들어 드실 수 있어요~!\']','고추  샐러드  아삭  고추  계란  샐러드  아삭  고추  계란  아삭  고추  계란  소스  샐러드  감귤  소스  샐러드  탕수육  방법  양상추  파프리카  파프리카  어린잎  녹말  물  녹말  물  수  물  다음  소스  다음  감귤주스  레몬  다음  다음  다음  샐러드  것  양상추  손  다음  당근  소스  파프리카  것    재료  끝  양상추  어린잎  채  다음  물  양상추  어린잎  물  수    것  이  녹말  리  물  다음  계란  자  소금  계란  자  자    반죽  고  저  것    초벌  다음  재벌  수'),(68,'아구찜','[\'겨울에 생각나는 매콤한 아귀찜만들기 / 아구찜 만드는법 황금레시피 재료: 아귀 한 마리 (중자 크기). 미나리 한단, 찜용 콩나물 600g( 작은 거 두 봉지), 만득이 한봉, 대파, 청양고추 6개 / 양념: 다진 마늘 1 큰 술, 생강가루 1/2수저, 후추, 고춧가루 7 큰 술, 찹쌀가루 2수저, 물, 간장 2수저, 천일염 조금, 참기름 3수저\', \'매콤매콤 아구찜 날 덥다고 자꾸 찬 음식만 찾게되는 요즘인데요\\n오늘은 매콤하게 먹고 땀 흘리고나면 더위도 저만큼 물러나는 매콤 아구찜 만들어 봅니다\\n술 한 잔을 부르는 안주로도 굿이지요 ㅎㅎ [재료] 아구 1마리, 콩나물 200g, 대파 1/2개, 미나리 30g, 당근 1/4개, 청고추 1개, 홍고추 1/2개\\n[양념] 국간장 1T, 고춧가루 5T, 된장 1T, 고추장 1T, 맛술 1T, 매실액 1T, 다진마늘 1/2T, 생강즙 1t, 소금 1t, 후춧가루 1t, 들깨가루 1/1컵, 녹말가루 1T 콩나물은 머리꼬리 떼고 끓는물에 소금넣고 데쳐서\\n건져 놓아요 아구는 손질해서\\n청주, 소금, 후춧가루로 살짝 밑간해 놓습니다 손질된 아구를 넣고 양념장도 넣어 줍니다\\n\\n양념장 : 국간장, 고춧가루, 된장, 고추장, 맛술, 매실액, 다진마늘, 생강즙넣고 만들어 숙성해서 사용 합니다 육수 또는 생수부어 뚜껑덮고 끓여 줍니다\\n저는 다시마육수 사용 했어요 바글바글 끓으면 데친 콩나물넣고 \\n잠시 끓여요 대파, 미나리, 당근, 청고추, 홍고추를 넣고 잘 섞어 잠시 끓여요 들깨가루 듬뿍넣고 잘 섞은 후\\n물녹말로 농도조절해 마무리 합니다\\n\\n마지막에 참기름 한 방울 둘러요\']','아구찜  미나리  콩나물  대파     고춧가루  술  아구찜  아구찜  재료  콩나물  대파  미나리  고춧가루        콩나물  소금  후춧가루  아구  국간장  고춧가루  된장  고추장  매실액  사용  대파  미나리  당근  홍고추  들깨가루  참기름'),(69,'쌈밥','[\'월남쌈으로 왕삼겹살 쌈밥 만들면 색다른 맛이예요 :) 흔히 삼겹살을 먹을 때 상추에 밥을 넣어서 양파와 마늘 등등을 넣고 쌈 싸서 많이들 먹잖아요! \\n하지만 그 일반적으로 많이 싸서 먹는 고기쌈밥에 월남쌈으로 한 번 더 \\n둘러줘서 먹으면 색다른 식감과 함께 신세계적인 쌈밥의 맛을 느끼실 수 있어요! [재료] 월남쌈 4장, 밥 2공기, 상추 8장, 고추장 2숟갈, 양파 1/2개, 참기름 1숟갈, 삼겹살 적당량, 식용유 약간 월남쌈으로 왕삼겹살 쌈밥을 만들기 위해 필요한 재료들을 알려드릴게요! 먼저 양파 1/2개를 깨끗이 씻어서 사진과 같이 잘라주세요! 달궈진 프라이팬에 식용유 적당량을 넣어주세요. 썰어준 양파를 프라이팬에 모두 넣어주세요. 그리고 약한 불에서 5분 정도 볶아줍니다.\\n양파의 숨이 약간 잦아들 정도까지만 볶아주세요! 볶아준 양파는 그릇에 담아주세요. 이번에는 삼겹살을 구울게요!\\n깨끗한 프라이팬에 아무것도 넣지 않은 상태로 가스불을 켜서 프라이팬을 달궈주세요. 프라이팬이 어느 정도 달궈졌으면 삼겹살을 올려서 앞뒤로 뒤집어가면서 노릇노릇하게 구워주세요! 삼겹살이 아주 통통합니다 ^^ 노릇노릇하고 먹음직스럽게 삼겹살이 잘 구워졌어요! 이번에는 왕삼겹살 쌈밥에 들어갈 고추장밥을 만들어줄 거예요!\\n밥 2공기와 참기름 1숟갈, 고추장 2숟갈을 준비해주세요. 밥 2공기에 참기름 1숟갈과 고추장 2숟갈을 모두 넣어줍니다. 골고루 섞어주시면 왕삼겹살 쌈밥에 들어갈 고추장밥이 완성됩니다! 이제 왕삼겹살 쌈밥을 만들 모든 재료의 준비가 완료됐습니다!\\n지금부터 왕삼겹살 쌈밥을 만들어보도록 할게요. 먼저 접시에 월남쌈 1장을 준비해주세요! 월남쌈 1장을 물에 충분히 담가서 촉촉하게 만들어주세요! 촉촉하게 적셔진 월남쌈 1장을 접시에 올려줍니다. 그 위에 상추 2장을 사진과 같이 맞물려서 올려주세요! 고추장과 참기름을 넣고 섞은 고추장밥을 상추 위에 \\n적당량 올려서 꾹꾹 눌러줍니다. 고추장밥 위에 볶은 양파도 적당량 올려주세요. 마지막으로 양파 위에 삼겹살까지 올려주세요!\\n내용물을 너무 많이 넣으면 잘 안 말리고 내용물이 밖으로 잘 튀어나오니 적당량만 넣어주시는 게 좋아요 ^^\\n그리고 제일 밑에 깔려져있는 월남쌈을 잘 잡고 \\n김밥처럼 돌돌 말아주세요!\\n안에 내용물을 꾹꾹 안쪽으로 눌러가면서 말아주시면 훨씬 수월해요! 이렇게 월남쌈과 삼겹살 쌈밥을 함께 돌돌 말아주시면 됩니다!\\n월남쌈은 잘 찢어지니까 조심해서 말아주세요. 칼로 가운데를 뚝! 잘라서 2등분으로 만들어주세요! 월남쌈으로 만든 왕삼겹살 쌈밥의 단면이예요!\\n삼겹살과 양파, 그리고 상추와 고추장밥까지!\\n정말 알차게 들어있어요!\\n계속해서 같은 방법으로 월남쌈으로 왕삼겹살 쌈밥을 만들어주세요! 월남쌈으로 만든 왕삼겹살 쌈밥이 총 8개가 나왔습니다!\\n사진으로만 봐서는 크기가 그렇게 커 보이지 않지만 \\n실제로 보면 정말 엄청엄청 커요!!! 상추로만 돌돌 말아서 쌈밥을 만들기에는 어려운 부분이 있는데 월남쌈이 촉촉해서 딱 고정 역할을 해줌으로써 \\n잘 풀어지지 않아 좋아요! ^^ 옆쪽에서 월남쌈으로 만든 왕삼겹살 쌈밥을 봐도 \\n정말 예쁘게 돌돌 잘 말렸어요! 얼핏 보면 상추 꽃다발 같아요!\\n싱싱해 보이면서도 모양도 예뻐요!\\n이제 한번 먹어보도록 할게요. 겉에 월남쌈으로 쌈이 싸져 있어서 씹을 때 식감이 정말 쫀득쫀득하면서도 처음 느껴본 맛이예요 ♥\\n맛있어요!!!상추랑 월남쌈이 정말 생각보다 너무 잘 어울려요!\\n안에 들어있는 밥도 그냥 밥이 아닌 고추장으로 양념한 밥이라서 매콤하니 맛있습니다!\\n삼겹살도 쫄깃쫄깃하게 씹히면서 볶은 양파가 고소한 맛까지 뿜어줘서 정말 너무 맛있어요!\', \'알토란 참치 쌈장 & 참치 쌈밥 (김하진샘)..입맛 없을때 추천! [참치쌈장재료]동원참치 2캔,올리브유 1T,다진양파 반개,대파 반대,다진마늘 2T,새송이버섯 반 개,생표고버섯 3개,된장 3T,고추장 3T,맛술 3T,고운고춧가루 1T,청양고추 4개,참기름 1t,고운깨소금 5T\\n[쌈밥재료]양배추, 호박잎,소금 2T,식초2T,소주 2T\\n[밥밑간]흰밥 3공기,참기름 1t,통깨 1T\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\']','월남쌈  왕삼겹살  쌈밥  맛  삼겹살  상추  밥  양파  월남쌈  쌈밥  맛  월남쌈  밥  상추  고추장  양파  참기름  삼겹살  적당량  월남쌈  왕삼겹살  쌈밥  양파  프라이팬  식용유  적당량  양파  프라이팬  정도  정도  양파  삼겹살  프라이팬  프라이팬  프라이팬  정도  삼겹살  삼겹살  삼겹살  이번  왕삼겹살  쌈밥  고추장밥  참기름  고추장  준비  밥  참기름  고추장  왕삼겹살  쌈밥  고추장밥  왕삼겹살  쌈밥  재료  준비  왕삼겹살  쌈밥  월남쌈  준비  월남쌈  월남쌈  접시  위  상추  사진  고추장  참기름  고추장밥  상추  위  고추장밥  위  양파  적당량  양파  위  삼겹살  적당량  월남쌈  내용물  월남쌈  삼겹살  쌈밥  월남쌈  왕삼겹살  쌈밥  양파  상추  고추장밥  월남쌈  왕삼겹살  쌈밥  월남쌈  왕삼겹살  쌈밥  상추  쌈밥  월남쌈  월남쌈  왕삼겹살  쌈밥  \\\\정말  상추  할게요  월남쌈  식감  맛  상추  월남쌈  \\\\안  밥  밥  고추장  밥  \\\\삼겹살  양파  맛  참치  쌈밥  때  참기름  참기름'),(70,'토스트','[\'마늘 버터 토스트 토스트 [재료] 식빵 4장, 체다 슬라이스치즈 3장, 다진 마늘 1, 버터 50g, 설탕, 소금 약간, 파슬리 적당히\\n[시럽 재료 ] 꿀 또는 아가베 시럽 등 버터 50g을 실온에 꺼내 놓고\\n전자레인지에 30초~1분간 돌려 녹여주세요.\\n\\n또는 따뜻한 물에 중탕으로 녹여도 된답니다. 녹인 버터에 다진 마늘 1, 설탕, 소금을 약간 넣어 \\n고루 섞어 주세요. 식빵과 체다 슬라이스 치즈를 준비하고 식빵 사이사이 체더치즈를 넣어 쌓아주세요. 쌓아 놓은 식빵에 마늘 버터를 위쪽 아래쪽, 옆면 등\\n사방으로 듬뿍 발라주세요. 오븐 팬에 빵을 올리고\\n파슬리가루를 적당히 솔솔 뿌려주고 170도에서 13~15분간 구워 주시면 된답니다 노릇하게 구운 토스트를 먹기 좋게 잘라주고\\n그 위에 취향껏\\n꿀이나 아가베 시럽을 뿌려주세요.\\n\\n마늘 버터 토스트 완성 ^^\', \'마늘빵 토스트 마늘빵만 먹기엔 뭔가 부족하다고? 그럴땐 마늘빵토스트를 해먹어보자! 간단하면서도 엄청 맛있는 마늘빵토스트 레시피 공개합니다! 마늘스프레드를 바른면이 쉽게 탈 수 있으니 주의한다. 치즈는 미리 상온에 놔둬 빠르게 녹을 수 있도록 해준다. [빵재료] 식빵 2장, 슬라이스치즈 2장, 피자치즈 1줌\\n[마늘스프레드재료] 버터 1.5큰술, 다진마늘 1큰술, 설탕 1큰술, 파슬리 1큰술 마늘스프레드 재료를 한데 넣고(버터1.5스푼, 다진마늘1스푼, 설탕1스푼, 파슬리1스푼) 잘 섞어준다. 준비한 빵 2개면에 스프레드를 잘 펴발라준다. 팬에 기름을 약간 두르고 스프레드를 바르지 않은 면부터 40초간 굽는다. 그 후 뒤집어서 스프레드를 바른면도 40초가량 굽는다. 구운 식빵을 따로 둔 뒤 팬을 닦고 다시 기름을 두른다. 똑같이 바르지 않은면을 40초간 구운 뒤 바른면을 굽는다. 바른면을 구움과 동시에 슬라이스치즈 - 피자치즈 - 슬라이스치즈를 얹는다. 그 위에 미리 구워두었던 나머지 한 면을 올리고 약불에 치즈를 녹여준다. 치즈가 다 녹으면 반으로 썰어 먹는다.\']','마늘  버터  토스트  토스트  재료  식빵  슬라이스치즈  마늘  버터  설탕  재료  버터  버터  마늘  설탕  소금  식빵  체  치즈  식빵  식빵  마늘  버터  팬  토스트  아가베  시럽  버터  토스트  토스트  마늘빵  마늘빵토스트  바른면  치즈  녹  수  식빵  슬라이스치즈  버터  설탕  파슬리  마늘스프레드  재료  빵  스프레드  팬  스프레드  스프레드  바른면  식빵  팬  뒤  바른면  바른면  슬라이스치즈  피자치즈  슬라이스치즈  위  면  치즈  치즈'),(71,'부대찌개','[\'웬만하면 성공하는 부대찌개 황금레시피.맛나다.^^ 날이 점점 추워지는 요즘.\\n뜨끈한 국물이 생각날때 맛나고 간단한 부대찌게.\\n술한잔 곁들여 먹으면 그만이죠. 캬~~ [재료] 파 약간, 두부 반모, 스팸 큰거 1/2, 국거리 돼지고기 200g, 소세지 2개, 버섯약간\\n[양념장] 다진마늘 1스푼, 고추장 2스푼, 간장 2스푼, 올리고당 1스푼, 맛술 1스푼, 고추가루 3스푼 부대찌개에 들어갈 재료들을 잘 다듬어줍니다. 부대찌게는 육수가 중요해요.\\n저는 사골육수가 있어서 사골로 했는데\\n시판되는 사골육수를 이용하시거나\\n멸치나 다시마 우려서 사용하셔도 되요. 양념장을 만들어 봅니다. \\n다진마늘 1T, 고추장 2T, 고추가루 3T\\n간장 2T, 올리고당 1T,맛술 1T\\n를 잘 섞어줍니다. 손질한 재료들을 냄비에 잘 담아두시고 육수붓고 양념장을 투하합니다. ㅋ~ 보글보글 끓는 부대찌개에 라면하나 투하 이렇게 하면 부대찌게 완성!!\\n집에서 만들어서 재료의 푸짐함이 돋보인답니다. ^^\', \'부대찌개 만드는법 시판 부대찌개 양념으로 초간단요리 며칠전 일상포스팅에 올렸던 부대찌개 레시피를 얼른 올려달란 요청에\\n\\n진땀흘린 루비씨~\\n\\n\\u200b\\n\\n\\u200b왜냐면....\\n\\n\\u200b\\n\\n마트에서 파는 양념장 사서 만들었거던요.\\n\\n쉽고 편하고 맛있어서 오늘은 요걸로다가 ㅋㅋㅋㅋ.\\n\\n\\u200b\\n\\n그래도 요리블로거인디 그람 안된다고 하시는 분들을 위해 \\n\\n부대찌개 양념장 황금레시피를 살짜기 갈챠드릴께욤\\n\\n부대찌개 양념장 레시피\\n\\n▼\\u200b\\n\\n\\u200b고춧가루 3아빠숟가락, 고추장 1아빠숟가락, 된장 1아빠숟가락, 국간장 2아빠숟가락, \\n\\n다진마늘 1아빠숟가락, 후추약간, 맛술 1아빠숟가락\\n\\n\\u200b\\n\\n\\u200b시판 양념장 안사시고 직접 만들분들은 저렇게 만드심 됩니다요 ^^\\n 양념장 직접 만드실분들은\\n▼\\n부대찌개 양념장 레시피\\n\\n\\u200b고춧가루 3아빠숟가락, 고추장 1아빠숟가락, 된장 1아빠숟가락, 국간장 2아빠숟가락, \\n\\n다진마늘 1아빠숟가락, 후추약간, 맛술 1아빠숟가락\\n\\n\\u200b\\n\\n\\u200b시판 양념장 안사시고 직접 만들분들은 저렇게 만드심 됩니다요 ^^\\n [재료] 스팸 or 런천미트 1캔, 마늘맛햄 1조각, 수제프랑크햄 4개, 어묵 2장, 두부 1/2모, 김치 2장, 팽이버섯 약간, 라면사리 1개, 냉동만두 적당히, 대파 1/3뿌리\\n[양념] 시판 부대찌개양념 140g 한봉지, 물 재료가 잠길만큼 먼저 햄을 골고루 준비하시는디\\n\\n스팸이나 런천미트같은 부들부들한 햄부터 탱탱한 식감이 좋은\\n\\n수제소시지도 같이 곁들임 더 좋쥬.\\n\\n어묵도 두장만 넣읍시다. 고명으로 얹을 팽이버섯과\\n\\n두부반모, \\n\\n맛을 더해줄 묵은지도 두어줄 꺼내시고용. 스팸종류는 얇게 썰어야 맛나더라고요.\\n\\n짧은시간에 간이 쏘옥 ^^\\n\\n재료들을 가지런히 썰어봅시닷. 김치는 볶음밥에 넣듯 잘게 손질해 주세유 ~~ 전골냄비나 프라이팬 움푹 파인거 있쥬??? 햄부터 가지런히 놔주시고~~\\n\\n너무 많나??\\n\\n근디 부대찌개집 가면 햄이 좀 아쉽자나유.\\n\\n집에서 해묵는건께 맘껏 넣어부쇼!! 만두와 두부 김치는 위쪽에 올려주시게유.\\n\\n햄맛이 밑에서부터 은근히 올라오게 ^^ 팽이버섯에 대파까지 올려주셨음 다한겁니다 ㅋㅋㅋ 루비씨는 시판용 부대찌개 양념을 샀는디\\n\\n저정도 양에 요 한봉지면 딱입니다요.\\n\\n\\u200b\\n\\n(요런 시판제품 쓰기싫으신 분들은 아까 윗쪽에 양념장 레시피 써놨응께 고거보고 하시고요~\\u200b) 일단은 요 다* 부대찌게 양념을 몽땅 올려주세유. 뻘건게 벌써부터 그림이 그려지쥬???\\n\\nㅎㅎ 요기서 포인트 아닌 포인트 나오는디~~\\n\\n\\u200b\\n\\n\\u200b요 부대찌개가 들어있던 봉지에 물을 한가득 넣으셔서 부어주시와요.\\n\\n안쪽에 있는 남은 양념들도 깨끗히 처리되고 좋아유 ㅋㅋ 사진에 보이는것쳐럼 물양이 좀 많다싶게 넣어줍니다.\\n\\n잠길정도로~~\\n\\n왜냐하믄..\\n\\n이따 라면넣음 국물이 쫄아불자나유 ^^ 이제 바글바글 끓어오를때까지 \\n잘 달궈주는거 알쥬??\\n\\n아..\\n\\n요때 냄시가 기가맥히쥬 ㅎㅎ 부대찌개의 꽃!!\\n\\n라면사리 등장이요~~\\n\\n당면도 넣음 맛있지만 나중에 남은 부대찌개 데펴묵을때 처리하기 귀찮더라고요.\\n\\n\\u200b라면은 농* 소고기면을 썼는디요,\\n\\n\\u200b요거이 싸고 면발이 굵지않아서 빠른시간내에 간이 쏘옥, 잘익더라고요 ㅎ 누가 찍었는지..\\n\\n사진 참~~\\n\\n겁나 맛나것다.\\n꼬들꼬들 맛나게 적당히 익은 면발부터 \\n\\n호로록~~!!\\n\\n아시쥬?? 안을 휘휘 저어 한국자 푸니\\n\\n루비씨가 좋아하는 햄이 몽땅!!!\\n\\n아~~\\n\\n햄볶아유 ~~ 쌀쌀해지는 날씨에 뜨끈한 국물이 생각나는 계절입니다.\\n\\n부대찌개 끓여서\\n\\n옹기종기 둘러앉아 \\n\\n푸짐하고 맛나게 오늘한끼 즐겨보심이 어떠신지요??\\n\\n \\n\\n맛이요??\\n\\n \\n\\n놀* 부대찌게, 의정부 부대찌개, 쏭* 부대찌개 ~~\\n\\n쩌리 가라해유 ㅋㅋ\\n\\n \\n\\n겁나게 맛나부러요!!!\']','부대찌개  국물  부대찌  재료  두부  고추장  맛술  부대찌개  부대찌  사골육수  양념장  고추장  고추가루  올리고당  재료들  양념장  부대찌개  부대찌  재료  부대찌개  부대찌개  양념  부대찌개  양념장  양념장  황금레시피  양념장  고추장  맛술  양념장  양념장  양념장  고추장  된장  국간장  \\\\\\\\다진마늘  후추약간  맛술  양념장  안사시  만들분들  ^^\\\\  재료  스팸  두부  김치  약간  시판  재료  햄  햄  김치  손질  햄  햄  두부  김치  팽이버섯  대파  부대찌개  양념  한봉지  들  양념장  레시피  부대찌  양념  포인트  부대찌개  양  국물  때  \\\\\\\\  부대찌개  부대찌개  처리  간  햄  국물  \\\\\\\\부대찌개  \\\\\\\\  \\\\\\\\  부대찌  부대찌개  부대찌개'),(72,'똠양꿍','[\'김유아의 똠양꿍 - 오늘 뭐 먹지? 78회 오늘 뭐 먹지? 78회\\n방송일 : 2015.07.09\\n동영상 출처 : 오늘 뭐 먹지? - 곰tv [메인재료] 타이거새우 2마리(5-10미), 물 1L, 청주 적당량 1/2C, 라임 잎 2장, 갈랑갈 1개, 레몬그라스 2뿌리, 베트남고추 3개, 고수 2개, 방울토마토 3개, 적양파 1/2개, 볶은 쌀가루 1/3T, 멸치액젓 2T, 설탕 2t, 라임즙 3T, 총알새송이버섯 1줌, 느타리버섯 1줌, 홍고추 1개, 고춧가루 1/2T, 쪽파 약간, 남프릭파오 1/2T 새우를 청주에 5분간 재운 후 대가리와 껍질을 떼고, 등 가운데 부분을 칼로 갈라 모양을 낸다. 마른 냄비에 레몬그라스, 갈랑갈, 라임 잎, 베트남고추, 고수뿌리를 넣어 볶는다. 물을 붓고 길게 썬 적양파와 반으로 자른 방울토마토를 넣어 뭉근하게 끓인다. 육수가 끓으면 새우 대가리와 몸통, 볶은 쌀가루를 넣는다. 남프릭파오(칠리페이스트)와 고춧가루를 넣고 끓이다 새우 몸통을 건져낸다. 물에 희석한 멸치액젓과 설탕, 라임즙을 넣어 간을 맞춘다.\', \'크린커리 만들기, 조금 색다른 태국 전통음식 저는 뉴질랜드에 와서 처음 먹어본 음식이 꽤 많습니다. 그 중에서 가장 많이 사먹었던 음식은 타이전문점에서 판매하는 그린커리, 똠양꿍, 팟타이인데요. 달큰한 맛의 그린커리와 팟타이를 처음부터 좋아하지는 않았습니다. 매콤한 똠양꿍이 제 입맛에 맞았죠. \\n\\n하지만 각자 좋아하는 것을 하나씩 시켜 먹다보니 자연스럽게 신랑이 좋아하는 그린커리와 팟타이도 좋아지게 되었답니다. 처음에는 미처 느끼지 못했던 맛들이 하나둘씩 느껴지면서 나중에는 [ 와, 진짜 맛있다! ] 라고 말하며 먹게 되었죠. 오늘은 그 중에서 그린커리를 만들어 봤습니다. [재료] 그린커리 페이스트 50g, 코코넛 크림 270g, 우유 200ml, 닭가슴살 250g, 감자 100g, 당근 55g, 브로콜리 50g, 콜리플라워 50g, 양파 40g, 피쉬소스 2큰술, 설탕 1큰술, 레몬쥬스 1큰술 그린커리 페이스트를 구입했어요. 살짝 매콤한 맛을 가지고 있는 그린커리는 연두빛을 띄어서 그린커리로 불리게 되었다고 하네요. 코코넛 크림 통조림 270ml를 구입했어요. 뚜껑을 열어보니 농도가 짙은 것이 향과 육안으로 느껴지더군요. 레몬쥬스와 피쉬소스입니다. 콜리플라워와 브로콜리는 끓는 물에 1분간 데쳐서 준비했어요. 당근은 얇게 썰어주세요. 분필 크기로 자른 감자를 기름 두른 팬에 살짝 볶아준 다음 당근을 넣어서 조금 더 볶아줬어요. 닭가슴살은 한입 크기로 작게 썰어서 살짝 볶아줬어요. 비교적 단단한 야채인 감자와 당근, 닭고기를 냄비에 넣은 다음 코코넛 크림을 넣어주세요. 그린커리 페이스트를 넣어주세요. 피쉬소스 2큰술, 레몬쥬스(즙) 1큰술, 설탕 1작은술을 넣어주세요. 감자가 다 익으면 미리 익혀둔 브로콜리와 콜리플라워, 볶은 양파를 넣어주세요. 보글보글 끓으면 불을 꺼주세요. 이제 완성 되었어요. 밥 위에 올려 비벼 먹어도 맛있고 따로 떠먹어도 맛있어요.\']','오늘  뭐  오늘  뭐  오늘  뭐     라     설탕     새우  청주  라  잎  물  적양파  방울토마토  새우  대가리  쌀가루  고춧가루  새우  몸통  물  멸치액젓  설탕  라임즙  음식  그린커리  맛  그린커리  똠양꿍  저  그린커리  팟타이  맛  라  오늘  중  그린커리  그린커리  페이스트  코코넛  크림  당근  브로콜리  피쉬소스  설탕  그린커리  페이스트  매콤한  맛  그린커리  그린커리  코코넛  크림  구입  것  레몬쥬스  피쉬소스  콜리플라워  브로콜리  물  당근  감자  당근  닭가슴살  감자  당근  냄비  다음  코코넛  크림  그린커리  페이스트  피쉬소스  설탕  감자  브로콜리  양파'),(73,'매운탕','[\'꼬막 오징어 매운탕 맛있는 꼬막이랑 오징어를 넣고 끓여 봤습니다.요즘 처럼 쌀쌀한 날씨 따끈하게 밥 말아 한그릇 맛있지 않을까요?ㅎ 삶은 꼬막 1컵, 오징어 1마리, 홍청양고추 2개, 배추 1컵, 양파 1컵, 대파 1컵, 다시마육수 3컵 고추기름 2큰술, 다진마늘 1큰술, 고추가루 2큰술, 간장 1/2큰술, 된장 1작은술, 참치액 2작은순 배추.양파.대파는 썰어서 각1컵이 되게 해주세요. 오징어는 채썰고 홍청양고추는 송송 다져주세요.\\n삶은 꼬막도 준비해주세요. 팬에 고추기름 2큰술을 넣고 대파.양파를 넣고 볶다가 배추를 넣고 볶아주세요.(3~4분정도) 꼬막.오징어.홍청양고추를 넣고 1~2분 정도 볶다가 다진마늘,고추가루.간장.된장을 넣고 다시마육수를 붓고 끓여주세요(5~8분 정도)참치액을 넣고 간을 맞춰주세요. 완성그릇에 담아주세요.\', \'남극빙어 매운탕 조금은 생소한 재료인 남극빙어로 조리한 매운탕입니다.\\n얼큰하고 칼칼한 국물과 담백하고 고소한 남극빙어의 조화가 일품입니다. * 육수를 만드실 때 마시마를 너무 오래 끓이게 되면 다시마에서 끈적함이 우러나와 국물이 탁해져요! 그러니 잠깐만 끓여주세요.\\n* 육수가 준비되면 탕을 조리하기 전에 무를 먼저 넣고 끓여주면 더욱 맛이 더욱 시원해져요. [재료] 남극빙어 4마리, 바지락 6~8개, 무 1/4개, 두부 반모, 대파, 팽이버섯, 쑥갓, 양파 1/4개, 육수용 다시마, 건새우\\n[양념재료] 된장 1/2큰술, 고추장 1큰술, 고춧가루 2큰술, 매운 고춧가루 1작은술, 액젓 1큰술, 국간장 2큰술, 맛술 2큰술, 다진마늘 1.5큰술 다시마, 멸치, 건새우 등을 한줌씩 넣어 육수를 만들어 주세요. 준비된 육수에 무를 넣고 팔팔 끓여주세요. 무가 반쯤 익으면 준비된 양념장을 육수에 풀어주세요. 육수가 펄펄 끓으면 남극빙어 (2인분 기준 4마리)와 양파를 넣고 끓여주세요. 생겨나는 거품을 계속 거두어 주면서 무가 푹 익을때까지 끓여 주세요. 두부, 콩나물, 팽이버섯, 그리고 대파를 넣어 한소끔 끓인 뒤 마무리 해주세요.\']','오징어  매운탕  오징어  꼬막  오징어  홍청양고추  배추  양파  대파  된장  배추  양파  대파  오징어  홍청양고추  꼬막  준비  고추기름  대파  양파  배추  꼬막  오징어  홍청양고추  간장  된장  다시마육수  정도  참치액  매운탕  남극빙어  매운탕  남극빙어  육수  국물  육수  준비  재료  남극빙어  무  대파  양파  된장     고춧가루  다진마늘  육수  준비  육수  무  준비  육수  육수  남극빙어  양파  무  때  두부  팽이버섯  대파'),(74,'순대','[\'비오는날 순대 볶음 사람들이 좋아하는 순대를 야채와 섞어 순대 볶음을 만들었어요..\\n들깨를 뿌려 넣으니까 고소하고 담백해요~ 순대는 반드시 한번 쪄서 볶아 주세요.\\n순대는 마지막에 넣어 주세요~\\n표고버섯은 안넣어도 상관없습니다. [재료] 찹쌸 순대 1팩, 홍고추 1개, 깻잎 5장, 양파 1/2개, 양배추 100g, 표고버섯 2개\\n[양념] 고추장 1.5T, 맛술 1T, 설탕 1T, 매실청 1 T, 간장 1T, 생강술 2T 찜기에 순대 10분 정도 쪄주세요. 양배추,양파는 채 썰어 줍니다. 깻잎은 깨끗이 씻어 반으로 갈라 잘라 주세요. 표고버섯은 좀 두툼하게 잘라주세요. 청,홍고추는 송송 썰어줍니다. 순대는 뜨거우니 두툼하게 잘라 식혀 주세요. 팬에 기름 두르고 양배추,양파,표고 버섯을 넣어 볶아 줍니다. 야채가 볶아지면 물이 생기는데 이때 양념도 넣어 주세요. 거의 볶아지면 불을 줄여 순대를 넣어 볶아주세요.\\n순대에 당면을 넣어서 그런지 국물을 다 흡수하니 불을 줄이거나 끄고 볶아 주세요.\\n쪘으니까 괜찮습니다. 마지막으로 깻잎 ,통깨 넣어 완성합니다.\', \'인삼 쏙쏙 ! 오징어 순대 인삼 하면 생각나는 대표적인 요리는 삼계탕 인데요. 인삼과 닭은 궁합이 아주 좋지만 오징어 순대 속에 넣어서 먹어보니 오징어와도 궁합이 아주 잘 맞더라구요. 오징어 순대에 인삼 향이 은은하게 나서 더욱 맛이 증가하고, 건강해지는 기분이 들었어요. 또 만들고 남은 소는 동그랑땡으로 부쳐 드셔도 좋아요. 오늘 저녁 맛도 영양도 챙길 수 있는 인삼 쏙쏙! 오징어순대 만들어서 드셔보세요 ^0^!\\n 1. 오징어 속은 너무 많이 채우면 오징어가 터질 수 있으니 80%정도만 채운 후 내용물이 흐르지 않도록 이쑤시개로 잘 고정해준다.\\n2. 오징어 순대가 익으면서 부풀어서 터질 수 있기 때문에 찌기 전에 몸통을 이쑤시개로 콕콕 찌른 후 쪄주세요.\\n3. 소를 충분히 치대주어야 잘랐을 때 깔끔해요. [재료] 오징어(몸통/다리) 3ea, 다진 돼지고기(앞다리살) 250g, 당면 80g, 부추 1/2줌, 양파 1/2ea, 당근 1/4ea, 인삼 3ea, 청양고추 1ea\\n[부재료] 소금 2/3T, 후추 1/2T, 참기름 1T, 다진마늘 1T, 다진 파 1/2T, 계란노른자 1ea, 굴소스 2T 오징어는 몸통과 다리를 분리한 후 몸통 안에 있는 내장과 뼈를 제거하고 흐르는 물에 깨끗이 씻어서 준비한다. 분량의 재료들은 깨끗하게 씻어서 준비한다. -분량의 오징어 다리와 야채는 곱게 다져서 준비한다.\\n-분량의 당면은 끓는 물에 넣고 약 6분간 삶은 후 찬물에 행군 뒤 물기를 빼고 곱게 채 썰어 준다. 큰 사이즈의 그릇에 미리 손질해 놓은 분량의 오징어 다리, 다진 돼지고기, 당면, 부추, 당근, 양파, \']','순대  순대  야채  순대  순대  순대  깻잎  양파  양배추  순대  양배추  양파  깻잎  깨끗  표고버섯  순대  두툼  양배추  양파  야채  물  순대  \\\\순대  당면  마지막  깻잎  인삼  오징어  순대  인삼  인삼  오징어  순대  오징어  궁합  오징어  순대  인삼  맛  수  인삼  오징어  속  오징어  수  후  오징어  순대  수  몸통  이쑤시개  후  소  재료  당면  양파        인삼           오징어  몸통  다리  후  몸통  물  깨끗  준비  분량  깨끗  준비  분량  오징어  다리  야채  준비  당면  물  후  채  분량  오징어  다리  당면  부추  당근  양파'),(75,'청국장','[\'청국장찌개 만들기~ 구수하니 청국장 맛있게 끓이는 법 모락 모락 김이 피어오르는 청국장찌개.\\n호록호록 보글보글 뜨끈한 국물이 온몸을 녹여주는데요.\\n쉽고 구수한 맛 청국장 맛있게 끓이는 법.\\n [재료] 애호박 1개, 양파 1/2개, 감자 2개, 산타리버섯 100g, 청양고추 2개, 청국장 100g, 된장 2큰술, 고춧가루 2큰술, 마늘 2큰술, 다시마 4장, 물 15L 물 1.5L 붓고 다시마 4장을 투하해서\\n불에 올렸다.\\n다시마 국물을 우린 후 \\n물이 끓으려 하면 꺼낸다.\\n요는 그렇다.\\n다시마는 굳이 끓이지 않아도 맛있는 맛은 \\n이 단계에서 다 우러난다고 한다.\\n더 두면 끈끈해지고 텁텁한 맛이 난다고 하니\\n그냥 건져낸다. 마늘 2큰술과 청국장이다. 감자 2개 껍질 벗기고\\n산타리버섯 밑동을 제거하고\\n애호박도 준비하고\\n청양고추 2개와 양파 1/2개를 준비했다. 애호박과 감자는 두툼하게 은행잎 모양으로 썰었다.\\n산타리버섯은 쭉쭉 찢어주고\\n양파도 청양고추도 굵직하게 썰어뒀다.\\n대파는 없어서 생략. \\n양파라도 있어서 다행이다.\\n양파의 달큼함이 참 좋다. 나는 그새 물이 끓어서 \\n청국장에 된장 2큰술을 넣고 \\n다시물을 조금 덜어서 풀어줬다. 청국장과 된장 푼 것을 뚝배기에 풀었다. 보글보글 물이 끓으면 감자를 먼저 넣고\\n5분 정도 끓여서 익힌다. 애호박과 양파를 넣고 \\n애호박이 설컹하게 익으면 산타리버섯과 청양고추를 넣어주었다.\\n허걱~ \\n 그릇이 작다.\\n분명 끓으면 넘치겠지.\\n약불로 줄였다. 국물을 덜어서 고춧가루 2큰술을 풀어 준 후 다시 청국장이 끓고 있는 뚝배기에 부었다.\\n할 수 없이 밥 한 공기 못되게 국물을 덜어낸 다음 \\n국물이 자작하게 된 다음 \\n다시 부었다. 뜨끈하니 청국장찌개가 \\n맛나게도 끓어오른다. 야채는 이 정도면 다 익은 듯하다. 산타리버섯도 들어 올린다.\', \'쌀쌀한 날씨 쌀뜬물로 끓여 더욱 깊은맛 쇠고기 청국장 비도 많이 오고 늦가을이다 보니 쌀쌀해서 쇠고기 넣고 쌀뜬물로 청국장을 끓였는데 진짜 맛있었어요.\\n청국장 주말에 만들어 따뜻하게 보내세요. 청국장은 처음에 쌀뜬물과 같이 끓여 푸셔야 해요.\\n또 국멸치를 안넣으면 고기의 맛이 살아 더 깊은맛이 납니다. [재료] 청국장 150g, 쇠고기 50g, 표고버섯 1개, 달래 20g, 김치 100g, 애호박 1/3, 청양고추 1개, 소금 1t, 액젓 1t 애호박은 반달로 썰어 또 반으로 잘라줍니다. 표고버섯은 슬라이스 합니다. 달래는 1cm길이로 잘라 주세요. 두부는 반갈라 다시 반으로 잘라줍니다. 김치는 송송 썰어 주세요. 고기는 작게 잘라주세요. 청양고추는 어슷썹니다. 뚝배기에 다시마,청국장,쌀뜬물을 넣어 끓여주세요. 끓으면 다시마 건져 내고 청국장도 풀어졌으면 애호박과 두부,표고버섯 넣어 더 끓입니다. 달래와 청양고추로 마무리 하시면 됩니다.\']','청국장찌개  청국장  모락  청국장찌개  국물  맛  청국장  애호박  양파  산타리버섯  청양고추  청국장  된장  다시마  국물  \\\\다시마  맛  맛  마늘  청국장  양파  애호박  청양고추  된장  청국장  된장  뚝배기  보글보글  물  애호박  양파  산타리버섯  청양고추  \\\\  국물  고춧가루  후  청국장  뚝배기  국물  다음  청국장찌개  정도  산타리버섯  쌀뜬물  쇠고기  청국장  쇠고기  쌀뜬물  청국장  \\\\청국장  청국장  쌀뜬물  맛  깊은맛  재료  청국장  쇠고기  표고버섯  애호박  청양고추  애호박  표고버섯  반  김치  청양고추  뚝배기  청국장  애호박  두부  표고버섯  청양고추'),(76,'마라탕','[\'얼큰한 국물요리 마라탕 만들기 향신료의 사용이 다채로운 나라일수록 그 요리의 다양성도 참 광범위한 것 같습니다. 분명 이러한 맛이 나겠다 예상하고 막상 첫 술을 떠 보면 전혀 다른 자극 또는 향미로 색다른 맛의 세계를 경험하기도 합니다. 그렇기 때문에 익숙한 음식이 아닌 새로운 음식을 맛보는 것에 도전하는 일은 늘 새롭고 흥미로운 일 같습니다.\\n\\n대학생이 처음 되고 제가 속해 있던 공동체에서 육로 대장정이란 콘셉트로 티베트로 떠난 적이 있습니다. 아시다시피 소수민족 자치구라 특정 일부 지역에 모여 사는데요. 그 빌리지가 쓰촨 성에 있어서 참 다채로운 음식들을 맛볼 수 있었습니다.\\n\\n지금으로부터 약 10년 전이니, 그 당시만 해도 한국에 중국식 핫 팟, 훠궈나 마라탕이 잘 알려져 있던 때가 아니었습니다. 한국으로 돌아오기 전 마지막 날 맛봤던 마라탕의 맛이 지금도 생생합니다. 톡 쏘는 매콤한 향에 수많은 재료들을 넣어가며 즐기는 푸짐한 음식. 한국의 매운맛과는 다른 톡 쏘는 알싸한 매운맛이 참 재밌었던 기억이 납니다. 오늘은 얼큰한 국물요리 레시피, 마라탕 만들기로 여러분과 함께 해 볼까 합니다. 1) 마라 페이스트를 볶으실 땐 불을 약하게 조절해 주세요.\\n2) 기호에 맞는 다양한 재료를 추가해 보세요. [재료] 낙지 1마리, 손질 홍합 2개, 손질 새우 100g, 스팸 1/3캔, 청경채 100g, 만가닥 버섯 100g, 두부 1/4모\\n[ 마라탕 육수 재료 ] 마라 페이스트 100g, 식용유 4T, 물 500mL **만개의 레시피를 통해 제공되는 메이플대니얼의 컨텐츠는 사진형으로 보실 때 더욱 좋습니다** 먼저 청경채는 깨끗하게 씻어 물기를 어느 정도 제거해 주시고, 크기에 따라 모양 그대로 혹은 세로방향으로 2~4등분 해 주세요. 만가닥 버섯은 밑동 붙어 있는 부분을 대강 떼어 준비할게요. 두부와 스팸은 1cm 정도의 두툼한 두께로 잘라서 준비해 주세요. 이렇게 훠궈나 마라탕에 사용할 수 있는 페이스트 패키지를 판매하더라고요. 요새는 다양한 중국 제품이 수입되는데, 이렇게 페이스트 타입이 있고 또 육수에 향신료가 잔뜩 들어간 제품도 있는데. 페이스트로 되어있는 데 입에 걸리는 잔여감이 적어 훨씬 추천해 드리고 싶습니다. 1인분을 하실 때 약 100g 정도 사용해 주시면 적당합니다. 먼저 냄비를 강불에서 2분간 예열 후 식용유 4 큰 술을 두르고 마라 페이스트 100g을 넣고 5분 정도 잘 볶아주세요. 페이스트를 넣은 다음에는 튀기 쉬우니 중불로 줄여주세요. 짜장을 만드실 때 춘장을 기름에 튀기듯 볶는 느낌으로 조리해 주시면 됩니다. 이 과정을 통해 한층 풍미가 진해져요. 잘 볶아진 마라 양념에 물을 500mL 정도 넣고 끓여주세요. 한소끔 끓인 육수가 준비되었다면 냄비에 청경채, 손질 새우, 홍합, 낙지, 두부, 스팸, 만가닥 버섯 등 준비한 재료를 냄비에 넉넉히 담고 육수를 부어주세요. 이렇게 한소끔 끓여 상에 내주시면 얼큰한 국물요리 마라탕 만들기 완성입니다. 샤부샤부처럼 육수만 준비해서 끓여가며 드시면 끝까지 따끈하게 즐길 수 있어서 좋고, 이렇게 한 번에 끓여 전골처럼 준비하시면 좀 더 간편하게 즐길 수 있다는 장점이 있습니다. 우리네 매운탕과는 사뭇 다른 비주얼이지만, 충분히 얼큰하고 알싸한 향이 해물과 조화도 아주 좋은 것 같아요. 한소끔 끓인 마라탕은 역시 국물과 함께 즐겨야 제맛인데요. 원하는 재료는 얼마든지 취향에 따라 추가하여 즐기실 수 있습니다.여기에 중국 당면을 넣어 드시거나 가락국수 사리 같은 재료를 넣어 식사처럼 마무리하시면 한결 든든하게 드실 수 있답니다. 오늘은 얼큰한 국물요리로 제격인 마라탕 만들기 레시피로 여러분과 함께했습니다. 생각보다 그 만드는 과정이 간단하죠? 신선한 재료로 집에서 만들어 먹으면 훨씬 합리적인 가격으로 푸짐하게 즐길 수 있답니다. 오늘도 맛있게 즐기세요! :)\', \'마라탕 만들기 , 대림동 느낌! 마라탕은 특유의 향신료 향이 나는 중국요리로, 맛은 혀가 얼얼해지도록 매콤한 것이 특징입니다. \\n대림시장에 있는 식품점에서 사온 마라탕 소스로 손쉽게 만들어보았습니다.\\n 먹고 싶은 재료를 마음껏 넣어보세요. [재료] 마라탕소스 1개, 물(1컵=240ml) 4~5컵, 마늘 1Ts, 배추 1/8포기, 청경채 4개, 새송이버섯 2개, 느타리버섯 1팩, 팽이버섯 1봉, 콩나물 1주먹, 물에 불린 당면 1주먹, 푸주 1/2봉, 후랑크소세지 5개, 소고기(불고기용) 300g, 양파 1개, 지마장소스(생략가능) 필요한만큼 당면과 푸주는 2시간 정도 물에 불려서 준비하고 나머지 건더기 재료를 손질한다 끓는 물에 마라탕 소스를 넣는다. 배추, 양파, 버섯, 소세지, 당면, 푸주를 넣는다. 양파가 반 정도 익으면 소고기, 청경채, 팽이버섯을 넣는다. 고기가 익으면 바로 불을 끄고 지마장소스에 찍어 먹는다.\']','국물요리  마라탕  향신료  사용  것  맛  맛  음식  음식  것  일  다채로운  수  마라탕  때  한국  전  마라탕  맛  향  음식  매운맛  오늘  얼큰한  국물요리  마라탕  페이스트  재료  재료  손질  손질  청경채  만가닥  버섯  두부  마라탕  육수  재료  페이스트  때  청경채  정도  만가닥  버섯  두부  스팸  정도  훠궈  마라탕  사용  수  페이스트  페이스트  육수  향신료  제품  페이스트  때  약  정도  사용  냄비  식용유  술  페이스트  정도  페이스트  때  물  정도  한소끔  육수  냄비  청경채  손질  새우  홍합  낙지  두부  만가닥  버섯  재료  냄비  육수  한소끔  얼큰한  국물요리  마라탕  육수  준비해  수  수  향  것  한소끔  마라탕  재료  추가  수  중국  당면  재료  수  오늘  얼큰한  국물요리  마라탕  레시피  여러분  과정  재료  수  오늘  마라탕  향신료  향  맛  매콤한  것  마라탕  재료  재료  청경채  물  당면  푸주  양파  당면  푸주  정도  물  준비  재료  손질  물  마라탕  소스  배추  양파  버섯  당면  푸주  양파  정도  소고  청경채  팽이버섯  불');
